INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1, 'Litwo! Ojczyzno moja! ty jesteś jak zdrowie:', '2021-01-01, 14:14:12', 73, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2, 'Ile cię trzeba cenić, ten tylko się dowie,', '2021-01-01, 14:17:27', 30, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3, 'Kto cię stracił. Dziś piękność twą w całej ozdobie', '2021-01-01, 14:17:39', 2, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4, 'Widzę i opisuję, bo tęsknię po tobie.', '2021-01-01, 14:17:55', 88, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5, 'Panno święta, co Jasnej bronisz Częstochowy', '2021-01-01, 14:18:07', 13, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6, 'I w Ostrej świecisz Bramie! Ty, co gród zamkowy', '2021-01-01, 14:18:36', 98, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (7, 'Nowogródzki ochraniasz z jego wiernym ludem!', '2021-01-01, 14:18:36', 65, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (8, 'Jak mnie dziecko do zdrowia powróciłaś cudem', '2021-01-01, 14:19:53', 28, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (9, '(Gdy od płaczącej matki, pod Twoją opiekę', '2021-01-01, 14:20:12', 15, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (10, 'Ofiarowany, martwą podniosłem powiekę;', '2021-01-01, 14:20:37', 91, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (11, 'I zaraz mogłem pieszo, do Twych świątyń progu', '2021-01-01, 14:24:01', 71, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (12, 'Iść za wrócone życie podziękować Bogu),', '2021-01-01, 14:24:01', 5, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (13, 'Tak nas powrócisz cudem na Ojczyzny łono.', '2021-01-01, 14:24:22', 98, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (14, 'Tymczasem przenoś moją duszę utęsknioną', '2021-01-01, 14:26:42', 41, 16, false);
