INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (379, 'Z kim on żył? co porabiał? Każdy gdzie chce wchodzi,', '2021-01-12, 15:58:24', 99, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (380, 'Byle nie szpieg rządowy i byle nie w nędzy.', '2021-01-12, 15:58:28', 73, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (381, 'Jak ów Wespazyjanus nie wąchał pieniędzy', '2021-01-12, 16:01:40', 48, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (382, 'I nie chciał wiedzieć, skąd są, z jakich rąk i krajów,', '2021-01-12, 16:01:52', 84, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (383, 'Tak nie chcą znać człowieka rodu, obyczajów!', '2021-01-12, 16:03:08', 26, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (384, 'Dość, że ważny i że się stempel na nim widzi,', '2021-01-12, 16:07:24', 65, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (385, 'Więc szanują przyjaciół jak pieniądze Żydzi».', '2021-01-12, 16:07:27', 26, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (386, 'To mówiąc, Sędzia gości obejrzał porządkiem;', '2021-01-12, 16:08:38', 6, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (387, 'Bo choć zawsze i płynnie mówił, i z rozsądkiem,', '2021-01-12, 16:08:40', 46, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (388, 'Wiedział, że niecierpliwa młodzież teraźniejsza,', '2021-01-12, 16:08:47', 15, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (389, 'Że ją nudzi rzecz długa, choć najwymowniejsza.', '2021-01-12, 16:12:01', 77, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (390, 'Ale wszyscy słuchali w milczeniu głębokiem.', '2021-01-12, 16:12:25', 6, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (391, 'Sędzia Podkomorzego zdał się radzić okiem;', '2021-01-12, 16:16:38', 31, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (392, 'Podkomorzy pochwałą rzeczy nie przerywał,', '2021-01-12, 16:17:52', 6, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (393, 'Ale częstym skinieniem głowy potakiwał.', '2021-01-12, 16:22:15', 28, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (394, 'Sędzia milczał, on jeszcze skinieniem przyzwalał;', '2021-01-12, 16:25:34', 49, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (395, 'Więc Sędzia jego puchar i swój kielich nalał,', '2021-01-12, 16:28:39', 71, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (396, 'I dalej mówił: «Grzeczność nie jest rzeczą małą:', '2021-01-12, 16:28:53', 67, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (397, 'Kiedy się człowiek uczy ważyć, jak przystało,', '2021-01-12, 16:29:05', 93, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (398, 'Drugich wiek, urodzenie, cnoty, obyczaje,', '2021-01-12, 16:29:07', 89, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (399, 'Wtenczas i swoją ważność zarazem poznaje:', '2021-01-12, 16:29:36', 5, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (400, 'Jak na szalach, żebyśmy nasz ciężar poznali,', '2021-01-12, 16:29:44', 69, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (401, 'Musim kogoś posadzić na przeciwnej szali.', '2021-01-12, 18:33:50', 31, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (402, 'Zaś godna jest waszmościów uwagi osobnej', '2021-01-12, 18:34:02', 93, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (403, 'Grzeczność, którą powinna młodź dla płci nadobnej;', '2021-01-12, 18:35:13', 21, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (404, 'Zwłaszcza gdy zacność domu, fortuny szczodroty', '2021-01-12, 18:37:25', 56, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (405, 'Objaśniają wrodzone wdzięki i przymioty.', '2021-01-12, 18:40:43', 55, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (406, 'Stąd droga do afektów i stąd się kojarzy', '2021-01-13, 00:44:06', 3, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (407, 'Wspaniały domów sojusz. Tak myślili starzy.', '2021-01-13, 00:45:23', 17, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (408, 'A zatem…» Tu Pan Sędzia nagłym zwrotem głowy', '2021-01-13, 00:45:26', 13, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (409, 'Skinął na Tadeusza, rzucił wzrok surowy:', '2021-01-13, 00:46:38', 72, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (410, 'Znać było, że przychodził już do wniosków mowy.', '2021-01-13, 00:46:49', 49, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (411, 'Wtem brząknął w tabakierę złotą Podkomorzy,', '2021-01-13, 00:47:13', 14, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (412, 'I rzekł: «Mój Sędzio, dawniej było jeszcze gorzéj!', '2021-01-13, 00:47:30', 70, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (413, 'Teraz, nie wiem, czy moda i nas starych zmienia,', '2021-01-13, 00:48:57', 88, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (414, 'Czy młodzież lepsza, ale widzę mniej zgorszenia.', '2021-01-13, 00:49:18', 97, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (415, 'Ach, ja pamiętam czasy, kiedy do ojczyzny,', '2021-01-13, 00:49:26', 89, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (416, 'Pierwszy raz zawitała moda francuszczyzny!', '2021-01-13, 00:49:26', 28, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (417, 'Gdy raptem paniczyki młode z cudzych krajów', '2021-01-13, 00:49:36', 50, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (418, 'Wtargnęli do nas hordą gorszą od Nogajów,', '2021-01-13, 00:50:38', 80, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (419, 'Prześladując w ojczyźnie Boga, przodków wiarę,', '2021-01-13, 00:50:55', 80, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (420, 'Prawa i obyczaje, nawet suknie stare.', '2021-01-13, 00:53:23', 35, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (421, 'Żałośnie było widzieć wyżółkłych młokosów,', '2021-01-13, 00:53:41', 4, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (422, 'Gadających przez nosy, a często bez nosów,', '2021-01-13, 00:53:47', 89, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (423, 'Opatrzonych w broszurki i w różne gazety,', '2021-01-13, 00:54:52', 69, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (424, 'Głoszących nowe wiary, prawa, toalety.', '2021-01-13, 00:54:56', 19, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (425, 'Miała nad umysłami wielką moc ta tłuszcza;', '2021-01-13, 00:57:04', 30, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (426, 'Bo Pan Bóg, kiedy karę na naród przypuszcza,', '2021-01-13, 04:57:15', 1, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (427, 'Odbiera naprzód rozum od obywateli.', '2021-01-13, 04:59:31', 55, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (428, 'I tak, mędrsi fircykom oprzeć się nie śmieli,', '2021-01-13, 04:59:34', 89, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (429, 'I zląkł ich się jak dżumy jakiej cały naród,', '2021-01-13, 04:59:46', 62, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (430, 'Bo już sam wewnątrz siebie czuł choroby zaród.', '2021-01-13, 04:59:55', 41, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (431, 'Krzyczano na modnisiów, a brano z nich wzory;', '2021-01-13, 05:04:10', 37, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (432, 'Zmieniano wiarę, mowę, prawa i ubiory.', '2021-01-13, 05:08:25', 59, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (433, 'Była to maszkarada, zapustna swawola,', '2021-01-13, 05:11:42', 61, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (434, 'Po której miał przyjść wkrótce wielki post — niewola!', '2021-01-13, 05:11:49', 75, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (435, 'Pamiętam, chociaż byłem wtenczas małe dziecię,', '2021-01-13, 05:11:58', 81, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (436, 'Kiedy do ojca mego, w Oszmiańskim powiecie,', '2021-01-13, 05:12:15', 25, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (437, 'Przyjechał pan Podczaszyc na francuskim wózku,', '2021-01-13, 05:12:36', 75, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (438, 'Pierwszy człowiek, co w Litwie chodził po francusku.', '2021-01-13, 05:15:00', 22, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (439, 'Biegali wszyscy za nim, jakby za rarogiem,', '2021-01-13, 05:16:14', 33, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (440, 'Zazdroszczono domowi, przed którego progiem', '2021-01-13, 10:16:40', 98, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (441, 'Stanęła Podczaszyca dwukolna dryndulka,', '2021-01-13, 10:17:52', 17, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (442, 'Która się po francusku zwała karyjulka:', '2021-01-13, 10:17:54', 72, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (443, 'Zamiast lokajów, w kielni siedziały dwa pieski,', '2021-01-13, 10:18:06', 51, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (444, 'A na kozłach Niemczysko chude na kształt deski;', '2021-01-13, 10:18:22', 99, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (445, 'Nogi miał długie, cienkie jak od chmielu tyki,', '2021-01-13, 10:18:40', 19, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (446, 'W pończochach, ze srebrnymi klamrami trzewiki,', '2021-01-13, 10:21:58', 3, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (447, 'Peruka z harbajtelem zawiązanym w miechu.', '2021-01-13, 10:22:22', 21, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (448, 'Starzy na on ekwipaż parskali ze śmiechu,', '2021-01-13, 10:22:27', 60, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (449, 'A chłopi żegnali się, mówiąc: że po świecie', '2021-01-13, 10:22:52', 37, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (450, 'Jeździ wenecki diabeł w niemieckiej karecie.', '2021-01-13, 10:22:58', 76, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (451, 'Sam Podczaszyc jaki był, opisywać długo;', '2021-01-13, 10:23:18', 46, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (452, 'Dosyć, że się nam zdawał małpą lub papugą', '2021-01-13, 14:23:42', 33, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (453, 'W wielkiej peruce, którą do złotego runa', '2021-01-13, 14:23:51', 65, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (454, 'On lubił porównywać, a my do kołtuna.', '2021-01-13, 14:24:20', 77, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (455, 'Jeśli kto i czuł wtenczas, że polskie ubranie', '2021-01-13, 14:25:45', 6, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (456, 'Piękniejsze jest niż obcej mody małpowanie,', '2021-01-13, 14:28:10', 34, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (457, 'Milczał; bo by krzyczała młodzież, że przeszkadza', '2021-01-13, 14:28:11', 67, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (458, 'Kulturze, że tamuje progresy, że zdradza!', '2021-01-13, 14:31:36', 90, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (459, 'Taka była przesądów owoczesnych władza!', '2021-01-13, 21:31:40', 45, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (460, 'Podczaszyc zapowiedział, że nas reformować,', '2021-01-13, 21:31:59', 66, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (461, 'Cywilizować będzie i konstytuować;', '2021-01-13, 21:32:23', 45, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (462, 'Ogłosił nam, że jacyś Francuzi wymówni', '2021-01-13, 21:32:23', 45, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (463, 'Zrobili wynalazek: iż ludzie są równi…', '2021-01-13, 22:33:36', 85, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (464, 'Choć o tym dawno w Pańskim pisano Zakonie,', '2021-01-13, 22:35:56', 48, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (465, 'I każdy ksiądz toż samo gada na ambonie.', '2021-01-14, 04:39:08', 12, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (466, 'Nauka dawną była, szło o jej pełnienie!', '2021-01-14, 04:40:33', 31, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (467, 'Lecz wtenczas panowało takie oślepienie,', '2021-01-14, 04:40:43', 75, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (468, 'Że nie wierzono rzeczom najdawniejszym w świecie,', '2021-01-14, 04:41:57', 92, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (469, 'Jeśli ich nie czytano w francuskiej gazecie.', '2021-01-14, 08:42:10', 32, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (470, 'Podczaszyc, mimo równość, wziął tytuł markiża;', '2021-01-14, 12:43:10', 9, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (471, 'Wiadomo, że tytuły przychodzą z Paryża,', '2021-01-14, 12:43:26', 25, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (472, 'A natenczas tam w modzie był tytuł markiża.', '2021-01-14, 12:46:50', 2, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (473, 'Jakoż, kiedy się moda odmieniła z laty,', '2021-01-14, 12:47:12', 55, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (474, 'Tenże sam markiż przybrał tytuł demokraty;', '2021-01-14, 12:47:18', 62, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (475, 'Wreszcie z odmienną modą, pod Napoleonem,', '2021-01-14, 12:47:44', 96, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (476, 'Demokrata przyjechał z Paryża baronem;', '2021-01-14, 12:48:01', 29, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (477, 'Gdyby żył dłużej, może nową alternatą,', '2021-01-14, 12:48:20', 23, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (478, 'Z barona przechrzciłby się kiedyś demokratą.', '2021-01-14, 12:52:25', 82, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (479, 'Bo Paryż częstą mody odmianą się chlubi;', '2021-01-14, 12:54:31', 7, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (480, 'A co Francuz wymyśli, to Polak polubi.', '2021-01-14, 23:56:34', 24, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (481, 'Chwała Bogu, że teraz, jeśli nasza młodzież', '2021-01-14, 23:56:48', 9, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (482, 'Wyjeżdża za granicę, to już nie po odzież,', '2021-01-14, 23:57:09', 17, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (483, 'Nie szukać prawodawstwa w drukarskich kramarniach', '2021-01-14, 23:59:19', 47, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (484, 'Lub wymowy uczyć się w paryskich kawiarniach.', '2021-01-14, 23:59:32', 93, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (485, 'Bo teraz Napoleon, człek mądry a prędki,', '2021-01-14, 23:59:55', 13, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (486, 'Nie daje czasu szukać mody i gawędki.', '2021-01-15, 06:59:55', 15, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (487, 'Teraz grzmi oręż, a nam starym serca rosną,', '2021-01-15, 07:00:03', 60, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (488, 'Że znowu o Polakach tak na świecie głośno;', '2021-01-15, 10:02:17', 93, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (489, 'Jest sława, a więc będzie i Rzeczpospolita!', '2021-01-15, 10:02:45', 36, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (490, 'Zawżdy z wawrzynów drzewo wolności wykwita.', '2021-01-15, 10:03:00', 94, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (491, 'Tylko smutno, że nam, ach, tak się lata wleką', '2021-01-15, 10:07:12', 23, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (492, 'W nieczynności! a oni tak zawsze daleko!', '2021-01-15, 15:08:41', 52, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (493, 'Tak długo czekać! nawet tak rzadka nowina —', '2021-01-15, 17:08:50', 85, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (494, 'Ojcze Robaku (ciszej rzekł do bernardyna),', '2021-01-15, 17:08:56', 27, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (495, 'Słyszałem, żeś zza Niemna odebrał wiadomość;', '2021-01-15, 17:08:59', 47, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (496, 'Może też co o naszym wojsku wie Jegomość?»', '2021-01-15, 17:09:14', 21, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (497, '— «Nic a nic» odpowiedział Robak obojętnie,', '2021-01-15, 17:09:38', 47, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (498, '(Widać było, że słuchał rozmowy niechętnie)', '2021-01-15, 17:12:57', 32, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (499, '«Mnie polityka nudzi; jeżeli z Warszawy', '2021-01-15, 17:16:23', 98, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (500, 'Mam list, to rzecz zakonna, to są nasze sprawy', '2021-01-15, 17:17:23', 69, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (501, 'Bernardyńskie: cóż o tym gadać u wieczerzy;', '2021-01-15, 17:17:31', 97, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (502, 'Są tu świeccy, do których nic to nie należy».', '2021-01-15, 17:21:59', 85, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (503, 'Tak mówiąc, spojrzał zyzem, gdzie śród biesiadników', '2021-01-15, 17:22:18', 74, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (504, 'Siedział gość, Moskal; był to pan kapitan Ryków,', '2021-01-15, 17:22:36', 90, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (505, 'Stary żołnierz, stał w bliskiej wiosce na kwaterze,', '2021-01-15, 17:24:56', 54, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (506, 'Pan Sędzia go przez grzeczność prosił na wieczerzę.', '2021-01-15, 20:25:24', 29, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (507, 'Ryków jadł smaczno, mało wdawał się w rozmowę,', '2021-01-15, 20:25:31', 35, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (508, 'Lecz na wzmiankę Warszawy, rzekł podniósłszy głowę:', '2021-01-15, 20:28:43', 27, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (509, '«Pan Podkomorzy! Oj wy! Pan zawsze ciekawy', '2021-01-15, 20:29:11', 34, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (510, 'O Bonaparta, zawsze wam tam do Warszawy!', '2021-01-15, 20:29:35', 71, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (511, 'He! Ojczyzna! Ja nie szpieg, a po polsku umiem, —', '2021-01-15, 20:29:45', 49, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (512, 'Ojczyzna! ja to czuję wszystko, ja rozumiem!', '2021-01-15, 20:32:46', 53, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (513, 'Wy Polaki, ja Ruski: teraz się nie bijem,', '2021-01-15, 20:33:05', 55, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (514, 'Jest armistycjum, to my razem jemy, pijem.', '2021-01-15, 20:34:09', 36, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (515, 'Często na awanpostach nasz z Francuzem gada,', '2021-01-15, 20:34:23', 77, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (516, 'Pije wódkę; jak krzykną ura! — kanonada.', '2021-01-15, 20:34:24', 94, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (517, 'Ruskie przysłowie: z kim się biję, tego lubię;', '2021-01-15, 20:35:26', 58, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (518, 'Gładź drużkę jak po duszy, a bij jak po szubie.', '2021-01-15, 20:38:48', 57, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (519, 'Ja mówię, będzie wojna u nas. Do Majora', '2021-01-15, 20:39:02', 52, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (520, 'Płuta, adiutant sztabu przyjechał zawczora:', '2021-01-15, 23:39:07', 2, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (521, 'Gotować się do marszu! Pójdziem, czy pod Turka,', '2021-01-15, 23:42:31', 82, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (522, 'Czy na Francuza; oj ten Bonapart figurka!', '2021-01-15, 23:42:34', 78, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (523, 'Bez Suwarowa to on może nas wytuza.', '2021-01-15, 23:42:46', 40, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (524, 'U nas w pułku gadano, jak szli na Francuza,', '2021-01-15, 23:43:00', 54, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (525, 'Że Bonapart czarował: no, tak i Suwarów', '2021-01-15, 23:43:09', 10, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (526, 'Czarował; tak były czary przeciw czarów.', '2021-01-15, 23:43:10', 88, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (527, 'Raz w bitwie, gdzie podział się? szukać Bonaparta,—', '2021-01-15, 23:43:34', 89, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (528, 'A on zmienił się w lisa, tak Suwarów w charta;', '2021-01-15, 23:45:49', 80, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (529, 'Tak Bonaparte znowu w kota się przerzuca,', '2021-01-15, 23:45:49', 45, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (530, 'Dalej drzeć pazurami, a Suwarów w kuca.', '2021-01-15, 23:46:04', 18, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (531, 'Obaczcież, co się stało w końcu z Bonapartą…»', '2021-01-16, 04:48:12', 83, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (532, 'Tu Ryków przerwał i jadł; wtem, z potrawą czwartą', '2021-01-16, 04:51:37', 93, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (533, 'Wszedł służący i raptem boczne drzwi otwarto.', '2021-01-16, 04:52:00', 29, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (534, 'Weszła nowa osoba przystojna i młoda.', '2021-01-16, 04:53:21', 75, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (535, 'Jej zjawienie się nagłe, jej wzrost i uroda,', '2021-01-16, 04:54:44', 62, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (536, 'Jej ubiór zwrócił oczy; wszyscy ją witali,', '2021-01-16, 04:55:08', 84, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (537, 'Prócz Tadeusza widać, że ją wszyscy znali.', '2021-01-16, 04:55:09', 84, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (538, 'Kibić miała wysmukłą, kształtną, pierś powabną,', '2021-01-16, 04:55:25', 88, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (539, 'Suknię materyjalną, różową, jedwabną,', '2021-01-16, 04:55:52', 6, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (540, 'Gors wycięty, kołnierzyk z koronek, rękawki', '2021-01-16, 04:56:07', 70, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (541, 'Krótkie; w ręku kręciła wachlarz dla zabawki', '2021-01-16, 08:58:11', 3, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (542, '(Bo nie było gorąco); wachlarz pozłocisty', '2021-01-16, 08:58:14', 61, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (543, 'Powiewając rozlewał deszcz iskier rzęsisty;', '2021-01-16, 08:58:16', 26, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (544, 'Głowa do włosów, włosy pozwijane w kręgi,', '2021-01-16, 08:58:27', 80, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (545, 'W pukle, i przeplatane różowymi wstęgi,', '2021-01-16, 08:59:46', 68, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (546, 'Pośród nich brylant, niby zakryty od oczu,', '2021-01-16, 09:01:02', 96, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (547, 'Świecił się jako gwiazda w komety warkoczu:', '2021-01-16, 17:03:11', 44, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (548, 'Słowem, ubiór galowy; szeptali niejedni,', '2021-01-16, 21:03:13', 7, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (549, 'Że zbyt wykwintny na wieś i na dzień powszedni.', '2021-01-16, 21:03:27', 3, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (550, 'Nóżek, choć suknia krótka, oko nie zobaczy,', '2021-01-16, 21:05:43', 44, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (551, 'Bo biegła bardzo szybko, suwała się raczéj', '2021-01-16, 21:05:53', 98, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (552, 'Jako osóbki, które na trzykrólskie święta', '2021-01-16, 21:06:10', 51, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (553, 'Przesuwają w jasełkach ukryte chłopięta.', '2021-01-16, 21:07:11', 14, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (554, 'Biegła i wszystkich lekkim witając ukłonem,', '2021-01-17, 06:07:11', 80, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (555, 'Chciała usieść na miejscu sobie zostawionem:', '2021-01-17, 06:10:24', 25, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (556, 'Trudno było; bo krzeseł dla gości nie stało,', '2021-01-17, 06:10:39', 23, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (557, 'Na czterech ławach cztery ich rzędy siedziało:', '2021-01-17, 06:11:06', 67, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (558, 'Trzeba było rzęd ruszyć lub ławę przeskoczyć;', '2021-01-17, 06:11:27', 58, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (559, 'Zręcznie między dwie ławy umiała się wtłoczyć,', '2021-01-17, 14:11:56', 25, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (560, 'A potem, między rzędem siedzących i stołem,', '2021-01-17, 22:12:16', 73, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (561, 'Jak bilardowa kula toczyła się kołem.', '2021-01-17, 22:12:32', 76, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (562, 'W biegu dotknęła blisko naszego młodziana;', '2021-01-17, 22:16:41', 27, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (563, 'Uczepiwszy falbaną o czyjeś kolana,', '2021-01-17, 22:16:57', 1, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (564, 'Pośliznęła się nieco i w tym roztargnieniu', '2021-01-17, 22:18:15', 28, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (565, 'Na pana Tadeusza wsparła się ramieniu.', '2021-01-17, 22:18:16', 71, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (566, 'Przeprosiwszy go grzecznie, na miejscu swym siadła', '2021-01-17, 22:18:39', 54, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (567, 'Pomiędzy nim i stryjem, ale nic nie jadła;', '2021-01-17, 22:22:07', 3, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (568, 'Tylko się wachlowała, to wachlarza trzonek', '2021-01-17, 22:22:16', 13, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (569, 'Kręciła, to kołnierzyk z brabanckich koronek', '2021-01-17, 22:25:16', 46, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (570, 'Poprawiała, to lekkim dotknięciem się ręki', '2021-01-17, 22:26:16', 75, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (571, 'Muskała włosów pukle i wstąg jasnych pęki.', '2021-01-17, 22:26:26', 78, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (572, 'Ta przerwa rozmów trwała już minut ze cztery.', '2021-01-17, 22:26:30', 51, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (573, 'Tymczasem, w końcu stoła, naprzód ciche szmery,', '2021-01-18, 04:26:52', 75, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (574, 'A potem się zaczęły wpół głośne rozmowy;', '2021-01-18, 04:26:52', 19, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (575, 'Mężczyźni rozsądzali swe dzisiejsze łowy.', '2021-01-18, 04:27:02', 57, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (576, 'Asesora z Rejentem wzmogła się uparta', '2021-01-18, 04:27:16', 91, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (577, 'Coraz głośniejsza kłótnia o kusego charta,', '2021-01-18, 04:27:34', 97, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (578, 'Którego posiadaniem pan Rejent się szczycił', '2021-01-18, 04:30:38', 76, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (579, 'I utrzymywał, że on zająca pochwycił;', '2021-01-18, 04:30:43', 40, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (580, 'Asesor zaś dowodził na złość Rejentowi,', '2021-01-18, 04:34:10', 56, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (581, 'Że ta chwała należy chartu Sokołowi.', '2021-01-18, 04:34:35', 48, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (582, 'Pytano zdania innych; więc wszyscy dokoła', '2021-01-18, 07:34:50', 41, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (583, 'Brali stronę Kusego albo też Sokoła,', '2021-01-18, 16:39:13', 40, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (584, 'Ci jak znawcy, ci znowu jak naoczne świadki.', '2021-01-18, 16:42:29', 34, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (585, 'Sędzia na drugim końcu do nowej sąsiadki', '2021-01-18, 16:43:44', 15, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (586, 'Rzekł półgłosem: «Przepraszam, musieliśmy siadać,', '2021-01-18, 16:43:44', 53, 1, false);
