INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (800, 'Za moich, panie, czasów, w języku strzeleckim,', '2021-01-23, 11:26:04', 97, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (801, 'Dzik, niedźwiedź, łoś, wilk, zwany był zwierzem szlacheckim', '2021-01-23, 11:27:14', 90, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (802, 'A zwierzę niemające kłów, rogów, pazurów,', '2021-01-23, 11:27:30', 86, 6, false);
