INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (804, 'Żaden pan nigdy przyjąć nie chciałby do ręki', '2021-01-23, 11:29:41', 10, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (805, 'Strzelby, którą zhańbiono sypiąc w nią śrut cienki!', '2021-01-23, 11:29:42', 90, 17, false);
