INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (807, 'Trafia się, że spod konia mknie się biedak zając:', '2021-01-23, 11:33:07', 18, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (808, 'Puszczano wtenczas za nim dla zabawki smycze', '2021-01-23, 11:33:19', 37, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (809, 'I na konikach małe goniły panicze', '2021-01-23, 11:34:37', 48, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (810, 'Przed oczyma rodziców, którzy te pogonie', '2021-01-23, 11:35:07', 92, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (811, 'Ledwie raczyli widzieć, cóż kłócić się o nie!', '2021-01-23, 11:37:16', 71, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (812, 'Więc niech jaśnie wielmożny Podkomorzy raczy', '2021-01-23, 13:37:26', 13, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (813, 'Odwołać swe rozkazy i niech mi wybaczy,', '2021-01-23, 13:37:38', 43, 6, false);
