INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (818, 'Tu śmiech młodzieży mowę Wojskiego zagłuszył.', '2021-01-23, 13:48:20', 92, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (819, 'Wstano od stołu, pierwszy Podkomorzy ruszył,', '2021-01-23, 13:51:23', 35, 15, false);
