INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (821, 'Idąc kłaniał się damom, starcom i młodzieży;', '2021-01-23, 13:53:54', 56, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (822, 'Za nim szedł kwestarz, Sędzia tuż przy bernardynie.', '2021-01-23, 13:54:05', 20, 14, false);
