INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (830, 'A szczególniej mu słowo «ciocia» koło ucha', '2021-01-24, 06:56:52', 28, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (831, 'Brzęczało ciągle jako naprzykrzona mucha.', '2021-01-24, 06:57:19', 19, 2, false);
