INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (851, 'Przy którym świecą gęste kutasy jak kity,', '2021-01-25, 04:22:53', 43, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (852, 'Z jednej strony złotogłów w purpurowe kwiaty,', '2021-01-25, 04:24:53', 73, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (853, 'Na wywrót jedwab czarny posrebrzany w kraty;', '2021-01-25, 04:24:57', 19, 5, false);
