INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (856, 'Sam Woźny umiał pas ten odwiązywać, składać;', '2021-01-25, 04:28:35', 86, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (857, 'Właśnie tym się zatrudniał i kończył tak gadać:', '2021-01-25, 04:28:55', 55, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (858, '«Cóż złego, że przeniosłem stoły do zamczyska?', '2021-01-25, 04:29:09', 37, 2, false);
