INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (860, 'Bo przecież o ten zamek dziś toczy się sprawa.', '2021-01-25, 05:33:38', 50, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (861, 'My od dzisiaj do zamku nabyliśmy prawa', '2021-01-25, 05:33:48', 41, 18, false);
