INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (980, 'Do dworów pańskich, z szlachtą ustawicznie szeptał,', '2021-01-28, 23:05:11', 83, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (981, 'I okoliczne wioski dokoła wydeptał,', '2021-01-28, 23:05:18', 37, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (982, 'I w karczmach z wieśniakami rozprawiał niemało,', '2021-01-28, 23:05:23', 65, 15, false);
