INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (986, 'Księga druga', '2021-01-29, 01:12:09', 69, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (987, 'Zamek', '2021-01-29, 01:14:09', 43, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (988, 'Polowanie z chartami na upatrzonego — Gość w zamku — Ostatni z dworzan opowiada historię ostatniego z Horeszków — Rzut oka w sad — Dziewczyna w ogórkach — Śniadanie — Pani Telimeny anegdota petersburska — Nowy wybuch sporów o Kusego i Sokoła — Interwencja Robaka — Rzecz Wojskiego — Zakład — Dalej w grzyby!', '2021-01-29, 01:14:25', 9, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (989, 'Kto z nas tych lat nie pomni, gdy, młode pacholę,', '2021-01-29, 01:17:46', 3, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (990, 'Ze strzelbą na ramieniu świszcząc szedł na pole,', '2021-01-29, 01:21:05', 99, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (991, 'Gdzie żaden wał, płot żaden nogi nie utrudza,', '2021-01-29, 01:22:29', 70, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (992, 'Gdzie, przestępując miedzę, nie poznasz, że cudza!', '2021-01-29, 01:25:30', 8, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (993, 'Bo na Litwie myśliwiec jak okręt na morzu,', '2021-01-29, 01:25:59', 1, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (994, 'Gdzie chcesz, jaką chcesz drogą, buja po przestworzu:', '2021-01-29, 01:28:59', 65, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (995, 'Czyli jak prorok patrzy w niebo, gdzie w obłoku', '2021-01-29, 01:29:21', 11, 9, false);
