INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1229, 'Tu wzrok na ścianie wstrzymał, ówdzie na sklepieniu,', '2021-02-04, 12:33:35', 46, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1230, 'Przywołując pamiątkę tu smutną, tam miłą;', '2021-02-04, 16:37:43', 67, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1231, 'Czasem, jakby chciał mówić: «Wszystko się skończyło»,', '2021-02-04, 16:38:10', 79, 10, false);
