INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1235, 'Na górze, w wielkiej, niegdyś zwierciadlanej sali.', '2021-02-04, 16:46:02', 70, 10, false);
