INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1240, 'Miała wyraz żałości wielkiej i rozpaczy.', '2021-02-04, 16:51:29', 71, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1241, 'Hrabia, chociaż nie wiedział, co to wszystko znaczy,', '2021-02-05, 00:51:51', 87, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1242, 'Poglądając w twarz starca czuł jakieś wzruszenie,', '2021-02-05, 00:54:15', 6, 14, false);
