INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1266, 'Wąsal tak wzbił się w dumę łaskawym przyjęciem,', '2021-02-05, 09:08:46', 13, 9, false);
