INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1280, 'W zamku całym był tylko: pan Stolnik, ja, pani,', '2021-02-05, 16:15:23', 1, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1281, 'Kuchmistrz i dwóch kuchcików, wszyscy trzej pijani,', '2021-02-05, 16:15:26', 39, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1282, 'Proboszcz, lokaj, hajducy czterej, ludzie śmiali.', '2021-02-05, 16:15:34', 23, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1283, 'Więc za strzelby, do okien. Aż tu tłum Moskali,', '2021-02-05, 16:15:42', 15, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1284, 'Krzycząc: »Ura!«, od bramy wali po tarasie;', '2021-02-05, 16:20:02', 19, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1285, 'My im ze strzelb dziesięciu palnęli »A zasie«.', '2021-02-05, 16:20:28', 59, 6, false);
