INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1287, 'Strzelali z dolnych pięter, a ja i pan z ganku.', '2021-02-05, 16:24:42', 28, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1288, 'Wszystko szło pięknym ładem, choć w tak wielkiej trwodze:', '2021-02-05, 16:24:55', 51, 19, false);
