INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1291, 'Ksiądz proboszcz zatrudniał się czynnie tą usługą,', '2021-02-05, 16:26:36', 21, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1292, 'I pani, i panienka, i nadworne panny:', '2021-02-05, 18:26:41', 14, 17, false);
