INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1296, 'Trzy razy aż pode drzwi to chłopstwo się wparło,', '2021-02-05, 18:28:36', 29, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1297, 'Ale za każdym razem trzech nogi zadarło,', '2021-02-05, 18:28:55', 18, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1298, 'Więc uciekli pod lamus; a już był poranek.', '2021-02-05, 18:28:59', 54, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1299, 'Pan Stolnik wesół wyszedł ze strzelbą na ganek,', '2021-02-05, 18:29:10', 65, 4, false);
