INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1301, 'On dawał zaraz ognia, a nigdy nie mylił;', '2021-02-05, 18:32:01', 95, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1302, 'Za każdym razem czarny kaszkiet w trawę padał', '2021-02-05, 18:36:02', 30, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1303, 'I już się rzadko który zza ściany wykradał.', '2021-02-05, 18:36:20', 31, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1304, 'Stolnik, widząc strwożone swe nieprzyjaciele,', '2021-02-05, 20:36:46', 21, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1305, 'Myślił zrobić wycieczkę, porwał karabelę', '2021-02-05, 20:40:12', 89, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1306, 'I z ganku krzycząc sługom wydawał rozkazy;', '2021-02-05, 22:43:28', 23, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1307, 'Obróciwszy się do mnie, rzekł: »Za mną Gerwazy!«', '2021-02-05, 22:47:37', 55, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1308, 'Wtem strzelono spod bramy… Stolnik się zająknął,', '2021-02-05, 22:51:46', 16, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1309, 'Zaczerwienił się, zbladnął, chciał mówić, krwią chrząknął:', '2021-02-05, 22:54:04', 33, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1310, 'Postrzegłem wtenczas kulę, wpadła w piersi same.', '2021-02-05, 22:54:08', 41, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1311, 'Pan słaniając się, palcem ukazał na bramę:', '2021-02-05, 22:54:24', 75, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1312, 'Poznałem tego łotra Soplicę! poznałem!', '2021-02-05, 22:54:38', 45, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1313, 'Po wzroście i po wąsach! Jego to postrzałem', '2021-02-05, 22:54:39', 1, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1314, 'Zginął Stolnik, widziałem! Łotr jeszcze do góry', '2021-02-05, 22:54:44', 14, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1315, 'Wzniesioną trzymał strzelbę, jeszcze dym szedł z rury!', '2021-02-06, 05:57:53', 1, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1316, 'Wziąłem go na cel; zbójca stał jak skamieniały!', '2021-02-06, 08:59:11', 62, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1317, 'Dwa razy dałem ognia, i oba wystrzały', '2021-02-06, 08:59:27', 80, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1318, 'Chybiły: czym ze złości, czy z żalu źle mierzył…', '2021-02-06, 08:59:32', 20, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1319, 'Usłyszałem wrzask kobiet, spojrzałem — pan nie żył».', '2021-02-06, 08:59:43', 75, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1320, 'Tu Gerwazy umilknął i łzami się zalał,', '2021-02-06, 09:01:50', 13, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1321, 'Potem rzekł kończąc: «Moskal już wrota wywalał:', '2021-02-06, 09:02:59', 9, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1322, 'Bo po śmierci Stolnika stałem bezprzytomnie,', '2021-02-06, 09:05:04', 79, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1323, 'I nie widziałem, co się działo wokoło mnie.', '2021-02-06, 09:07:25', 24, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1324, 'Szczęściem, na odsiecz przyszedł nam Parafianowicz,', '2021-02-06, 09:09:52', 50, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1325, 'Przywiódłszy Mickiewiczów dwiestu z Horbatowicz,', '2021-02-06, 09:10:11', 28, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1326, 'Którzy są szlachta liczna i dzielna, człek w człeka,', '2021-02-06, 09:10:35', 50, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1327, 'A nienawidzą rodu Sopliców od wieka.', '2021-02-06, 18:10:58', 71, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1328, 'Tak zginął pan potężny, pobożny i prawy,', '2021-02-06, 18:11:13', 31, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1329, 'Który miał w domu krzesła, wstęgi i buławy,', '2021-02-06, 18:11:18', 20, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1330, 'Ojciec włościan, brat szlachty; i nie miał po sobie', '2021-02-06, 18:11:23', 80, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1331, 'Syna, który by zemstę poprzysiągł na grobie!', '2021-02-06, 18:12:50', 69, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1332, 'Ale miał sługi wierne. Ja w krew jego rany', '2021-02-06, 18:12:51', 6, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1333, 'Obmoczyłem mój rapier Scyzorykiem zwany', '2021-02-06, 18:16:19', 58, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1334, '(Zapewne pan o moim słyszał Scyzoryku,', '2021-02-06, 18:18:23', 45, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1335, 'Sławnym na każdym sejmie, targu i sejmiku).', '2021-02-06, 18:21:43', 52, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1336, 'Przysiągłem wyszczerbić go na Sopliców karkach,', '2021-02-06, 18:25:44', 19, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1337, 'Ścigałem ich na sejmach, zajazdach, jarmarkach.', '2021-02-06, 23:25:49', 25, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1338, 'Dwóch zarąbałem w kłótni, dwóch na pojedynku;', '2021-02-06, 23:29:54', 79, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1339, 'Jednego podpaliłem w drewnianym budynku,', '2021-02-06, 23:30:02', 94, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1340, 'Kiedyśmy zajeżdżali z Rymszą Korelicze:', '2021-02-06, 23:30:26', 16, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1341, 'Upiekł się tam jak piskorz; a tych nie policzę,', '2021-02-06, 23:34:40', 81, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1342, 'Którym uszy obciąłem. Jeden tylko został,', '2021-02-06, 23:38:54', 25, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1343, 'Który dotąd ode mnie pamiątki nie dostał:', '2021-02-06, 23:39:15', 42, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1344, 'Rodzoniutki braciszek owego wąsala!', '2021-02-06, 23:39:35', 8, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1345, 'Żyje dotąd i z swoich bogactw się przechwala,', '2021-02-06, 23:39:55', 60, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1346, 'Zamku Horeszków tyka swych kopców krawędzią,', '2021-02-06, 23:41:56', 86, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1347, 'Szanowany w powiecie, ma urząd, jest Sędzią!', '2021-02-07, 03:45:01', 17, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1348, 'I pan mu zamek oddasz? Niecne jego nogi', '2021-02-07, 03:45:17', 59, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1349, 'Mają krew pana mego zetrzeć z tej podłogi?', '2021-02-07, 03:48:25', 48, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1350, 'O nie! Póki Gerwazy ma choć za grosz duszy,', '2021-02-07, 03:51:33', 50, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1351, 'I tyle sił, że jednym małym palcem ruszy', '2021-02-07, 03:55:43', 93, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1352, 'Scyzoryk swój wiszący dotychczas na ścianie,', '2021-02-07, 03:59:56', 49, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1353, 'Póty Soplica tego zamku nie dostanie!»', '2021-02-07, 04:02:06', 12, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1354, '«O! — krzyknął Hrabia, ręce podnosząc do góry —', '2021-02-07, 04:04:18', 49, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1355, 'Dobre miałem przeczucie, żem lubił te mury!', '2021-02-07, 04:05:46', 82, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1356, 'Choć nie wiedziałem, że w nich taki skarb się mieści,', '2021-02-07, 04:06:52', 65, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1357, 'Tyle scen dramatycznych i tyle powieści!', '2021-02-07, 05:11:10', 75, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1358, 'Skoro zamek mych przodków Soplicom zagrabię,', '2021-02-07, 05:11:34', 46, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1359, 'Ciebie osadzę w murach jak mego burgrabię.', '2021-02-07, 05:11:34', 2, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1360, 'Twoja powieść, Gerwazy, zajęła mię mocno.', '2021-02-07, 05:11:43', 16, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1361, 'Szkoda, żeś mię nie przywiódł tu w godzinę nocną;', '2021-02-07, 05:12:00', 78, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1362, 'Udrapowany płaszczem, siadłbym na ruinach,', '2021-02-07, 05:12:25', 47, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1363, 'A ty byś mi o krwawych rozpowiadał czynach.', '2021-02-07, 06:12:53', 68, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1364, 'Szkoda, że masz niewielki dar opowiadania!', '2021-02-07, 06:13:06', 93, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1365, 'Nieraz takie słyszałem i czytam podania;', '2021-02-07, 06:15:21', 57, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1366, 'W Anglii i w Szkocyi każdy zamek lordów,', '2021-02-07, 06:15:50', 46, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1367, 'W Niemczech każdy dwór grafów był teatrem mordów.', '2021-02-07, 08:16:00', 33, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1368, 'W każdej dawnej, szlachetnej, potężnej rodzinie', '2021-02-07, 08:17:23', 48, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1369, 'Jest wieść o jakimś krwawym lub zdradzieckim czynie,', '2021-02-07, 08:21:47', 9, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1370, 'Po którym zemsta spływa na dziedziców w spadku:', '2021-02-07, 08:24:16', 30, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1371, 'W Polsce pierwszy raz słyszę o takim wypadku.', '2021-02-07, 08:24:16', 60, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1372, 'Czuję, że we mnie mężnych krew Horeszków płynie!', '2021-02-07, 08:28:22', 97, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1373, 'Wiem, co winienem sławie i mojej rodzinie.', '2021-02-07, 08:28:50', 27, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1374, 'Tak, muszę zerwać wszelkie z Soplicą układy,', '2021-02-07, 08:30:00', 28, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1375, 'Choćby do pistoletów przyszło lub do szpady!', '2021-02-07, 08:30:16', 24, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1376, 'Honor każe». Rzekł, ruszył uroczystym krokiem,', '2021-02-07, 08:33:19', 65, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1377, 'A Gerwazy szedł z tyłu w milczeniu głębokiem.', '2021-02-07, 08:33:41', 4, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1378, 'Przed bramą stanął Hrabia, sam do siebie gadał,', '2021-02-07, 08:33:45', 94, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1379, 'Poglądając na zamek prędko na koń wsiadał,', '2021-02-07, 12:37:52', 64, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1380, 'Tak samotną rozmowę kończąc roztargniony:', '2021-02-07, 12:38:57', 92, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1381, '«Szkoda, że ten Soplica stary nie ma żony', '2021-02-07, 14:39:26', 88, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1382, 'Lub córki pięknej, której ubóstwiałbym wdzięki!', '2021-02-07, 14:40:40', 17, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1383, 'Kochając i nie mogąc otrzymać jej ręki,', '2021-02-07, 14:40:40', 56, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1384, 'Nowa by się w powieści zrobiła zawiłość:', '2021-02-07, 14:43:53', 29, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1385, 'Tu serce, tam powinność — tu zemsta, tam miłość!»', '2021-02-07, 14:44:08', 19, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1386, 'Tak szepcąc spiął ostrogi; koń leciał do dworu,', '2021-02-07, 14:47:25', 40, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1387, 'Gdy z drugiej strony strzelcy wyjeżdżali z boru.', '2021-02-07, 14:50:49', 5, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1388, 'Hrabia lubił myślistwo, ledwie strzelców zoczył,', '2021-02-07, 14:50:53', 6, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1389, 'Zapomniawszy o wszystkim, prosto ku nim skoczył,', '2021-02-07, 14:51:20', 98, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1390, 'Mijając bramę, ogród, płoty: gdy w zawrocie', '2021-02-07, 14:51:23', 21, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1391, 'Obejrzał się, i konia zatrzymał przy płocie.', '2021-02-07, 14:51:37', 50, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1392, 'Był sad. —', '2021-02-07, 14:53:02', 70, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1393, 'Drzewa owocne, zasadzone w rzędy,', '2021-02-07, 14:56:04', 76, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1394, 'Ocieniały szerokie pole; spodem grzędy.', '2021-02-07, 14:56:23', 81, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1395, 'Tu kapusta, sędziwe schylając łysiny,', '2021-02-07, 14:58:41', 54, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1396, 'Siedzi i zda się dumać o losach jarzyny;', '2021-02-07, 14:58:57', 54, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1397, 'Tam, plącząc stronki w marchwi zielonej warkoczu,', '2021-02-07, 14:59:24', 80, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1398, 'Wysmukły bób obraca na nią tysiąc oczu;', '2021-02-07, 15:00:46', 30, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1399, 'Owdzie podnosi złotą kitę kukuruza;', '2021-02-07, 15:05:03', 33, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1400, 'Gdzieniegdzie otyłego widać brzuch harbuza,', '2021-02-07, 15:08:26', 31, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1401, 'Który od swej łodygi aż w daleką stronę,', '2021-02-07, 15:08:41', 67, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1402, 'Wtoczył się jak gość między buraki czerwone.', '2021-02-07, 15:13:02', 20, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1403, 'Grzędy rozcięte miedzą; na każdym przykopie', '2021-02-07, 16:16:28', 63, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1404, 'Stoją jakby na straży w szeregach konopie,', '2021-02-07, 16:17:34', 37, 6, false);
