INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1529, 'Musieli być posłuszni, chociaż w wielkim gniewie;', '2021-02-11, 09:14:55', 71, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1530, 'Psy powróciły same i nikt pewnie nie wie,', '2021-02-11, 09:15:19', 32, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1531, 'Czy zwierz uszedł, czy wzięty; nikt zgadnąć nie zdoła,', '2021-02-11, 09:15:44', 46, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1532, 'Czy wpadł w paszczę Kusego, czyli też Sokoła,', '2021-02-11, 09:16:02', 48, 8, false);
