INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1546, 'Że nie są kanonicznie z sobą powiązani', '2021-02-11, 09:37:23', 84, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1547, 'Zbyt bliskim pokrewieństwem; i nawet niepewno,', '2021-02-11, 09:37:39', 57, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1548, 'Czy ciocia Telimena jest synowca krewną,', '2021-02-11, 09:38:05', 57, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1549, 'Choć ją stryj zowie siostrą, bo wspólni rodzice', '2021-02-11, 17:38:24', 73, 3, false);
