INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1556, 'Ulżyły Tadeusza sercu te wyznania.', '2021-02-11, 20:46:51', 68, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1557, 'Wiele też innych rzeczy sobie oświadczyli;', '2021-02-11, 20:46:58', 11, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1558, 'A wszystko to się stało w jednej krótkiej chwili.', '2021-02-11, 20:48:14', 93, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1559, 'Ale w izbie na prawo, kusząc Asesora,', '2021-02-11, 20:48:31', 75, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1560, 'Rzekł Rejent mimojazdem: «Ja mówiłem wczora,', '2021-02-12, 00:48:34', 26, 18, false);
