INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1563, 'I mnóstwo sznurów chłopskiej niezżętej jarzyny:', '2021-02-12, 00:49:51', 40, 6, false);
