INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1570, 'Na artykuły ustaw, przepisy urzędu,', '2021-02-12, 01:56:43', 64, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1571, 'Nie szanując niczyich kopców ani miedzy,', '2021-02-12, 01:56:48', 32, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1572, 'Jeździć po cudzym gruncie, bez dziedzica wiedzy,', '2021-02-12, 01:57:15', 29, 10, false);
