INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1581, 'Telimena ku lewej izbie obrócona', '2021-02-12, 10:17:21', 8, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1582, 'Wachlując batystową chusteczką ramiona:', '2021-02-12, 10:20:23', 54, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1583, '«Jak mamę kocham — rzekła — Hrabia się nie myli.', '2021-02-12, 10:24:24', 15, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1584, 'Znam ja dobrze Rosyją. Państwo nie wierzyli,', '2021-02-12, 10:24:43', 64, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1585, 'Gdy im nieraz mówiłam, jak tam z wielu względów', '2021-02-12, 10:28:05', 29, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1586, 'Godna pochwały czujność i srogość urzędów.', '2021-02-12, 11:29:18', 84, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1587, 'Byłam ja w Petersburku, nie raz, nie dwa razy!', '2021-02-12, 11:32:28', 51, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1588, 'Miłe wspomnienia! wdzięczne przeszłości obrazy!', '2021-02-12, 11:32:30', 24, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1589, 'Co za miasto! Nikt z panów nie był w Petersburku?', '2021-02-12, 11:36:57', 15, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1590, 'Chcecie może plan widzieć? Mam plan miasta w biurku.', '2021-02-12, 11:37:26', 8, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1591, 'Latem świat petersburski zwykł mieszkać na daczy,', '2021-02-12, 11:37:36', 63, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1592, 'To jest w pałacach wiejskich (dacza wioskę znaczy).', '2021-02-12, 11:40:57', 12, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1593, 'Mieszkałam w pałacyku, tuż nad Newą rzeką,', '2021-02-12, 11:44:27', 10, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1594, 'Niezbyt blisko od miasta i niezbyt daleko,', '2021-02-12, 11:45:52', 83, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1595, 'Na niewielkim, umyślnie sypanym pagórku:', '2021-02-12, 18:46:07', 65, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1596, 'Ach, co to był za domek! Plan mam dotąd w biurku.', '2021-02-12, 18:50:33', 83, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1597, 'Otóż, na me nieszczęście, najął dom w sąsiedztwie', '2021-02-12, 18:52:50', 90, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1598, 'Jakiś mały czynownik siedzący na śledztwie;', '2021-02-12, 18:55:57', 46, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1599, 'Trzymał kilkoro chartów: co to za męczarnie,', '2021-02-12, 18:57:02', 23, 8, false);
