INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1605, 'Nieraz się nalękałam. Serce mi wróżyło', '2021-02-12, 19:05:54', 38, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1606, 'Z tych psów jakieś nieszczęście: tak się też zdarzyło.', '2021-02-12, 19:06:56', 19, 17, false);
