INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1720, 'Jak strzelcy, gdy na lisa zaciągną do lasu,', '2021-02-16, 17:47:43', 92, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1721, 'Słychać gdzieniegdzie trzask drzew, strzały, psiarni granie,', '2021-02-16, 17:48:10', 6, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1722, 'A wtem dojeżdżacz dzika ruszył niespodzianie,', '2021-02-16, 17:48:15', 79, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1723, 'Dał znak i wrzask powstaje w strzelców i psów tłuszczy,', '2021-02-16, 17:50:19', 70, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1724, 'Jak gdyby się ozwały wszystkie drzewa puszczy:', '2021-02-16, 21:50:21', 4, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1725, 'Tak dzieje się z rozmową. Z wolna się pomyka:', '2021-02-16, 21:53:38', 91, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1726, 'Aż natrafi na przedmiot wielki, jak na dzika.', '2021-02-16, 21:53:53', 1, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1727, 'Dzikiem rozmów strzeleckich, był ów spór zażarty', '2021-02-16, 21:55:02', 43, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1728, 'Rejenta z Asesorem o sławne ich charty.', '2021-02-16, 21:59:10', 91, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1729, 'Krótko trwał, lecz zrobili wiele w jedną chwilę;', '2021-02-16, 22:02:28', 90, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1730, 'Bo razem wyrzucili słów i obelg tyle,', '2021-02-16, 22:06:45', 79, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1731, 'Że wyczerpnęli sporu zwyczajne trzy części,', '2021-02-16, 22:06:47', 44, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1732, 'Przycinki, gniew, wyzwanie — i szło już do pięści.', '2021-02-16, 22:08:00', 59, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1733, 'Więc ku nim z drugiej izby wszyscy się porwali,', '2021-02-16, 22:08:13', 15, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1734, 'I tocząc się przeze drzwi na kształt bystrej fali,', '2021-02-16, 22:10:18', 25, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1735, 'Unieśli młodą parę stojącą na progu,', '2021-02-16, 22:10:36', 63, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1736, 'Podobną Janusowi, dwulicemu bogu.', '2021-02-16, 22:12:37', 62, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1737, 'Tadeusz z Telimeną nim na skroniach włosy', '2021-02-17, 01:12:50', 47, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1738, 'Poprawili, już groźne ucichły odgłosy.', '2021-02-17, 01:12:55', 49, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1739, 'Szmer zmieszany ze śmiechem śród ciżby się szerzył;', '2021-02-17, 01:16:04', 50, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1740, 'Nastąpił rozejm kłótni, kwestarz ją uśmierzył:', '2021-02-17, 01:16:10', 7, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1741, 'Człowiek stary, lecz krępy i bardzo pleczysty.', '2021-02-17, 01:16:18', 64, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1742, 'Właśnie kiedy Asesor podbiegł do jurysty,', '2021-02-17, 01:19:31', 7, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1743, 'Gdy już sobie gestami grozili szermierze,', '2021-02-17, 01:19:50', 64, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1744, 'On raptem porwał obu z tyłu za kołnierze', '2021-02-17, 01:21:51', 18, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1745, 'I dwakroć uderzywszy głowy obie mocne', '2021-02-17, 01:22:06', 1, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1746, 'Jedną o drugą, jako jaja wielkanocne,', '2021-02-17, 01:25:35', 55, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1747, 'Rozkrzyżował ramiona na kształt drogowskazu', '2021-02-17, 01:28:01', 10, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1748, 'I we dwa kąty izby rzucił ich od razu.', '2021-02-17, 01:28:24', 49, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1749, 'Chwilę z rozciągnionymi stał w miejscu rękami,', '2021-02-17, 01:31:30', 16, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1750, 'I «Pax, pax, pax vobiscum — krzyczał — pokój z wami!»', '2021-02-17, 10:32:47', 53, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1751, 'Zdziwiły się, zaśmiały nawet strony obie.', '2021-02-17, 10:34:49', 95, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1752, 'Przez szacunek, należny duchownej osobie,', '2021-02-17, 10:35:01', 97, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1753, 'Nie śmiano łajać mnicha; a po takiej probie,', '2021-02-17, 10:35:24', 19, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1754, 'Nikt też nie miał ochoty zaczynać z nim zwadę,', '2021-02-17, 10:38:52', 92, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1755, 'Zaś kwestarz Robak, skoro uciszył gromadę,', '2021-02-17, 14:39:13', 33, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1756, 'Widać było, że wcale tryumfu nie szukał,', '2021-02-17, 14:39:18', 9, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1757, 'Ani groził kłótnikom więcej, ani fukał;', '2021-02-17, 14:39:25', 70, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1758, 'Tylko poprawił kaptur, i ręce za pasem', '2021-02-17, 14:39:42', 9, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1759, 'Zatknąwszy, wyszedł cicho z pokoju.', '2021-02-17, 21:43:56', 56, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1760, 'Tymczasem', '2021-02-17, 21:48:03', 19, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1761, 'Podkomorzy i Sędzia między dwiema strony', '2021-02-17, 21:48:12', 46, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1762, 'Plac zajęli. Pan Wojski, jakby przebudzony', '2021-02-17, 21:48:33', 56, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1763, 'Z głębokiego dumania, w środku się postawił,', '2021-02-17, 21:48:33', 33, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1764, 'Wąsy siwe pokręcił, kapoty poprawił,', '2021-02-17, 21:48:57', 17, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1765, 'Iskrzyły mu się oczy (zawżdy postrzegano', '2021-02-17, 21:51:21', 3, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1766, 'Ten blask niezwykły, kiedy o łowach gadano),', '2021-02-17, 21:55:37', 52, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1767, 'Obiegał zgromadzenie ognistą źrenicą', '2021-02-17, 21:58:01', 26, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1768, 'I gdzie szmer jeszcze słyszał, jak ksiądz kropielnicą,', '2021-02-17, 22:02:25', 33, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1769, 'Tam uciszając machał swą placką ze skóry;', '2021-02-17, 22:05:25', 56, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1770, 'Wreszcie podniósłszy trzonek z powagą do góry,', '2021-02-17, 22:05:46', 38, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1771, 'Jak laskę marszałkowską, nakazał milczenie.', '2021-02-17, 22:09:53', 66, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1772, '«Uciszcie się! — powtarzał — miejcie też baczenie,', '2021-02-17, 22:14:02', 49, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1773, 'Wy, co jesteście pierwsi myśliwi w powiecie,', '2021-02-17, 22:14:08', 41, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1774, 'Z gorszącej kłótni waszej co będzie? czy wiecie?', '2021-02-17, 22:15:34', 51, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1775, 'Oto młodzież, na której Ojczyzny nadzieje,', '2021-02-17, 22:19:45', 25, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1776, 'Która ma wsławiać nasze ostępy i knieje,', '2021-02-17, 22:19:59', 40, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1777, 'Która niestety, i tak zaniedbuje łowy,', '2021-02-18, 04:20:27', 62, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1778, 'Może do ich wzgardzenia weźmie pochop nowy.', '2021-02-18, 04:21:52', 9, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1779, 'Widząc, że ci, co innym mają dać przykłady,', '2021-02-18, 04:22:03', 75, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1780, 'Z łowów przynoszą tylko poswarki i zwady!', '2021-02-18, 04:26:23', 86, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1781, 'Miejcie też wzgląd powinny dla mych włosów siwych;', '2021-02-18, 04:29:36', 56, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1782, 'Bo znałem większych dawniej niźli wy myśliwych,', '2021-02-18, 04:34:05', 61, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1783, 'A sądziłem ich nieraz sądem polubownym.', '2021-02-18, 04:36:12', 67, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1784, 'Któż był w lasach litewskich Rejtanowi równym?', '2021-02-18, 04:39:35', 28, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1785, 'Czy obławę zaciągnąć, czy spotkać się z zwierzem,', '2021-02-18, 04:39:35', 6, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1786, 'Kto z Białopiotrowiczem porówna się Jerzym?', '2021-02-18, 04:39:43', 4, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1787, 'Gdzie jest dziś taki strzelec jak szlachcic Żegota,', '2021-02-18, 04:39:56', 31, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1788, 'Co kulą z pistoletu w biegu trafiał kota?', '2021-02-18, 12:41:18', 57, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1789, 'Terajewicza znałem, co idąc na dziki,', '2021-02-18, 12:41:25', 64, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1790, 'Nie brał nigdy innego oręża prócz piki;', '2021-02-18, 12:41:26', 53, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1791, 'Budrewicza, co chodził z niedźwiedziem w zapasy:', '2021-02-18, 12:41:29', 76, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1792, 'Takich mężów widziały niegdyś nasze lasy!', '2021-02-18, 12:41:42', 2, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1793, 'Jeśli do sporu przyszło, jakże spór godzili?', '2021-02-18, 17:41:44', 27, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1794, 'Oto obrali sędziów i zakład stawili.', '2021-02-18, 17:42:12', 41, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1795, 'Ogiński sto włók lasu raz przegrał o wilka;', '2021-02-18, 17:45:20', 72, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1796, 'Niesiołowskiemu borsuk kosztował wsi kilka!', '2021-02-18, 17:49:33', 65, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1797, 'I wy, panowie, pójdźcie za starych przykładem,', '2021-02-18, 17:51:53', 42, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1798, 'I rozstrzygnijcie spór wasz choć mniejszym zakładem.', '2021-02-18, 17:54:22', 4, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1799, 'Słowo wiatr, w sporach słownych nigdy nie masz końca;', '2021-02-18, 17:58:44', 34, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1800, 'Szkoda ust dłużej suszyć kłótnią o zająca.', '2021-02-18, 17:58:53', 66, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1801, 'Więc polubownych sędziów najpierwej obierzcie,', '2021-02-18, 17:58:56', 70, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1802, 'A co wyrzekną, temu sumiennie zawierzcie.', '2021-02-18, 17:59:03', 37, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1803, 'Ja uproszę Sędziego, ażeby nie bronił', '2021-02-18, 18:03:15', 37, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1804, 'Dojeżdżaczowi, choćby po pszenicy gonił;', '2021-02-18, 23:03:40', 98, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1805, 'I tuszę, że tę łaskę otrzymam od pana».', '2021-02-18, 23:04:06', 81, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1806, 'To wyrzekłszy, Sędziego ścisnął za kolana.', '2021-02-18, 23:06:23', 89, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1807, '«Konia — zawołał Rejent — stawię konia z rzędem,', '2021-02-18, 23:06:34', 73, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1808, 'I opiszę się jeszcze przed ziemskim urzędem,', '2021-02-18, 23:06:40', 26, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1809, 'Iż ten pierścień Sędziemu w salarijum złożę».', '2021-02-18, 23:06:56', 16, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (1810, '«Ja — rzekł Asesor — stawię me złote obroże,', '2021-02-18, 23:08:08', 82, 2, false);
