INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2438, 'Z liściem lakierowanym, krótka i pękata,', '2021-03-08, 02:33:35', 19, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2439, 'Jako kobieta mała, brzydka, lecz bogata?', '2021-03-08, 02:34:53', 32, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2440, 'Czy zachwalony cyprys długi, cienki, chudy,', '2021-03-08, 02:35:10', 45, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2441, 'Co zdaje się być drzewem nie smutku, lecz nudy?', '2021-03-08, 02:39:33', 97, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2442, 'Mówią, że bardzo smutnie wygląda na grobie;', '2021-03-08, 02:39:57', 15, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2443, 'Jest to jak lokaj Niemiec we dworskiej żałobie,', '2021-03-08, 02:40:26', 82, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2444, 'Nieśmiejący rąk podnieść ani głowy skrzywić,', '2021-03-08, 10:43:36', 20, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2445, 'Aby się etykiecie niczym nie sprzeciwić.', '2021-03-08, 10:46:43', 28, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2446, '«Czyż nie piękniejsza nasza poczciwa brzezina,', '2021-03-08, 10:50:46', 97, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2447, 'Która jako wieśniaczka, kiedy płacze syna,', '2021-03-08, 10:50:58', 16, 8, false);
