INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2449, 'Po ramionach do ziemi strumienie warkoczy!', '2021-03-08, 10:54:42', 53, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2450, 'Niema z żalu, postawą jak wymownie szlocha!', '2021-03-08, 10:55:01', 26, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2451, 'Czemuż pan Hrabia, jeśli w malarstwie się kocha,', '2021-03-08, 10:56:02', 89, 12, false);
