INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2456, '«Przyjacielu — rzekł Hrabia — piękne przyrodzenie', '2021-03-08, 18:05:47', 29, 5, false);
