INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2459, 'Poleruje się gustem, wspiera na prawidłach.', '2021-03-08, 18:11:32', 81, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2460, 'Nie dość jest przyrodzenia, nie dosyć zapału:', '2021-03-08, 18:11:55', 6, 2, false);
