INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2465, 'Punktów widzenia, grupy, ansamblu i nieba,', '2021-03-09, 06:13:39', 44, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2466, 'Nieba włoskiego! Stąd też w kunszcie pejzażów,', '2021-03-09, 06:13:53', 13, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2467, 'Włochy były, są, będą, ojczyzną malarzów!', '2021-03-09, 06:14:18', 50, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2468, 'Stąd też, oprócz Brejgela (lecz nie van der Helle,', '2021-03-09, 06:18:29', 98, 15, false);
