INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2472, 'Niebios, niebios potrzeba». — «Nasz malarz Orłowski,', '2021-03-09, 07:25:53', 60, 17, false);
