INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2482, '«I miał rozum! — zawołał Tadeusz z zapałem. —', '2021-03-10, 00:44:32', 84, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2483, 'To państwa niebo włoskie, jak o nim słyszałem,', '2021-03-10, 04:46:59', 73, 13, false);
