INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2488, 'Bo każda chmura inna: na przykład jesienna', '2021-03-10, 04:50:46', 39, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2489, 'Pełznie jak żółw leniwa, ulewą brzemienna,', '2021-03-10, 04:50:48', 50, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2490, 'I z nieba aż do ziemi spuszcza długie smugi,', '2021-03-10, 04:51:09', 35, 2, false);
