INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2492, 'Chmura z gradem, jak balon szybko z wiatrem leci,', '2021-03-10, 04:51:37', 47, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2493, 'Krągła, ciemnobłękitna, w środku żółto świeci,', '2021-03-10, 05:51:47', 39, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2494, 'Szum wielki słychać wkoło; nawet te codzienne,', '2021-03-10, 05:55:50', 20, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2495, 'Patrzcie państwo, te białe chmurki, jak odmienne!', '2021-03-10, 05:56:19', 5, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2496, 'Zrazu jak stada dzikich gęsi lub łabędzi,', '2021-03-10, 05:59:26', 28, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2497, 'A z tyłu wiatr jak sokół do kupy je pędzi:', '2021-03-10, 05:59:40', 60, 1, false);
