INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2502, 'Wszystkie białe jak srebro, zmieszały się… nagle', '2021-03-10, 06:02:55', 95, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2503, 'Z ich karków rosną maszty, z grzyw szerokie żagle,', '2021-03-10, 15:03:16', 59, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2504, 'Tabun zmienia się w okręt i wspaniale płynie', '2021-03-10, 15:07:20', 99, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2505, 'Cicho, z wolna po niebios błękitnej równinie!»', '2021-03-10, 15:07:48', 75, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2506, 'Hrabia i Telimena poglądali w górę;', '2021-03-10, 15:08:09', 34, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2507, 'Tadeusz jedną ręką pokazał im chmurę,', '2021-03-10, 15:10:13', 19, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2508, 'A drugą ścisnął z lekka rączkę Telimeny.', '2021-03-10, 15:10:32', 80, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2509, 'Kilka już upłynęło minut cichej sceny;', '2021-03-10, 19:12:36', 14, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2510, 'Hrabia rozłożył papier na swym kapeluszu', '2021-03-10, 19:12:46', 64, 16, false);
