INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2514, 'Hrabia, kiwnąwszy głową, rzekł poważnym tonem:', '2021-03-10, 19:19:33', 15, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2515, '«Tak to na świecie wszystko los zwykł kończyć dzwonem!…', '2021-03-10, 19:19:54', 90, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2516, 'Rachunki myśli wielkiej, plany wyobraźni,', '2021-03-10, 19:23:13', 53, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2517, 'Zabawki niewinności, uciechy przyjaźni,', '2021-03-10, 19:25:17', 38, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2518, 'Wylania się serc czułych: gdy spiż z dala ryknie,', '2021-03-10, 19:25:24', 66, 11, false);
