INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2932, 'Nocą do karczmy, tajnie z Żydem się naradzał', '2021-03-21, 01:55:41', 6, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2933, 'O ważnych rzeczach; słychać było, że towary', '2021-03-21, 01:56:07', 54, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2934, 'Ksiądz przemycał — lecz potwarz ta niegodna wiary.', '2021-03-21, 01:56:33', 92, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2935, 'Robak, wsparty na stole, wpół głośno rozprawiał,', '2021-03-21, 02:00:34', 86, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2936, 'Tłum szlachty go otaczał i uszy nadstawiał,', '2021-03-21, 02:04:41', 73, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2937, 'I nosy ku księdzowskiej chylił tabakierze;', '2021-03-21, 02:05:06', 82, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2938, 'Brano z niej, i kichała szlachta jak moździerze.', '2021-03-21, 02:06:10', 77, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2939, '«Reverendissime — rzekł kichnąwszy Skołuba —', '2021-03-21, 02:09:10', 29, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2940, 'To mi tabaka, co to idzie aż do czuba!', '2021-03-21, 02:13:12', 83, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2941, 'Od czasu jak nos dźwigam (tu głasnął nos długi)', '2021-03-21, 13:13:13', 8, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2942, 'Takiej nie zażywałem (tu kichnął raz drugi);', '2021-03-21, 13:13:22', 69, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2943, 'Prawdziwa bernardynka, pewnie z Kowna rodem,', '2021-03-21, 15:13:38', 70, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2944, 'Miasta sławnego w świecie tabaką i miodem.', '2021-03-21, 15:13:38', 10, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2945, 'Byłem tam lat już…» — Robak przerwał mu: «Na zdrowie', '2021-03-21, 15:15:06', 84, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2946, 'Wszystkim waszmościom, moi mościwi panowie!', '2021-03-21, 15:15:12', 15, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2947, 'Co się tabaki tyczy, hem, ona pochodzi', '2021-03-21, 15:16:36', 9, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2948, 'Z dalszej strony, niż myśli Skołuba dobrodziéj:', '2021-03-21, 15:19:02', 56, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2949, 'Pochodzi z Jasnej Góry. Księża paulinowie', '2021-03-21, 15:23:15', 4, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2950, 'Tabakę taką robią w mieście Częstochowie,', '2021-03-21, 15:23:16', 93, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2951, 'Kędy jest obraz tylu cudami wsławiony,', '2021-03-21, 15:23:45', 21, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2952, 'Bogarodzicy Panny, Królowej Korony', '2021-03-21, 15:24:07', 72, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2953, 'Polskiej… zowią ją dotąd i Księżną Litewską —', '2021-03-21, 22:24:36', 3, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2954, 'Koronęć jeszcze dotąd piastuje królewską…', '2021-03-21, 22:29:05', 99, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2955, 'Lecz na Litewskim Księstwie teraz syzma siedzi!»', '2021-03-21, 22:29:21', 28, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2956, '«Z Częstochowy? — rzekł Wilbik. — Byłem tam w spowiedzi,', '2021-03-21, 22:29:25', 73, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2957, 'Kiedym na odpust chodził lat temu trzydzieście.', '2021-03-21, 22:29:43', 74, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2958, 'Czy to prawda, że Francuz gości teraz w mieście,', '2021-03-21, 22:30:02', 88, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2959, 'Że chce kościół rozwalać i skarbiec zabierze:', '2021-03-21, 22:30:03', 69, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2960, 'Bo to wszystko w Litewskim stoi Kuryjerze?»', '2021-03-21, 22:30:07', 73, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2961, '«Nieprawda — rzekł bernardyn — nie! Pan Najjaśniejszy,', '2021-03-21, 22:30:16', 19, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2962, 'Napoleon, katolik jest najprzykładniejszy:', '2021-03-21, 22:30:20', 24, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2963, 'Wszak go papież namaścił, żyją z sobą w zgodzie', '2021-03-21, 22:30:20', 56, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2964, 'I nawracają ludzi w francuskim narodzie,', '2021-03-21, 22:30:36', 45, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2965, 'Który się trochę popsuł. Prawda, z Częstochowy', '2021-03-21, 22:30:58', 98, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2966, 'Oddano wiele srebra na skarb narodowy', '2021-03-21, 22:33:07', 10, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2967, 'Dla ojczyzny, dla Polski; sam Pan Bóg tak każe:', '2021-03-21, 22:34:30', 1, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2968, 'Skarbcem ojczyzny zawsze są Jego ołtarze.', '2021-03-21, 22:36:43', 6, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2969, 'Wszakże w Warszawskim Księstwie mamy sto tysięcy', '2021-03-21, 22:38:01', 40, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2970, 'Wojska polskiego, może wkrótce będzie więcéj:', '2021-03-21, 22:39:08', 2, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2971, 'A któż wojsko opłaci? czy nie wy, Litwini?', '2021-03-21, 22:39:36', 13, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2972, 'Wy tylko grosz dajecie do moskiewskiej skrzyni».', '2021-03-21, 22:39:57', 93, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2973, '«Kat by dał — krzyknął Wilbik — gwałtem od nas biorą».', '2021-03-21, 22:40:00', 3, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2974, '«Oj, dobrodzieju — chłopek ozwał się z pokorą,', '2021-03-21, 22:42:22', 35, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2975, 'Pokłoniwszy się księdzu i skrobiąc się w głowę —', '2021-03-21, 22:44:27', 37, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2976, 'Już to szlachcie, to jeszcze bieda przez połowę;', '2021-03-21, 22:44:52', 32, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2977, 'Lecz nas drą jak na łyka…» «Cham! — Skołuba krzyknął —', '2021-03-21, 22:46:16', 95, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2978, 'Głupi, tobieć to lepiej, tyś chłopie przywyknął,', '2021-03-21, 22:48:30', 43, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2979, 'Jak węgorz do odarcia: lecz nam *urodzonym*,', '2021-03-21, 22:48:33', 69, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2980, 'Nam wielmożnym, do złotych swobód wzwyczajonym!', '2021-03-21, 22:48:59', 70, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2981, 'Ach, bracia! wszak to dawniej szlachcic na zagrodzie…', '2021-03-21, 22:48:59', 96, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2982, '(«Tak, tak — krzyknęli wszyscy — równy wojewodzie!»)', '2021-03-21, 22:53:28', 77, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2983, 'Dziś nam szlachectwa przeczą, każą nam drabować', '2021-03-22, 01:53:56', 55, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2984, 'Papiery, i szlachectwa papierem próbować».', '2021-03-22, 01:54:16', 86, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2985, '«Jeszcze Waszeci mniejsza — zawołał Juraha —', '2021-03-22, 01:54:44', 32, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2986, 'Waszeć z pradziadów chłopów uszlachcony szlacha;', '2021-03-22, 01:58:07', 82, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2987, 'Ale ja, z kniaziów! Pytać u mnie o patenta,', '2021-03-22, 01:58:36', 22, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2988, 'Kiedym został szlachcicem? Sam Bóg to pamięta!', '2021-03-22, 01:58:38', 31, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2989, 'Niechaj Moskal w las idzie pytać się dębiny,', '2021-03-22, 02:01:50', 17, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2990, 'Kto jej dał patent rosnąć nad wszystkie krzewiny».', '2021-03-22, 02:02:01', 90, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2991, '«Kniaziu — rzekł Żagiel — świeć waść baki lada komu,', '2021-03-22, 03:02:09', 11, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2992, 'Tu znajdziesz pono mitry i w niejednym domu».', '2021-03-22, 03:04:21', 83, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2993, '«Waść ma krzyż w herbie — wołał Podhajski — to skryta', '2021-03-22, 03:06:49', 90, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2994, 'Aluzyja, że w rodzie bywał neofita».', '2021-03-22, 03:10:18', 48, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2995, '«Fałsz — przerwał Birbasz — Przecież ja z tatarskich hrabiów', '2021-03-22, 03:14:41', 89, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2996, 'Pochodzę, a mam krzyże nad herbem Korabiów».', '2021-03-22, 03:14:58', 50, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2997, '«Poraj — krzyknął Mickiewicz — z mitrą w polu złotym,', '2021-03-22, 03:19:10', 60, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2998, 'Herb książęcy, Stryjkowski gęsto pisze o tym».', '2021-03-22, 03:19:24', 17, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (2999, 'Za czym wielkie powstały w całej karczmie szmery.', '2021-03-22, 03:19:43', 48, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3000, 'Ksiądz bernardyn uciekł się do swej tabakiery;', '2021-03-22, 03:22:03', 33, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3001, 'W kolej częstował mówców. Gwar zaraz ucichnął;', '2021-03-22, 03:22:26', 94, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3002, 'Każdy zażył przez grzeczność i kilkakroć kichnął.', '2021-03-22, 03:22:47', 57, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3003, 'Bernardyn, korzystając z przerwy, mówił daléj:', '2021-03-22, 03:22:56', 74, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3004, '«Oj, wielcy ludzie od tej tabaki kichali!', '2021-03-22, 03:23:09', 30, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3005, 'Czy uwierzycie państwo, że z tej tabakiery,', '2021-03-22, 10:23:35', 84, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3006, 'Pan jenerał Dąbrowski zażył razy cztery?»', '2021-03-22, 10:23:55', 85, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3007, '«Dąbrowski?» — zawołali. «Tak, tak, on, jenerał.', '2021-03-22, 10:24:23', 78, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3008, 'Byłem w obozie, gdy on Gdańsk Niemcom odbierał;', '2021-03-22, 10:24:46', 2, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3009, 'Miał coś pisać; bojąc się, ażeby nie zasnął,', '2021-03-22, 10:28:03', 16, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3010, 'Zażył, kichnął, dwakroć mię po ramieniu klasnął:', '2021-03-22, 10:28:14', 93, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3011, '»Księże Robaku — mówił — księże bernardynie,', '2021-03-22, 10:28:19', 16, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3012, 'Obaczymy się w Litwie może nim rok minie;', '2021-03-22, 10:28:35', 63, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3013, 'Powiedz Litwinom, niech mnie czekają z tabaką', '2021-03-22, 10:28:36', 88, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3014, 'Częstochowską, nie biorę innej tylko taką».', '2021-03-22, 10:32:44', 77, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3015, 'Mowa księdza wzbudziła takie zadziwienie,', '2021-03-22, 10:33:02', 19, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3016, 'Taką radość, że całe huczne zgromadzenie', '2021-03-22, 11:33:24', 27, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3017, 'Milczało chwilę; potem na pół ciche słowa', '2021-03-22, 11:33:32', 74, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3018, 'Powtarzano: «Tabaka z Polski? Częstochowa?', '2021-03-22, 11:35:47', 65, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3019, 'Dąbrowski? Z ziemi włoskiej?…» Aż na koniec razem,', '2021-03-22, 17:36:09', 64, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3020, 'Jakby myśl z myślą, wyraz sam zbiegł się z wyrazem,', '2021-03-22, 17:40:16', 63, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3021, 'Wszyscy jednogłośnie, jak na dane hasło,', '2021-03-22, 17:40:16', 99, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3022, 'Krzyknęli: «Dąbrowskiego!» Wszystko razem wrzasło,', '2021-03-22, 17:40:43', 40, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3023, 'Wszystko się uścisnęło: chłop z tatarskim hrabią,', '2021-03-22, 17:41:04', 75, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3024, 'Mitra z Krzyżem, Poraje z Gryfem i z Korabią;', '2021-03-22, 17:41:24', 86, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3025, 'Zapomnieli wszystkiego, nawet bernardyna,', '2021-03-22, 17:41:37', 56, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3026, 'Tylko śpiewali krzycząc: «Wódki, miodu, wina!»', '2021-03-22, 17:42:57', 79, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3027, 'Długo się przysłuchiwał ksiądz Robak piosence,', '2021-03-22, 17:43:20', 72, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3028, 'Na koniec chciał ją przerwać; wziął w obydwie ręce', '2021-03-22, 17:43:43', 35, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3029, 'Tabakierkę, kichaniem melodyję zmieszał,', '2021-03-22, 17:46:56', 46, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3030, 'I nim się nastroili, tak mówić pośpieszał:', '2021-03-22, 17:46:59', 65, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3031, '«Chwalicie mą tabakę, mości dobrodzieje;', '2021-03-22, 17:51:12', 1, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3032, 'Obaczcież, co się wewnątrz tabakierki dzieje».', '2021-03-22, 17:51:31', 13, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3033, 'Tu, wycierając chustką zabrudzone denko,', '2021-03-22, 17:51:31', 45, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3034, 'Pokazał malowaną armiję maleńką', '2021-03-22, 17:51:58', 71, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3035, 'Jak rój much; w środku jeden człowiek na rumaku,', '2021-03-23, 01:55:11', 90, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3036, 'Wielki jako chrząszcz, siedział, pewnie wódz orszaku;', '2021-03-23, 01:59:16', 82, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3037, 'Spinał konia, jak gdyby chciał skakać w niebiosa,', '2021-03-23, 01:59:19', 71, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3038, 'Jedną rękę na cuglach, drugą miał u nosa:', '2021-03-23, 02:01:19', 9, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3039, '«Przypatrzcie się — rzekł Robak — tej groźnej postawie:', '2021-03-23, 02:01:30', 76, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3040, 'Zgadnijcie czyja? — Wszyscy patrzyli ciekawie.—', '2021-03-23, 02:01:55', 17, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3041, 'Wielki to człowiek, cesarz, ale nie Moskali,', '2021-03-23, 02:04:19', 85, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3042, 'Ich carowie tabaki nigdy nie bierali…»', '2021-03-23, 02:05:40', 36, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3043, '«Wielki człowiek — zawołał Cydzik — a w kapocie?', '2021-03-23, 02:09:42', 83, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3044, 'Ja myśliłem, że wielcy ludzie chodzą w złocie:', '2021-03-23, 02:10:02', 87, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3045, 'Bo u Moskalów lada jenerał, mospanie,', '2021-03-23, 02:11:29', 46, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3046, 'To tak świeci się w złocie jak szczupak w szafranie».', '2021-03-23, 02:14:56', 57, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3047, '«Ba — przerwał Rymsza — przecież widziałem za młodu', '2021-03-23, 06:16:01', 11, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3048, 'Kościuszkę, naczelnika naszego narodu:', '2021-03-23, 06:16:12', 72, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3049, 'Wielki człowiek! A chodził w krakowskiej sukmanie,', '2021-03-23, 06:16:32', 57, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3050, 'To jest czamarce». «W jakiej czamarce, mospanie? —', '2021-03-23, 06:19:51', 18, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3051, 'Odparł Wilbik. — To przecież zwano taratatką».', '2021-03-23, 06:20:04', 71, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3052, '«Ale tamta z frędzlami, ta jest całkiem gładką» —', '2021-03-23, 06:20:11', 53, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3053, 'Krzyknął Mickiewicz. Zatem wszczynały się swary', '2021-03-23, 06:20:27', 48, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3054, 'O różnych taratatki kształtach i czamary.', '2021-03-23, 06:20:55', 66, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3055, 'Przemyślny Robak, widząc, że się tak rozpryska', '2021-03-23, 06:25:07', 93, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3056, 'Rozmowa, jął ją znowu zbierać do ogniska,', '2021-03-23, 06:27:12', 90, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3057, 'Do swojej tabakiery; częstował, kichali,', '2021-03-23, 06:27:37', 44, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3058, 'Życzyli sobie zdrowia, on rzecz ciągnął daléj:', '2021-03-23, 11:29:49', 61, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3059, '«Gdy cesarz Napoleon w potyczce zażywa', '2021-03-23, 11:29:59', 27, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3060, 'Raz po raz, to znak pewny, że bitwę wygrywa.', '2021-03-23, 11:34:11', 56, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3061, 'Na przykład pod Austerlitz: Francuzi tak stali', '2021-03-23, 12:37:38', 87, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3062, 'Z armatami, a na nich biegła ćma Moskali.', '2021-03-23, 12:42:01', 39, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3063, 'Cesarz patrzył i milczał. Co Francuzi strzelą,', '2021-03-23, 20:42:29', 56, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3064, 'To Moskale pułkami jak trawa się ścielą:', '2021-03-23, 20:42:55', 41, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3065, 'Pułk za pułkiem cwałował i spadał z kulbaki;', '2021-03-23, 20:43:12', 50, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3066, 'Co pułk spadnie, to cesarz zażyje tabaki.', '2021-03-24, 04:43:33', 28, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3067, 'Aż w końcu, Aleksander ze swoim braciszkiem', '2021-03-24, 04:43:49', 82, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3068, 'Konstantym i z niemieckim cesarzem Franciszkiem,', '2021-03-24, 04:44:13', 14, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3069, 'W nogi z pola; więc cesarz, widząc, że po walce,', '2021-03-24, 04:47:20', 79, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3070, 'Spojrzał na nich, zaśmiał się i otrząsnął palce.', '2021-03-24, 04:47:20', 68, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3071, 'Otóż, jeśli kto z panów, coście tu przytomni,', '2021-03-24, 04:47:46', 37, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3072, 'Będzie w wojsku cesarza, niech to sobie wspomni».', '2021-03-24, 04:52:06', 15, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3073, '«Ach — zawołał Skołuba — mój księże kwestarzu!', '2021-03-24, 08:56:13', 81, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3074, 'Kiedyż to będzie! Wszak to ile w kalendarzu', '2021-03-24, 08:56:37', 11, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3075, 'Jest świąt, na każde święto Francuzów nam wróżą:', '2021-03-24, 08:59:01', 70, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3076, 'Wygląda człek, wygląda, aż się oczy mrużą;', '2021-03-24, 19:59:30', 62, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3077, 'A Moskal jak nas trzymał, tak trzyma za szyję.', '2021-03-24, 20:03:38', 28, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3078, 'Pono nim słońce wnidzie, rosa oczy wyje».', '2021-03-24, 20:05:40', 31, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3079, '«Mospanie — rzekł bernardyn — babska rzecz narzekać,', '2021-03-25, 01:09:55', 24, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3080, 'A żydowska rzecz ręce założywszy czekać,', '2021-03-25, 03:10:13', 51, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3081, 'Nim kto w karczmę zajedzie i do drzwi zapuka.', '2021-03-25, 03:13:17', 72, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3082, 'Z Napoleonem pobić Moskalów nie sztuka.', '2021-03-25, 03:13:30', 6, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3083, 'Jużci on Szwabom skórę trzy razy wymłócił,', '2021-03-25, 03:15:47', 96, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3084, 'Brzydkie Prusactwo zdeptał, Anglików wyrzucił', '2021-03-25, 03:17:03', 20, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3085, 'Het za morze, Moskalom zapewne wygodzi;', '2021-03-25, 03:18:14', 40, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3086, 'Ale co stąd wyniknie, wie asan dobrodziéj?', '2021-03-25, 03:18:34', 95, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3087, 'Oto, szlachta litewska wtenczas na koń wsiędzie', '2021-03-25, 03:18:42', 85, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3088, 'I szable weźmie, kiedy bić się z kim nie będzie;', '2021-03-25, 03:18:49', 38, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3089, 'Napoleon sam wszystkich pobiwszy, nareszcie', '2021-03-25, 03:19:07', 8, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3090, 'Powie: »Obejdę się ja bez was, kto jesteście?«', '2021-03-25, 03:19:33', 22, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3091, 'Więc nie dość gościa czekać, nie dość i zaprosić,', '2021-03-25, 03:19:41', 12, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3092, 'Trzeba czeladkę zebrać i stoły pownosić,', '2021-03-25, 03:19:48', 35, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3093, 'A przed ucztą potrzeba dom oczyścić z śmieci,', '2021-03-25, 06:21:01', 79, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3094, 'Oczyścić dom, powtarzam, oczyścić dom, dzieci!»', '2021-03-25, 13:23:21', 55, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3095, 'Nastąpiło milczenie, potem głosy w tłumie:', '2021-03-25, 13:23:33', 43, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3096, '«Jakże to dom oczyścić, jak to ksiądz rozumie?', '2021-03-25, 13:27:55', 94, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3097, 'Jużci my wszystko zrobim, na wszystko gotowi;', '2021-03-25, 13:29:09', 67, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3098, 'Tylko niech ksiądz dobrodziej jaśniej się wysłowi».', '2021-03-25, 13:33:20', 40, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3099, 'Ksiądz poglądał za okno, przerwawszy rozmowę;', '2021-03-25, 13:33:48', 27, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3100, 'Ujrzał coś ciekawego, z okna wytknął głowę,', '2021-03-25, 13:34:05', 9, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3101, 'Po chwili rzekł powstając: «Dziś czasu nie mamy;', '2021-03-25, 22:37:32', 40, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3102, 'Potem o tym obszerniej z sobą pogadamy.', '2021-03-25, 22:37:56', 88, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3103, 'Jutro będę dla sprawy w powiatowym mieście;', '2021-03-25, 22:38:21', 11, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3104, 'I do waszmościów z drogi zajadę po kweście».', '2021-03-26, 01:38:31', 5, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3105, '«Niech też do Niehrymowa ksiądz na nocleg zdąży —', '2021-03-26, 01:38:51', 23, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3106, 'Rzekł ekonom — rad będzie księdzu pan chorąży;', '2021-03-26, 01:39:15', 1, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3107, 'Wszakże na Litwie stare powiada przysłowie:', '2021-03-26, 02:42:39', 39, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3108, 'Szczęśliwy człowiek, jako kwestarz w Niehrymowie!»', '2021-03-26, 02:42:59', 25, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3109, '«I do nas — rzekł Zubkowski — wstąp jeżeli łaska;', '2021-03-26, 02:43:12', 35, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3110, 'Znajdzie się tam półsztuczek płótna, masła faska,', '2021-03-26, 14:43:28', 90, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3111, 'Baran lub krówka; wspomnij księże na te słowa:', '2021-03-26, 22:43:51', 60, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3112, 'Szczęśliwy człowiek, trafił jak ksiądz do Zubkowa».', '2021-03-26, 22:46:52', 77, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3113, '«I do nas» — rzekł Skołuba. «Do nas — Terajewicz —', '2021-03-26, 22:46:52', 94, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3114, 'Żaden bernardyn głodny nie wyszedł z Pucewicz».', '2021-03-26, 22:51:17', 11, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3115, 'Tak cała szlachta prośbą i obietnicami', '2021-03-26, 22:51:39', 75, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3116, 'Przeprowadzała księdza; on już był za drzwiami.', '2021-03-26, 22:55:47', 3, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3117, 'On już pierwej przez okno ujrzał Tadeusza,', '2021-03-26, 22:56:02', 99, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3118, 'Który leciał gościńcem, w cwał, bez kapelusza,', '2021-03-26, 22:58:16', 71, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3119, 'Z głową schyloną, bladym, posępnym obliczem,', '2021-03-26, 23:02:37', 99, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3120, 'A konia ustawicznie bódł i kropił biczem.', '2021-03-26, 23:02:54', 28, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3121, 'Ten widok bardzo księdza bernardyna zmieszał,', '2021-03-26, 23:07:22', 30, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3122, 'Więc za młodzieńcem kroki szybkimi pośpieszał', '2021-03-26, 23:09:27', 19, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3123, 'Do wielkiej puszczy, która, jako oko sięga,', '2021-03-26, 23:09:33', 1, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3124, 'Czerniła się na całym brzegu widnokręga.', '2021-03-27, 04:09:34', 11, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3125, 'Któż zbadał puszcz litewskich przepastne krainy,', '2021-03-27, 04:09:42', 88, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3126, 'Aż do samego środka, do jądra gęstwiny?', '2021-03-27, 04:13:00', 69, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3127, 'Rybak ledwie u brzegów nawiedza dno morza;', '2021-03-27, 04:13:17', 92, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3128, 'Myśliwiec krąży koło puszcz litewskich łoża,', '2021-03-27, 04:15:30', 21, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3129, 'Zna je ledwie po wierzchu, ich postać, ich lice:', '2021-03-27, 04:16:47', 38, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3130, 'Lecz obce mu ich wnętrzne serca tajemnice;', '2021-03-27, 11:17:06', 52, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3131, 'Wieść tylko albo bajka wie, co się w nich dzieje.', '2021-03-27, 11:18:17', 77, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3132, 'Bo gdybyś przeszedł bory i podszyte knieje,', '2021-03-27, 19:20:36', 21, 9, false);
