INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3235, '«Jest! jest!» — wyrzekł półgłosem, zerwał się na nogi.', '2021-03-29, 19:33:48', 88, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3236, 'On słyszał! Oni jeszcze słuchali; nareszcie', '2021-03-29, 19:33:54', 7, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3237, 'Słyszą: jeden pies wrzasnął, potem dwa, dwadzieście,', '2021-03-29, 19:35:08', 30, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3238, 'Wszystkie razem ogary rozpierzchnioną zgrają', '2021-03-29, 19:35:20', 45, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3239, 'Doławiają się, wrzeszczą, wpadły na trop, grają,', '2021-03-29, 19:35:28', 90, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3240, 'Ujadają. Już nie jest to powolne granie', '2021-03-29, 19:37:41', 89, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3241, 'Psów goniących zająca, lisa albo łanie;', '2021-03-29, 19:37:55', 80, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3242, 'Lecz wciąż wrzask krótki, częsty, ucinany, zjadły;', '2021-03-29, 22:42:00', 22, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3243, 'To nie na ślad daleki ogary napadły:', '2021-03-29, 22:42:00', 74, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3244, 'Na oko gonią. Nagle ustał krzyk pogoni,', '2021-03-29, 22:42:06', 62, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3245, 'Doszli zwierza. Wrzask znowu, skowyt: zwierz się broni', '2021-03-29, 22:42:23', 87, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3246, 'I zapewne kaleczy; śród ogarów grania', '2021-03-29, 22:46:41', 72, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3247, 'Słychać coraz to częściej jęk psiego konania.', '2021-03-29, 22:51:00', 4, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3248, 'Strzelcy stali i każdy ze strzelbą gotową', '2021-03-29, 22:51:18', 38, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3249, 'Wygiął się jak łuk naprzód z wciśnioną w las głową.', '2021-03-29, 22:51:39', 98, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3250, 'Nie mogą dłużej czekać! Już ze stanowiska', '2021-03-29, 22:54:54', 87, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3251, 'Jeden za drugim zmyka i w puszczę się wciska,', '2021-03-30, 02:55:07', 60, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3252, 'Chcą pierwsi spotkać źwierza: choć Wojski ostrzegał,', '2021-03-30, 02:56:31', 84, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3253, 'Choć Wojski stanowiska na koniu obiegał,', '2021-03-30, 02:56:57', 96, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3254, 'Krzycząc, że czy kto prostym chłopem, czy paniczem,', '2021-03-30, 02:57:08', 30, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3255, 'Jeżeli z miejsca zejdzie, dostanie w grzbiet smyczem!', '2021-03-30, 02:59:18', 19, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3256, 'Nie było rady! Wszyscy pomimo zakazu', '2021-03-30, 14:59:37', 10, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3257, 'W las pobiegli. Trzy strzelby huknęły od razu;', '2021-03-30, 15:02:02', 13, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3258, 'Potem wciąż kanonada, aż głośniej nad strzały', '2021-03-30, 15:06:17', 2, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3259, 'Ryknął niedźwiedź i echem napełnił las cały.', '2021-03-30, 15:09:22', 68, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3260, 'Ryk okropny, boleści, wściekłości, rozpaczy;', '2021-03-30, 15:09:39', 34, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3261, 'Za nim wrzask psów, krzyk strzelców, trąby dojeżdżaczy', '2021-03-31, 00:10:54', 2, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3262, 'Grzmiały ze środka puszczy. Strzelcy — ci w las śpieszą,', '2021-03-31, 00:11:58', 67, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3263, 'Tamci kurki odwodzą, a wszyscy się cieszą;', '2021-03-31, 00:12:01', 20, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3264, 'Jeden Wojski w żałości, krzyczy, że chybiono.', '2021-03-31, 00:14:20', 23, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3265, 'Strzelcy i obławnicy poszli jedną stroną', '2021-03-31, 00:14:26', 24, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3266, 'Na przełaj źwierza, między ostępem i puszczą,', '2021-03-31, 00:14:43', 31, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3267, 'A niedźwiedź, odstraszony psów i ludzi tłuszczą,', '2021-03-31, 00:14:56', 92, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3268, 'Zwrócił się nazad w miejsca mniej pilnie strzeżone', '2021-03-31, 00:16:19', 74, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3269, 'Ku polom, skąd już zeszły strzelcy rozstawione,', '2021-03-31, 00:16:48', 83, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3270, 'Gdzie tylko pozostali z mnogich łowczych szyków', '2021-03-31, 00:16:49', 79, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3271, 'Wojski, Tadeusz, Hrabia, z kilką obławników.', '2021-03-31, 06:21:15', 96, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3272, 'Tu las był rzadszy. Słychać z głębi ryk, trzask łomu;', '2021-03-31, 06:21:15', 61, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3273, 'Aż z gęstwy, jak z chmur, wypadł niedźwiedź na kształt gromu;', '2021-03-31, 06:21:20', 77, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3274, 'Wkoło psy gonią, straszą, rwą; on wstał na nogi', '2021-03-31, 06:25:36', 61, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3275, 'Tylne i spojrzał wkoło, rykiem strasząc wrogi,', '2021-03-31, 15:30:00', 27, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3276, 'I przednimi łapami to drzewa korzenie,', '2021-03-31, 15:34:30', 28, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3277, 'To pniaki osmalone, to wrosłe kamienie', '2021-03-31, 15:34:31', 36, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3278, 'Rwał, waląc w psów i w ludzi, aż wyłamał drzewo.', '2021-03-31, 15:34:44', 51, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3279, 'Kręcąc nim jak maczugą na prawo, na lewo,', '2021-03-31, 23:34:57', 69, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3280, 'Runął wprost na ostatnich strażników obławy:', '2021-03-31, 23:35:22', 7, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3281, 'Hrabię i Tadeusza. Oni bez obawy', '2021-03-31, 23:35:31', 15, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3282, 'Stoją w kroku, na źwierza wytknęli flint rury,', '2021-03-31, 23:35:39', 96, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3283, 'Jako dwa konduktory w łono ciemnej chmury;', '2021-03-31, 23:36:44', 70, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3284, 'Aż oba jednym razem pociągnęli kurki', '2021-03-31, 23:40:53', 14, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3285, '(Niedoświadczeni!), razem zagrzmiały dwururki:', '2021-03-31, 23:40:59', 35, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3286, 'Chybili. Niedźwiedź skoczył; oni tuż utkwiony', '2021-03-31, 23:41:17', 27, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3287, 'Oszczep jeden chwycili czterema ramiony,', '2021-03-31, 23:41:38', 96, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3288, 'Wydzierali go sobie. Spojrzą, aż tu z pyska', '2021-03-31, 23:45:59', 41, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3289, 'Wielkiego, czerwonego dwa rzędy kłów błyska,', '2021-03-31, 23:46:27', 32, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3290, 'I łapa z pazurami już się na łby spuszcza;', '2021-03-31, 23:50:36', 25, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3291, 'Pobledli, w tył skoczyli i, gdzie rzednie puszcza,', '2021-03-31, 23:54:43', 68, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3292, 'Zmykali. Zwierz za nimi wspiął się, już pazury', '2021-03-31, 23:55:00', 22, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3293, 'Zahaczał, chybił, podbiegł, wspiął się znów do góry', '2021-04-01, 07:55:24', 89, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3294, 'I czarną łapą sięgał Hrabiego włos płowy.', '2021-04-01, 07:56:35', 35, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3295, 'Zdarłby mu czaszkę z mozgów jak kapelusz z głowy,', '2021-04-01, 07:56:52', 64, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3296, 'Gdy Asesor z Rejentem wyskoczyli z boków,', '2021-04-01, 08:00:52', 50, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3297, 'A Gerwazy biegł z przodu o jakie sto kroków,', '2021-04-01, 08:03:17', 65, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3298, 'Z nim Robak, choć bez strzelby — i trzej w jednej chwili', '2021-04-01, 08:03:35', 74, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3299, 'Jak gdyby na komendę razem wystrzelili.', '2021-04-01, 08:03:44', 53, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3300, 'Niedźwiedź wyskoczył w górę jak kot przed chartami', '2021-04-01, 15:03:49', 13, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3301, 'I głową na dół runął, i czterma łapami', '2021-04-01, 15:07:00', 16, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3302, 'Przewróciwszy się młyńcem, cielska krwawe brzemię', '2021-04-01, 15:10:24', 66, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3303, 'Waląc tuż pod Hrabiego, zbił go z nóg na ziemię.', '2021-04-01, 15:11:48', 53, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3304, 'Jeszcze ryczał, chciał jeszcze powstać, gdy nań wsiadły', '2021-04-01, 15:12:13', 52, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3305, 'Rozjuszona Strapczyna i Sprawnik zajadły.', '2021-04-01, 15:16:38', 40, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3306, 'Natenczas Wojski chwycił na taśmie przypięty', '2021-04-01, 15:16:52', 86, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3307, 'Swój róg bawoli, długi, cętkowany, kręty', '2021-04-01, 15:20:04', 56, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3308, 'Jak wąż boa, oburącz do ust go przycisnął,', '2021-04-01, 15:20:11', 49, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3309, 'Wzdął policzki jak banię, w oczach krwią zabłysnął,', '2021-04-01, 15:20:32', 37, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3310, 'Zasunął wpół powieki, wciągnął w głąb pół brzucha', '2021-04-01, 20:24:32', 78, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3311, 'I do płuc wysłał z niego cały zapas ducha,', '2021-04-01, 20:24:36', 10, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3312, 'I zagrał: róg jak wicher wirowatym dechem,', '2021-04-01, 20:26:03', 21, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3313, 'Niesie w puszczę muzykę i podwaja echem.', '2021-04-01, 20:28:23', 77, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3314, 'Umilkli strzelcy, stali szczwacze zadziwieni', '2021-04-01, 20:28:45', 11, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3315, 'Mocą, czystością, dziwną harmoniją pieni.', '2021-04-01, 20:28:46', 88, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3316, 'Starzec cały kunszt, którym niegdyś w lasach słynął,', '2021-04-01, 20:28:53', 80, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3317, 'Jeszcze raz przed uszami myśliwców rozwinął;', '2021-04-01, 20:29:01', 8, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3318, 'Napełnił wnet, ożywił knieje i dąbrowy,', '2021-04-01, 20:29:22', 2, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3319, 'Jakby psiarnię w nie wpuścił i rozpoczął łowy.', '2021-04-01, 20:31:33', 70, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3320, 'Bo w graniu była łowów historyja krótka:', '2021-04-01, 20:31:46', 81, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3321, 'Zrazu odzew dźwięczący, rześki — to pobudka;', '2021-04-01, 20:32:14', 70, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3322, 'Potem jęki po jękach skomlą — to psów granie;', '2021-04-02, 05:34:37', 61, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3323, 'A gdzieniegdzie ton twardszy jak grzmot — to strzelanie.', '2021-04-02, 05:39:03', 99, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3324, 'Tu przerwał, lecz róg trzymał; wszystkim się zdawało,', '2021-04-02, 06:43:24', 82, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3325, 'Że Wojski wciąż gra jeszcze, a to echo grało.', '2021-04-02, 06:43:45', 93, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3326, 'Zadął znowu. Myśliłbyś, że róg kształty zmieniał', '2021-04-02, 06:44:04', 22, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3327, 'I że w ustach Wojskiego to grubiał, to cieniał,', '2021-04-02, 06:46:13', 30, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3328, 'Udając głosy zwierząt: to raz w wilczą szyję', '2021-04-02, 06:47:14', 89, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3329, 'Przeciągając się, długo, przeraźliwie wyje;', '2021-04-02, 06:48:24', 72, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3330, 'Znowu jakby w niedźwiedzie rozwarłszy się gardło,', '2021-04-02, 06:51:29', 55, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3331, 'Ryknął; potem beczenie żubra wiatr rozdarło.', '2021-04-02, 06:54:37', 63, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3332, 'Tu przerwał, lecz róg trzymał; wszystkim się zdawało,', '2021-04-02, 06:58:02', 99, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3333, 'Że Wojski wciąż gra jeszcze, a to echo grało.', '2021-04-02, 06:58:07', 36, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3334, 'Wysłuchawszy rogowej arcydzieło sztuki,', '2021-04-02, 07:00:14', 10, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3335, 'Powtarzały je dęby dębom, bukom buki.', '2021-04-02, 07:00:36', 37, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3336, 'Dmie znowu. Jakby w rogu były setne rogi,', '2021-04-02, 07:02:36', 26, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3337, 'Słychać zmieszane wrzaski szczwania, gniewu, trwogi,', '2021-04-02, 07:03:03', 4, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3338, 'Strzelców, psiarni i zwierząt; aż Wojski do góry', '2021-04-02, 08:04:28', 51, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3339, 'Podniósł róg i tryumfu hymn uderzył w chmury.', '2021-04-02, 14:05:37', 11, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3340, 'Tu przerwał, lecz róg trzymał; wszystkim się zdawało,', '2021-04-02, 14:05:54', 71, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3341, 'Że Wojski wciąż gra jeszcze, a to echo grało.', '2021-04-02, 14:09:22', 75, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3342, 'Ile drzew, tyle rogów znalazło się w boru,', '2021-04-02, 14:12:24', 91, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3343, 'Jedne drugim pieśń niosą jak z choru do choru.', '2021-04-02, 14:12:35', 60, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3344, 'I szła muzyka coraz szersza, coraz dalsza,', '2021-04-02, 14:13:02', 70, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3345, 'Coraz cichsza i coraz czystsza, doskonalsza,', '2021-04-02, 14:13:05', 41, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3346, 'Aż znikła gdzieś daleko, gdzieś na niebios progu!', '2021-04-02, 14:14:21', 76, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3347, 'Wojski obiedwie ręce odjąwszy od rogu', '2021-04-02, 16:14:38', 80, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3348, 'Rozkrzyżował; róg opadł, na pasie rzemiennym', '2021-04-02, 16:14:47', 15, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3349, 'Chwiał się. Wojski z obliczem nabrzmiałym, promiennym,', '2021-04-02, 16:19:16', 37, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3350, 'Z oczyma wzniesionymi, stał jakby natchniony,', '2021-04-02, 16:19:30', 72, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3351, 'Łowiąc uchem ostatnie znikające tony.', '2021-04-02, 16:23:34', 94, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3352, 'A tymczasem zagrzmiało tysiące oklasków,', '2021-04-02, 16:23:55', 8, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3353, 'Tysiące powińszowań i wiwatnych wrzasków.', '2021-04-02, 16:23:56', 49, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3354, 'Uciszono się z wolna i oczy gawiedzi', '2021-04-02, 16:24:25', 53, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3355, 'Zwróciły się na wielki, świeży trup niedźwiedzi.', '2021-04-02, 16:24:40', 95, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3356, 'Leżał krwią opryskany, kulami przeszyty,', '2021-04-02, 16:24:57', 37, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3357, 'Piersiami w gęszczę trawy wplątany i wbity;', '2021-04-02, 16:28:19', 89, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3358, 'Rozprzestrzenił szeroko przednie krzyżem łapy,', '2021-04-02, 16:28:34', 35, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3359, 'Dyszał jeszcze, wylewał strumień krwi przez chrapy,', '2021-04-02, 16:28:35', 53, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3360, 'Otwierał jeszcze oczy, lecz głowy nie ruszy;', '2021-04-03, 00:31:56', 76, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3361, 'Pijawki Podkomorzego dzierżą go pod uszy,', '2021-04-03, 00:35:16', 27, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3362, 'Z lewej strony Strapczyna, a z prawej zawisał', '2021-04-03, 00:35:18', 9, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3363, 'Sprawnik i dusząc gardziel krew czarną wysysał.', '2021-04-03, 00:36:29', 35, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3364, 'Za czym Wojski rozkazał kij żelazny włożyć', '2021-04-03, 00:37:57', 71, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3365, 'Psom między zęby i tak paszczęki roztworzyć.', '2021-04-03, 00:38:23', 86, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3366, 'Kolbami przewrócono na wznak zwierza zwłoki', '2021-04-03, 00:38:41', 74, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3367, 'I znów trzykrotny wiwat uderzył w obłoki.', '2021-04-03, 00:39:06', 39, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3368, '«A co? — krzyknął Asesor, kręcąc strzelby rurą —', '2021-04-03, 02:41:26', 32, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3369, 'A co? fuzyjka moja? górą nasi, górą!', '2021-04-03, 05:41:37', 11, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3370, 'A co? fuzyjka moja? niewielka ptaszyna,', '2021-04-03, 05:41:49', 33, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3371, 'A jak się popisała? To jej nie nowina:', '2021-04-03, 05:43:11', 7, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3372, 'Nie puści ona na wiatr żadnego ładunku.', '2021-04-03, 05:45:37', 19, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3373, 'Od książęcia Sanguszki mam ją w podarunku».', '2021-04-03, 12:46:06', 27, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3374, 'Tu pokazywał strzelbę przedziwnej roboty,', '2021-04-03, 12:46:33', 73, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3375, 'Choć maleńką, i zaczął wyliczać jej cnoty.', '2021-04-03, 12:46:40', 70, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3376, '«Ja biegłem — przerwał Rejent, otarłszy pot z czoła —', '2021-04-03, 17:46:50', 97, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3377, 'Biegłem tuż za niedźwiedziem; a pan Wojski woła:', '2021-04-03, 17:47:06', 71, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3378, '»Stój na miejscu!« Jak tam stać? Niedźwiedź w pole wali,', '2021-04-04, 02:50:24', 73, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3379, 'Rwąc z kopyta jak zając coraz daléj, daléj;', '2021-04-04, 02:54:30', 17, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3380, 'Aż mi ducha nie stało, dobiec ni nadziei,', '2021-04-04, 02:57:37', 69, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3381, 'Aż spojrzę w prawo: sadzi, a tu rzadko w kniei,', '2021-04-04, 03:01:50', 39, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3382, 'Jak też wziąłem na oko: postójże, marucha,', '2021-04-04, 03:06:08', 68, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3383, 'Pomyśliłem, i basta: ot, leży bez ducha!', '2021-04-04, 03:08:34', 18, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3384, 'Tęga strzelba, prawdziwa to Sagalasówka,', '2021-04-04, 03:08:53', 28, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3385, 'Napis: *Sagalas London à Bałabanówka…*', '2021-04-04, 03:09:07', 67, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3386, '(Sławny tam mieszka ślusarz Polak, który robił', '2021-04-04, 03:09:13', 52, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3387, 'Polskie strzelby, ale je po angielsku zdobił)».', '2021-04-04, 03:09:39', 79, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3388, '«Jak to — parsknął Asesor — do kroćset niedźwiedzi!', '2021-04-04, 03:09:56', 95, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3389, 'To to niby pan zabił? Co też to Pan bredzi?»', '2021-04-04, 03:09:59', 62, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3390, '«Słuchaj no — odparł Rejent — tu, panie, nie śledztwo,', '2021-04-04, 03:10:21', 59, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3391, 'Tu obława, tu wszystkich weźmiem na świadectwo…»', '2021-04-04, 03:10:51', 37, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3392, 'Więc kłótnia między zgrają wszczęła się zawzięta:', '2021-04-04, 03:11:08', 68, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3393, 'Ci stronę Asesora, ci brali Rejenta.', '2021-04-04, 03:11:24', 87, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3394, 'O Gerwazym nie wspomniał nikt, bo wszyscy biegli', '2021-04-04, 03:12:34', 37, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3395, 'Z boków i, co się z przodu działo, nie postrzegli.', '2021-04-04, 03:12:46', 29, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3396, 'Wojski głos zabrał: «Teraz jest przynajmniej za co;', '2021-04-04, 03:13:12', 26, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3397, 'Bo to, panowie, nie jest ów szarak ladaco,', '2021-04-04, 04:14:19', 43, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3398, 'To niedźwiedź; tu już nie żal poszukać odwetu,', '2021-04-04, 04:17:28', 69, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3399, 'Czy szerpentyną, czyli nawet z pistoletu.', '2021-04-04, 04:21:31', 69, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3400, 'Spór wasz trudno pogodzić, więc dawnym zwyczajem,', '2021-04-04, 04:21:39', 81, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3401, 'Na pojedynek nasze pozwolenie dajem.', '2021-04-04, 04:25:06', 35, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3402, 'Pamiętam, za mych czasów żyło dwóch sąsiadów,', '2021-04-04, 04:25:28', 91, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3403, 'Oba ludzie uczciwi, szlachta z prapradziadów,', '2021-04-04, 04:25:47', 72, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3404, 'Mieszkali po dwóch stronach nad rzeką Wilejką,', '2021-04-04, 04:25:49', 5, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3405, 'Jeden zwał się Domejko, a drugi Dowejko.', '2021-04-04, 04:30:09', 77, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3406, 'Do niedźwiedzicy oba razem wystrzelili:', '2021-04-04, 04:30:19', 23, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3407, 'Kto zabił, trudno dociec; strasznie się kłócili', '2021-04-04, 04:34:37', 54, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3408, 'I przysięgli strzelać się przez niedźwiedzią skórę:', '2021-04-04, 04:37:48', 5, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3409, 'To mi to po szlachecku, prawie rura w rurę.', '2021-04-04, 10:39:10', 89, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3410, 'Pojedynek ten wiele narobił hałasu;', '2021-04-04, 10:39:23', 55, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3411, 'Pieśni o nim śpiewano za owego czasu.', '2021-04-04, 10:42:40', 38, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3412, 'Ja byłem sekundantem; jak się wszystko działo,', '2021-04-04, 10:43:00', 15, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3413, 'Opowiem od początku historyję całą…»', '2021-04-04, 10:43:23', 60, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3414, 'Nim Wojski zaczął mówić, Gerwazy spór zgodził.', '2021-04-04, 17:45:35', 4, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3415, 'On niedźwiedzia z uwagą dokoła obchodził,', '2021-04-04, 17:45:35', 37, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3416, 'Nareszcie dobył tasak, rozciął pysk na dwoje', '2021-04-04, 17:45:45', 31, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3417, 'I w tylcu głowy, mózgu rozkroiwszy słoje,', '2021-04-04, 17:45:58', 10, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3418, 'Znalazł kulę, wydobył, suknią ochędożył,', '2021-04-04, 17:46:23', 97, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3419, 'Przymierzył do ładunku, do flinty przyłożył,', '2021-04-04, 17:46:24', 61, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3420, 'A potem dłoń podnosząc i kulę na dłoni:', '2021-04-04, 17:50:53', 16, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3421, '«Panowie — rzekł — ta kula nie jest z waszej broni,', '2021-04-04, 17:55:15', 20, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3422, 'Ona z tej Horeszkowskiej wyszła jednorurki', '2021-04-04, 17:55:31', 26, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3423, '(Tu podniósł flintę starą, obwiązaną w sznurki),', '2021-04-04, 17:55:59', 30, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3424, 'Lecz nie ja wystrzeliłem. O, trzeba tam było', '2021-04-04, 17:58:16', 76, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3425, 'Odwagi; straszno wspomnieć, w oczach mi się ćmiło!', '2021-04-05, 02:00:21', 14, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3426, 'Bo prosto biegli ku mnie oba paniczowie,', '2021-04-05, 02:01:36', 29, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3427, 'A niedźwiedź z tyłu już, już na Hrabiego głowie,', '2021-04-05, 02:03:45', 16, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3428, 'Ostatniego z Horeszków!… chociaż po kądzieli.', '2021-04-05, 02:04:00', 74, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3429, '»Jezus Maria!« krzyknąłem i Pańscy anieli', '2021-04-05, 02:07:29', 11, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3430, 'Zesłali mi na pomoc księdza bernardyna.', '2021-04-05, 02:11:35', 80, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3431, 'On nas wszystkich zawstydził; oj, dzielny księżyna!', '2021-04-05, 02:13:44', 15, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3432, 'Gdym drżał, gdym się do cyngla dotknąć nie ośmielił,', '2021-04-05, 10:14:10', 89, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3433, 'On mi z rąk flintę wyrwał, wycelił, wystrzelił:', '2021-04-05, 10:14:27', 40, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3434, 'Między dwie głowy strzelić! sto kroków! nie chybić!', '2021-04-05, 10:14:57', 19, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3435, 'I w sam środek paszczęki! tak mu zęby wybić!', '2021-04-05, 10:15:01', 27, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3436, 'Panowie! długo żyję: jednego widziałem', '2021-04-05, 12:15:04', 32, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3437, 'Człowieka, co mógł takim popisać się strzałem.', '2021-04-05, 12:15:09', 37, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3438, 'Ów głośny niegdyś u nas z tylu pojedynków,', '2021-04-05, 12:16:32', 14, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3439, 'Ów, co korki kobietom wystrzelał z patynków,', '2021-04-05, 12:16:55', 78, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3440, 'Ów łotr nad łotry, sławny w czasy wiekopomne,', '2021-04-05, 12:16:57', 55, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3441, 'Ów Jacek, vulgo Wąsal — nazwiska nie wspomnę…', '2021-04-05, 12:17:17', 86, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3442, 'Ale mu nie czas teraz dojeżdżać niedźwiedzi;', '2021-04-05, 12:19:28', 97, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3443, 'Pewnie po same wąsy hultaj w piekle siedzi.', '2021-04-05, 12:19:46', 28, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3444, 'Chwała księdzu! dwom ludziom on życie ocalił —', '2021-04-05, 12:20:13', 46, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3445, 'Może i trzem: Gerwazy nie będzie się chwalił,', '2021-04-05, 12:21:13', 86, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3446, 'Ale gdyby ostatnie z krwi Horeszków dziecię', '2021-04-05, 12:23:15', 18, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3447, 'Wpadło w bestyi paszczę, nie byłbym na świecie,', '2021-04-05, 12:26:37', 6, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3448, 'I moje by tam stare pogryzł niedźwiedź kości;', '2021-04-05, 12:26:58', 27, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3449, 'Pójdź, księże, wypijemy zdrowie jegomości».', '2021-04-05, 12:26:59', 3, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3450, 'Próżno szukano księdza; wiedzą tylko tyle,', '2021-04-05, 12:29:05', 68, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3451, 'Że po zabiciu źwierza zjawił się na chwilę,', '2021-04-05, 12:29:17', 68, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3452, 'Podskoczył ku Hrabiemu i Tadeuszowi,', '2021-04-05, 21:29:38', 53, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3453, 'A widząc, że obadwa cali są i zdrowi,', '2021-04-05, 21:29:57', 10, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3454, 'Podniósł ku niebu oczy, cicho pacierz zmówił', '2021-04-05, 21:31:07', 50, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3455, 'I pobiegł w pole szybko, jakby go kto łowił.', '2021-04-05, 21:34:17', 63, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3456, 'Tymczasem na Wojskiego rozkaz pęki wrzosu,', '2021-04-05, 21:34:39', 53, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3457, 'Suche chrusty i pniaki rzucono do stosu.', '2021-04-05, 21:37:40', 81, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3458, 'Bucha ogień, wyrasta szara sosna dymu,', '2021-04-05, 21:37:40', 37, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3459, 'I rozszerza się w górze na kształt baldakimu.', '2021-04-05, 21:38:55', 86, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3460, 'Nad płomieniem oszczepy złożono w koziołki,', '2021-04-05, 21:39:18', 92, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3461, 'Na grotach zawieszono brzuchate kociołki;', '2021-04-05, 21:40:27', 53, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3462, 'Z wozów niosą jarzyny, mąki i pieczyste,', '2021-04-05, 21:42:30', 19, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3463, 'I chleb.', '2021-04-05, 21:44:41', 90, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3464, 'Sędzia otworzył puzderko zamczyste,', '2021-04-05, 21:44:42', 39, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3465, 'W którym rzędami flaszek białe sterczą głowy;', '2021-04-06, 03:46:50', 23, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3466, 'Wybiera z nich największy kufel kryształowy', '2021-04-06, 03:48:06', 99, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3467, '(Dostał go Sędzia w darze od księdza Robaka):', '2021-04-06, 03:48:16', 50, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3468, 'Wódka to gdańska, napój miły dla Polaka.', '2021-04-06, 03:48:24', 64, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3469, '«Niech żyje — krzyknął Sędzia w górę wznosząc flaszę —', '2021-04-06, 03:48:52', 68, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3470, 'Miasto Gdańsk, niegdyś nasze, będzie znowu nasze!»', '2021-04-06, 03:50:02', 48, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3471, 'I lał srebrzysty likwor w kolej, aż na końcu', '2021-04-06, 03:51:08', 88, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3472, 'Zaczęło złoto kapać i błyskać na słońcu.', '2021-04-06, 03:54:31', 72, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3473, 'W kociołkach bigos grzano. W słowach wydać trudno', '2021-04-06, 03:56:59', 77, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3474, 'Bigosu smak przedziwny, kolor i woń cudną;', '2021-04-06, 16:57:22', 74, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3475, 'Słów tylko brzęk usłyszy i rymów porządek,', '2021-04-06, 17:00:40', 98, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3476, 'Ale treści ich miejski nie pojmie żołądek.', '2021-04-06, 17:00:48', 23, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3477, 'Aby cenić litewskie pieśni i potrawy,', '2021-04-06, 17:00:49', 8, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3478, 'Trzeba mieć zdrowie, na wsi żyć, wracać z obławy.', '2021-04-06, 17:01:02', 59, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3479, 'Przecież i bez tych przypraw potrawą nie lada', '2021-04-06, 17:04:04', 30, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3480, 'Jest bigos, bo się z jarzyn dobrych sztucznie składa.', '2021-04-06, 17:07:05', 16, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3481, 'Bierze się doń siekana, kwaszona kapusta,', '2021-04-06, 18:10:27', 81, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3482, 'Która, wedle przysłowia, sama idzie w usta;', '2021-04-06, 18:10:50', 83, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3483, 'Zamknięta w kotle, łonem wilgotnym okrywa', '2021-04-06, 18:15:01', 20, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3484, 'Wyszukanego cząstki najlepsze mięsiwa;', '2021-04-06, 18:15:07', 4, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3485, 'I praży się, aż ogień wszystkie z niej wyciśnie', '2021-04-06, 18:18:29', 22, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3486, 'Soki żywne, aż z brzegów naczynia war pryśnie', '2021-04-06, 18:22:41', 34, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3487, 'I powietrze dokoła zionie aromatem.', '2021-04-07, 03:22:44', 96, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3488, 'Bigos już gotów. Strzelcy z trzykrotnym wiwatem,', '2021-04-07, 03:25:00', 55, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3489, 'Zbrojni łyżkami, biegą i bodą naczynie;', '2021-04-07, 03:25:28', 20, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3490, 'Miedź grzmi, dym bucha, bigos jak kamfora ginie;', '2021-04-07, 04:25:54', 38, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3491, 'Zniknął, uleciał; tylko w czeluściach saganów', '2021-04-07, 04:26:15', 82, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3492, 'Wre para jak w kraterze zagasłych wulkanów.', '2021-04-07, 04:26:40', 29, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3493, 'Kiedy się już do woli napili, najedli,', '2021-04-07, 04:30:02', 49, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3494, 'Źwierza na wóz złożyli, sami na koń siedli,', '2021-04-07, 04:30:05', 83, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3495, 'Radzi wszyscy, rozmowni, oprócz Asesora', '2021-04-07, 04:30:11', 90, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3496, 'I Rejenta; ci byli gniewliwsi niż wczora,', '2021-04-07, 04:30:28', 81, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3497, 'Kłócąc się o zalety, ten swej Sanguszkówki,', '2021-04-07, 04:30:52', 77, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3498, 'A ten bałabanowskiej swej Sagalasówki.', '2021-04-07, 04:30:53', 30, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3499, 'Hrabia też i Tadeusz jadą nieweseli,', '2021-04-07, 04:35:17', 41, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3500, 'Wstydząc się, że chybili i że się cofnęli:', '2021-04-07, 04:35:34', 90, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3501, 'Bo na Litwie, kto źwierza wypuści z obławy,', '2021-04-07, 13:39:46', 83, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3502, 'Długo musi pracować, nim poprawi sławy.', '2021-04-07, 13:44:13', 97, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3503, 'Hrabia mówił, że pierwszy do oszczepu godził,', '2021-04-07, 13:44:34', 29, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3504, 'I że spotkaniu z źwierzem Tadeusz przeszkodził;', '2021-04-07, 13:44:57', 22, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3505, 'Tadeusz utrzymywał, że będąc silniejszy', '2021-04-07, 13:47:24', 20, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3506, 'I do robienia ciężkim oszczepem zręczniejszy,', '2021-04-07, 13:48:37', 63, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3507, 'Chciał wyręczyć Hrabiego: tak sobie niekiedy', '2021-04-07, 13:50:50', 19, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3508, 'Przemawiali śród gwaru i wrzasku czeredy.', '2021-04-07, 13:51:18', 51, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3509, 'Wojski jechał pośrodku; staruszek szanowny,', '2021-04-07, 13:51:29', 8, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3510, 'Wesoły był nadzwyczaj i bardzo rozmowny.', '2021-04-07, 13:51:58', 4, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3511, 'Chcąc kłótników zabawić i do zgody dowieść,', '2021-04-07, 13:56:14', 16, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3512, 'Kończył im o Doweyce i Domeyce powieść:', '2021-04-07, 13:59:43', 9, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3513, '«Asesorze, jeżeli chciałem, byś z Rejentem', '2021-04-07, 14:02:08', 38, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3514, 'Pojedynkował, nie myśl, że jestem zawziętym', '2021-04-07, 23:02:30', 77, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3515, 'Na krew ludzką; broń Boże! Chciałem was zabawić,', '2021-04-07, 23:02:42', 7, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3516, 'Chciałem wam komedyję niby to wyprawić,', '2021-04-08, 08:03:11', 39, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3517, 'Wznowić koncept, który ja lat temu czterdzieście', '2021-04-08, 08:04:21', 31, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3518, 'Wymyśliłem — przedziwny! Wy młodzi jesteście,', '2021-04-08, 08:08:44', 18, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3519, 'Nie pamiętacie o nim; lecz za moich czasów,', '2021-04-08, 08:10:06', 88, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3520, 'Głośny był od tej puszczy do poleskich lasów.', '2021-04-08, 08:10:16', 1, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3521, 'Domeyki i Doweyki wszystkie sprzeciwieństwa', '2021-04-08, 15:10:42', 41, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3522, 'Pochodziły, rzecz dziwna, z nazwisk podobieństwa', '2021-04-08, 15:10:59', 10, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3523, 'Bardzo niewygodnego. Bo gdy w czas sejmików,', '2021-04-08, 15:10:59', 77, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3524, 'Przyjaciele Doweyki skarbili stronników,', '2021-04-08, 15:12:28', 50, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3525, 'Szepnął ktoś do szlachcica: »Daj kreskę Doweyce«.', '2021-04-08, 15:12:34', 73, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3526, 'A ten, nie dosłyszawszy, dał kreskę Domeyce.', '2021-04-08, 15:12:42', 75, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3527, 'Gdy na uczcie wniósł zdrowie marszałek Rupejko:', '2021-04-08, 15:12:59', 7, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3528, '»Wiwat Doweyko!« — drudzy krzyknęli: »Domeyko!«', '2021-04-08, 15:13:19', 57, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3529, 'A kto siedział pośrodku, nie trafił do ładu,', '2021-04-09, 00:15:30', 1, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3530, 'Zwłaszcza przy niewyraźnej mowie w czas obiadu.', '2021-04-09, 00:15:31', 17, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3531, 'Gorzej było. Raz w Wilnie jakiś szlachcic pjany', '2021-04-09, 00:15:51', 96, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3532, 'Bił się w szable z Domeyką i dostał dwie rany;', '2021-04-09, 00:19:59', 16, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3533, 'Potem ów szlachcic, z Wilna wracając do domu,', '2021-04-09, 00:22:14', 48, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3534, 'Dziwnym trafem z Doweyką zjechał się u promu.', '2021-04-09, 00:22:25', 93, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3535, 'Gdy więc na jednym promie płynęli Wilejką,', '2021-04-09, 00:24:26', 88, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3536, 'Pyta sąsiada, kto on? odpowie: Doweyko —', '2021-04-09, 00:25:36', 40, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3537, 'Nie czekając, dobywa rapier spod kirejki:', '2021-04-09, 00:26:00', 77, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3538, 'Czach, czach! i za Domeykę podciął wąs Doweyki.', '2021-04-09, 03:29:19', 64, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3539, 'Wreszcie, jak na dobitkę, trzeba jeszcze było,', '2021-04-09, 03:31:28', 9, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3540, 'Żeby na polowaniu tak się wydarzyło,', '2021-04-09, 03:34:35', 11, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3541, 'Że stali blisko siebie oba imiennicy,', '2021-04-09, 03:35:54', 84, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3542, 'I do jednej strzelili razem niedźwiedzicy.', '2021-04-09, 03:36:00', 93, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3543, 'Prawda, że po ich strzale upadła bez duchu;', '2021-04-09, 03:36:24', 11, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3544, 'Ale już pierwej niosła z dziesiątek kul w brzuchu.', '2021-04-09, 03:40:43', 1, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3545, 'Strzelby z jednym kalibrem miało wiele osób:', '2021-04-09, 06:44:12', 92, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3546, 'Kto zabił niedźwiedzicę? dojdźże! jaki sposób?', '2021-04-09, 06:47:16', 33, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3547, 'Tu już krzyknęli: »Dosyć! Trzeba raz rzecz skończyć,', '2021-04-09, 06:47:18', 14, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3548, 'Bóg nas czy diabeł złączył, trzeba się rozłączyć;', '2021-04-09, 06:47:36', 87, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3549, 'Dwóch nas jak dwóch słońc pono zanadto na świecie!«', '2021-04-09, 06:47:59', 59, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3550, 'A więc do szerpentynek i stają na mecie.', '2021-04-09, 06:48:23', 27, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3551, 'Oba szanowni ludzie; co ich szlachta godzą,', '2021-04-09, 06:49:32', 23, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3552, 'To oni na się jeszcze zapalczywiej godzą.', '2021-04-09, 06:52:56', 28, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3553, 'Zmienili broń: od szabel szło na pistolety;', '2021-04-09, 06:53:06', 33, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3554, 'Stają, krzyczym, że nadto przybliżyli mety;', '2021-04-09, 06:56:28', 66, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3555, 'Oni na złość, przysięgli przez niedźwiedzią skórę', '2021-04-09, 06:56:37', 84, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3556, 'Strzelać się: śmierć niechybna! prawie rura w rurę.', '2021-04-09, 06:59:57', 53, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3557, 'Oba tęgo strzelali — »Sekunduj, Hreczecha!«', '2021-04-09, 07:00:00', 32, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3558, '»Zgoda — rzekłem — niech zaraz dół wykopie klecha:', '2021-04-09, 07:01:05', 70, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3559, 'Bo taki spór nie może skończyć się na niczym;', '2021-04-09, 10:01:07', 28, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3560, 'Lecz bijcie się szlacheckim trybem, nie rzeźniczym.', '2021-04-09, 10:01:16', 71, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3561, 'Dosyć już mety zbliżać, widzę, żeście zuchy;', '2021-04-09, 10:02:45', 83, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3562, 'Chcecie strzelać się, rury oparłszy na brzuchy?', '2021-04-09, 10:02:51', 19, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3563, 'Ja nie pozwolę. Zgoda, że na pistolety;', '2021-04-09, 10:02:57', 83, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3564, 'Lecz strzelać się nie z dalszej ani z bliższej mety,', '2021-04-09, 10:07:15', 6, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3565, 'Jak przez skórę niedźwiedzią. Ja rękami memi', '2021-04-09, 10:07:24', 96, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3566, 'Jako sekundant skórę rozciągnę na ziemi,', '2021-04-09, 10:07:46', 64, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3567, 'I ja sam was ustawię: Waść po jednej stronie', '2021-04-09, 10:10:59', 66, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3568, 'Stanie na końcu pyska, a Waść na ogonie«.', '2021-04-09, 10:11:11', 4, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3569, '»Zgoda!« — wrzaśli; czas? — jutro; miejsce? — karczma Usza.', '2021-04-09, 10:11:39', 49, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3570, 'Rozjechali się. Ja zaś do Wirgilijusza…»', '2021-04-09, 10:12:40', 94, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3571, 'Tu Wojskiemu przerwał krzyk: «Wyczha!» Tuż spod koni', '2021-04-09, 10:13:00', 21, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3572, 'Smyknął szarak; już Kusy, już go Sokół goni.', '2021-04-09, 10:13:26', 65, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3573, 'Psy wzięto na obławę wiedząc, że z powrotem', '2021-04-09, 19:13:52', 24, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3574, 'Na polu łatwo można napotkać się z kotem;', '2021-04-09, 19:13:58', 32, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3575, 'Bez smyczy szły przy koniach; gdy kota spostrzegły,', '2021-04-09, 19:14:04', 8, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3576, 'Wprzód nim strzelcy poszczuli, już za nim pobiegły.', '2021-04-09, 19:16:25', 99, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3577, 'Rejent też i Asesor chcieli końmi natrzeć;', '2021-04-09, 19:18:49', 56, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3578, 'Lecz Wojski wstrzymał krzycząc: «Wara! stać i patrzeć!', '2021-04-09, 19:21:03', 15, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3579, 'Nikomu krokiem ruszyć z miejsca nie dozwolę;', '2021-04-09, 19:25:08', 18, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3580, 'Stąd widzim wszyscy dobrze, zając idzie w pole».', '2021-04-09, 19:27:26', 7, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3581, 'W istocie, kot czuł z tyłu myśliwych i psiarnie,', '2021-04-09, 19:27:46', 13, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3582, 'Rwał w pole, słuchy wytknął jak dwa różki sarnie,', '2021-04-10, 01:27:48', 27, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3583, 'Sam szarzał się nad rolą długi, wyciągnięty,', '2021-04-10, 01:32:04', 11, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3584, 'Skoki pod nim sterczały jakby cztery pręty,', '2021-04-10, 01:33:16', 53, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3585, 'Rzekłbyś, że ich nie rusza, tylko ziemię trąca', '2021-04-10, 01:37:30', 51, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3586, 'Po wierzchu, jak jaskółka wodę całująca.', '2021-04-10, 10:41:46', 82, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3587, 'Pył za nim, psy za pyłem; z daleka się zdało,', '2021-04-10, 10:46:05', 55, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3588, 'Że zając, psy i charty jedne tworzą ciało:', '2021-04-10, 10:49:15', 63, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3589, 'Jakby jakaś przez pole suwała się żmija,', '2021-04-10, 10:49:29', 73, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3590, 'Kot jak głowa, pył z tyłu jakby modra szyja,', '2021-04-10, 10:49:30', 1, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3591, 'A psami jak podwójnym ogonem wywija.', '2021-04-10, 10:49:47', 14, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3592, 'Rejent, Asesor patrzą, otworzyli usta,', '2021-04-10, 10:49:49', 42, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3593, 'Dech wstrzymali. Wtem Rejent pobladnął jak chusta,', '2021-04-10, 10:50:17', 99, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3594, 'Zbladł i Asesor; widzą… fatalnie się dzieje:', '2021-04-10, 10:53:28', 34, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3595, 'Owa żmija im dalej, tym bardziej dłużeje,', '2021-04-10, 16:57:37', 94, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3596, 'Już rwie się wpół, już znikła owa szyja pyłu,', '2021-04-10, 16:57:57', 11, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3597, 'Głowa już blisko lasu, ogony, gdzie z tyłu!', '2021-04-10, 16:58:12', 10, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3598, 'Głowa niknie; raz jeszcze jakby kto kutasem', '2021-04-10, 16:59:35', 99, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3599, 'Mignął: w las wpadła; ogon urwał się pod lasem.', '2021-04-10, 17:03:36', 2, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3600, 'Biedne psy, ogłupiałe, biegały pod gajem,', '2021-04-10, 17:03:43', 21, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3601, 'Zdawały się naradzać, oskarżać nawzajem.', '2021-04-10, 17:04:03', 2, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3602, 'Wreszcie wracają, z wolna skacząc przez zagony,', '2021-04-10, 17:05:20', 41, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3603, 'Spuściły uszy, tulą do brzucha ogony', '2021-04-10, 17:08:48', 47, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3604, 'I przybiegłszy, ze wstydu nie śmieją wznieść oczu,', '2021-04-10, 17:12:54', 24, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3605, 'I zamiast iść do panów, stały na uboczu.', '2021-04-10, 17:13:18', 83, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3606, 'Rejent spuścił ku piersiom zasępione czoło,', '2021-04-10, 17:13:35', 41, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3607, 'Asesor rzucał okiem, ale niewesoło;', '2021-04-10, 17:14:42', 29, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3608, 'Potem zaczęli oba słuchaczom wywodzić:', '2021-04-10, 17:14:47', 94, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3609, 'Jak ich charty bez smycza nie nawykły chodzić,', '2021-04-10, 23:14:55', 17, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3610, 'Jak kot znienacka wypadł, jak źle był poszczuty', '2021-04-10, 23:18:14', 64, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3611, 'Na roli, gdzie psom chyba trzeba by wdziać buty,', '2021-04-10, 23:19:16', 60, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3612, 'Tak pełno wszędzie głazów i ostrych kamieni…', '2021-04-11, 00:19:45', 29, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3613, 'Mądrze rzecz wyłuszczali szczwacze doświadczeni;', '2021-04-11, 00:19:58', 60, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3614, 'Myśliwi z tych mów wiele mogliby korzystać,', '2021-04-11, 00:20:16', 18, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3615, 'Lecz nie słuchali pilnie. Ci zaczęli świstać,', '2021-04-11, 00:20:17', 50, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3616, 'Ci śmiać się w głos, ci, mając niedźwiedzia w pamięci,', '2021-04-11, 08:24:24', 92, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3617, 'Gadali o nim, świeżą obławą zajęci.', '2021-04-11, 08:24:45', 40, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3618, 'Wojski ledwie raz okiem za zającem rzucił;', '2021-04-11, 08:24:53', 65, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3619, 'Widząc, że uciekł, głowę obojętnie zwrócił', '2021-04-11, 08:29:06', 60, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3620, 'I kończył rzecz przerwaną: «Na czym więc stanąłem?', '2021-04-11, 08:29:34', 54, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3621, 'Aha! na tym, że obu za słowo ująłem,', '2021-04-11, 08:30:00', 52, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3622, 'Iż będą strzelali się przez niedźwiedzią skórę…', '2021-04-11, 08:34:02', 6, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3623, 'Szlachta w krzyk: »To śmierć pewna! Prawie rura w rurę!«', '2021-04-11, 15:34:05', 17, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3624, 'A ja w śmiech. Bo mnie uczył mój przyjaciel Maro,', '2021-04-11, 15:34:32', 53, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3625, 'Że skóra zwierza nie jest lada jaką miarą.', '2021-04-11, 15:34:53', 18, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3626, 'Wszak wiecie waćpanowie, jak królowa Dydo', '2021-04-11, 15:35:06', 64, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3627, 'Przypłynęła do Libów i tam z wielką biédą', '2021-04-11, 15:37:27', 81, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3628, 'Wytargowała sobie taki ziemi kawał,', '2021-04-11, 15:37:28', 90, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3629, 'Który by się wołową skórą nakryć dawał:', '2021-04-11, 15:41:50', 19, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3630, 'Na tym kawałku ziemi stanęła Kartago!', '2021-04-11, 15:45:14', 59, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3631, 'Więc ja to sobie w nocy rozbieram z uwagą.', '2021-04-11, 15:46:43', 90, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3632, 'Ledwie dniało, już z jednej strony taradejką', '2021-04-11, 15:50:47', 53, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3633, 'Jedzie Doweyko, z drugiej na koniu Domeyko.', '2021-04-11, 21:50:57', 20, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3634, 'Patrzą, aż tu przez rzekę leży most kosmaty,', '2021-04-11, 21:50:59', 85, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3635, 'Pas ze skóry niedźwiedziej, porzniętej na szmaty.', '2021-04-11, 21:54:10', 53, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3636, 'Postawiłem Doweykę na źwierza ogonie', '2021-04-11, 21:58:28', 47, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3637, 'Z jednej strony, Domeykę zaś po drugiej stronie:', '2021-04-11, 21:58:56', 69, 9, false);
