INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3650, 'Księga piąta', '2021-04-12, 13:14:19', 95, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3651, 'Kłótnia', '2021-04-12, 13:18:37', 21, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3652, 'Plany myśliwskie Telimeny — Ogrodniczka wybiera się na wielki świat i słucha nauk opiekunki — Strzelcy wracają — Wielkie zadziwienie Tadeusza — Spotkanie się powtórne w Świątyni dumania i zgoda ułatwiona za pośrednictwem mrówek — U stołu wytacza się rzecz o łowach — Powieść Wojskiego o Rejtanie i księciu Denassów, przerwana — Zagajenie układów między stronami, także przerwane — Zjawisko z kluczem — Kłótnia — Hrabia z Gerwazym odbywają radę wojenną.', '2021-04-12, 13:19:01', 60, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3653, 'Wojski, chlubnie skończywszy łowy, wraca z boru,', '2021-04-12, 18:23:07', 27, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3654, 'A Telimena w głębi samotnego dworu', '2021-04-12, 18:23:29', 64, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3655, 'Zaczyna polowanie. Wprawdzie nieruchoma,', '2021-04-12, 18:23:31', 38, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3656, 'Siedzi z założonymi na piersiach rękoma,', '2021-04-12, 18:23:43', 41, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3657, 'Lecz myślą goni źwierzów dwóch; szuka sposobu,', '2021-04-12, 18:26:00', 87, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3658, 'Jak by razem obsaczyć i ułowić obu:', '2021-04-12, 18:26:10', 34, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3659, 'Hrabię i Tadeusza. Hrabia panicz młody,', '2021-04-12, 18:26:37', 76, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3660, 'Wielkiego domu dziedzic, powabnej urody,', '2021-04-12, 18:26:56', 75, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3661, 'Już trochę zakochany: cóż? może się zmienić!', '2021-04-12, 21:28:25', 10, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3662, 'Potem, czy szczerze kocha? czy się zechce żenić?', '2021-04-12, 21:28:50', 62, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3663, 'Z kobietą kilku laty starszą! niebogatą!', '2021-04-12, 21:33:16', 38, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3664, 'Czy mu krewni pozwolą? co świat powie na to?', '2021-04-12, 21:34:22', 17, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3665, 'Telimena, tak myśląc, z sofy się podniosła', '2021-04-12, 21:38:43', 25, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3666, 'I stanęła na palcach: rzekłbyś, że podrosła;', '2021-04-12, 21:42:07', 36, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3667, 'Odkryła nieco piersi, wygięła się bokiem,', '2021-04-12, 21:42:36', 83, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3668, 'I sama siebie pilnym obejrzała okiem,', '2021-04-12, 21:43:44', 61, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3669, 'I znowu zapytała o radę zwierciadła;', '2021-04-12, 21:43:49', 44, 14, false);
