INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3681, 'Ono rozkosz i wita, i żegna z weselem,', '2021-04-13, 03:56:27', 77, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3682, 'Jak skromną ucztę, którą dzielim z przyjacielem.', '2021-04-13, 03:56:43', 72, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3683, 'Tylko stary pjanica, gdy już spali trzewa,', '2021-04-13, 03:56:56', 84, 6, false);
