INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3749, 'Telimena, całując i głaszcząc pod brodę,', '2021-04-14, 08:28:20', 11, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3750, 'Z radością zważa dziecka żywość i urodę', '2021-04-14, 08:30:30', 28, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3751, '(Bo prawdziwie kochała swą wychowanicę).', '2021-04-14, 08:30:49', 76, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3752, 'Ale znowu poważnie nastroiła lice,', '2021-04-14, 08:31:02', 82, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3753, 'Wstała i przechodząc się wszerz i wzdłuż alkowy,', '2021-04-14, 08:31:14', 45, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3754, 'Dzierżąc palec przy ustach, tymi rzekła słowy:', '2021-04-14, 08:31:25', 64, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3755, '«Kochana Zosiu, już też całkiem zapominasz', '2021-04-14, 08:32:52', 36, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3756, 'I na stan, i na wiek twój: wszak to dziś zaczynasz', '2021-04-14, 08:32:54', 21, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3757, 'Rok czternasty. Czas rzucić indyki i kurki;', '2021-04-14, 08:33:07', 71, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3758, 'Fi! to godna zabawka dygnitarskiej córki!', '2021-04-14, 08:35:13', 61, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3759, 'I z umurzaną dziatwą chłopską już do woli', '2021-04-14, 08:35:39', 89, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3760, 'Napieściłaś się! Zosiu, patrząc serce boli:', '2021-04-14, 08:37:46', 93, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3761, 'Opaliłaś okropnie płeć, czysta Cyganka,', '2021-04-14, 08:41:49', 61, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3762, 'A chodzisz i ruszasz się jak parafijanka.', '2021-04-14, 08:43:15', 13, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3763, 'Już ja temu wszystkiemu na przyszłość zaradzę;', '2021-04-14, 08:43:39', 96, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3764, 'Od dziś zacznę, dziś ciebie na świat wyprowadzę,', '2021-04-14, 08:43:49', 76, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3765, 'Do salonu, do gości — gości mamy siła;', '2021-04-14, 13:43:53', 98, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3766, 'Patrzajżeż, ażebyś mnie wstydu nie zrobiła».', '2021-04-14, 13:46:10', 49, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3767, 'Zosia skoczyła z miejsca i klasnęła w dłonie,', '2021-04-14, 13:46:31', 71, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3768, 'I ciotce zawisnąwszy oburącz na łonie,', '2021-04-14, 13:46:41', 73, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3769, 'Płakała i śmiała się na przemian z radości.', '2021-04-14, 13:47:03', 84, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3770, '«Ach ciociu, już tak dawno nie widziałam gości!', '2021-04-14, 13:47:25', 73, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3771, 'Od czasu, jak tu żyję z kury i indyki,', '2021-04-14, 13:47:52', 84, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3772, 'Jeden gość, co widziałam, to był gołąb dziki.', '2021-04-14, 13:48:57', 37, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3773, 'Już mi troszeczkę nudno tak siedzieć w alkowie;', '2021-04-14, 13:51:04', 66, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3774, 'Pan Sędzia nawet mówi, że to źle na zdrowie».', '2021-04-14, 13:55:23', 1, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3775, '«Sędzia! — przerwała ciotka — ciągle mi dokuczał', '2021-04-14, 13:59:23', 26, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3776, 'Żeby cię na świat wywieść, ciągle pod nos mruczał', '2021-04-14, 14:00:51', 1, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3777, 'Że już jesteś dorosła: sam nie wie, co plecie,', '2021-04-14, 14:04:09', 18, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3778, 'Dziaduś, nigdy na wielkim niebywały świecie.', '2021-04-14, 14:06:31', 7, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3779, 'Ja wiem lepiej, jak długo trzeba się sposobić', '2021-04-14, 14:06:50', 47, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3780, 'Panience, by wyszedłszy na świat efekt zrobić.', '2021-04-14, 14:07:06', 1, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3781, 'Wiedz Zosiu, że kto rośnie na widoku ludzi,', '2021-04-14, 14:10:30', 18, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3782, 'Choć piękny, choć rozumny, efektów nie wzbudzi,', '2021-04-14, 14:10:58', 51, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3783, 'Gdy go wszyscy przywykną widzieć od maleńka;', '2021-04-14, 14:11:04', 19, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3784, 'Lecz niechaj ukształcona, dorosła panienka,', '2021-04-14, 14:13:29', 51, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3785, 'Nagle ni stąd, ni zowąd przed światem zabłyśnie,', '2021-04-14, 21:17:35', 36, 9, false);
