INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3788, 'Słowa jej podsłuchiwa i drugim powtarza;', '2021-04-14, 21:22:09', 50, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3789, 'A kiedy wejdzie w modę raz młoda osoba,', '2021-04-14, 21:26:33', 50, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3790, 'Każdy ją chwalić musi, choć i nie podoba.', '2021-04-14, 21:27:01', 42, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3791, 'Znaleźć się, spodziewam się, że umiesz: w stolicy', '2021-04-14, 21:29:22', 6, 17, false);
