INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3796, 'Spiesz się, bo lada chwila wrócą z polowania».', '2021-04-14, 21:42:42', 85, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3797, 'Wezwano pokojowę i służącą dziewkę,', '2021-04-14, 21:42:45', 9, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3798, 'W naczynie srebrne wody wylano konewkę.', '2021-04-14, 21:44:00', 30, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3799, 'Zosia, jak wróbel w piasku, trzepioce się, myje', '2021-04-14, 22:47:20', 14, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3800, 'Z pomocą sługi ręce, oblicze i szyję.', '2021-04-14, 22:47:32', 82, 6, false);
