INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3805, 'Zosia kładnie pończoszki białe, ażurowe,', '2021-04-15, 07:52:05', 94, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3806, 'I trzewiki warszawskie białe, atłasowe.', '2021-04-15, 07:54:19', 94, 11, false);
