INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3810, 'Pukle, że nazbyt krótkie, uwito w dwa sploty,', '2021-04-15, 08:02:14', 23, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3811, 'Zostawując na czole i skroniach włos gładki;', '2021-04-15, 08:02:30', 71, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3812, 'Pokojowa zaś świeżo zebrane bławatki', '2021-04-15, 08:02:43', 72, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3813, 'Uwiązawszy w plecionkę daje Telimenie,', '2021-04-15, 08:05:11', 97, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3814, 'Ta ją do głowy Zosi przyszpila uczenie,', '2021-04-15, 08:05:24', 46, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3815, 'Z prawej strony na lewo: kwiat od bladych włosów', '2021-04-15, 08:06:48', 46, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3816, 'Odbijał bardzo pięknie, jak od zboża kłosów!', '2021-04-15, 08:06:57', 53, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3817, 'Zdjęto puderman, całe ubranie gotowe.', '2021-04-15, 08:07:22', 90, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3818, 'Zosia białą sukienkę wrzuciła przez głowę,', '2021-04-15, 08:08:22', 96, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3819, 'Chusteczkę batystową białą w ręku zwija,', '2021-04-15, 08:12:43', 78, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3820, 'I tak cała wygląda biała jak lilija.', '2021-04-15, 08:13:07', 7, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3821, 'Poprawiwszy raz jeszcze i włosów, i stroju,', '2021-04-15, 09:14:25', 22, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3822, 'Kazano jej wzdłuż i wszerz przejść się po pokoju.', '2021-04-15, 09:14:44', 33, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3823, 'Telimena uważa znawczyni oczyma,', '2021-04-15, 09:15:13', 25, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3824, 'Musztruje siostrzenicę, gniewa się i zżyma;', '2021-04-15, 09:15:20', 71, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3825, 'Aż na dygnienie Zosi krzyknęła z rozpaczy:', '2021-04-15, 09:15:48', 89, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3826, '«Ja nieszczęśliwa! Zosiu, widzisz co to znaczy', '2021-04-15, 09:16:59', 31, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3827, 'Żyć z gęśmi, z pastuchami! Tak nogi rozszerzasz', '2021-04-15, 09:18:59', 80, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3828, 'Jak chłopiec, okiem w prawo i w lewo uderzasz,', '2021-04-15, 09:23:19', 74, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3829, 'Czysta rozwódka!… Dygnij, patrz, jaka niezwinna!»', '2021-04-15, 09:24:20', 23, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3830, '«Ach ciociu — rzekła smutnie Zosia — cóż ja winna!', '2021-04-15, 18:28:31', 92, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3831, 'Ciotka mnie zamykała; nie było z kim tańczyć,', '2021-04-15, 18:28:43', 7, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3832, 'Lubiłam z nudy ptastwo paść i dzieci niańczyć.', '2021-04-15, 18:29:10', 97, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3833, 'Ale poczekaj ciociu, niech no się pobawię', '2021-04-15, 18:29:16', 30, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3834, 'Trochę z ludźmi, obaczysz, jak się ja poprawię».', '2021-04-15, 18:30:32', 33, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3835, '«Już — rzekła ciotka — z dwojga złego, lepiej z ptastwem,', '2021-04-15, 18:30:35', 93, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3836, 'Niż z tym, co u nas dotąd gościło plugastwem;', '2021-04-15, 18:31:01', 99, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3837, 'Przypomnij tylko sobie, kto tu u nas bywał:', '2021-04-15, 18:34:26', 42, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3838, 'Pleban, co pacierz mruczał lub w warcaby grywał,', '2021-04-15, 18:34:34', 36, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3839, 'I palestra z fajkami! To mi kawalery!', '2021-04-15, 18:34:42', 79, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3840, 'Nabrałabyś się od nich pięknej manijery.', '2021-04-15, 18:38:47', 97, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3841, 'Teraz to pokazać się jest przynajmniej komu,', '2021-04-15, 18:41:05', 10, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3842, 'Mamy przecież uczciwe towarzystwo w domu.', '2021-04-15, 18:41:19', 63, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3843, 'Uważaj dobrze, Zosiu, jest tu Hrabia młody,', '2021-04-15, 18:44:28', 62, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3844, 'Pan dobrze wychowany, krewny wojewody,', '2021-04-15, 18:46:56', 59, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3845, 'Pamiętaj być mu grzeczną».', '2021-04-15, 18:48:04', 29, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3846, 'Słychać rżenie koni', '2021-04-15, 18:48:21', 28, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3847, 'I gwar myśliwców; już są pod bramą: to oni!', '2021-04-15, 18:48:26', 63, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3848, 'Wziąwszy Zosię pod rękę pobiegła do sali.', '2021-04-15, 18:48:28', 44, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3849, 'Myśliwi na pokoje jeszcze nie wchadzali;', '2021-04-15, 18:50:35', 92, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3850, 'Musieli po komnatach odmieniać swą odzież,', '2021-04-15, 18:50:41', 60, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3851, 'Nie chcąc wniść do dam w kurtkach. Pierwsza wpadła młodzież,', '2021-04-15, 18:53:49', 44, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3852, 'Pan Tadeusz i Hrabia, co żywo przebrani.', '2021-04-15, 18:54:04', 44, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3853, 'Telimena sprawuje obowiązki pani,', '2021-04-15, 23:54:15', 99, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3854, 'Wita wchodzących, sadza, rozmową zabawia,', '2021-04-15, 23:58:32', 94, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3855, 'I siostrzenicę wszystkim z kolei przedstawia:', '2021-04-15, 23:59:37', 11, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3856, 'Naprzód Tadeuszowi, jako krewną bliską.', '2021-04-16, 00:00:44', 23, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3857, 'Zosia grzecznie dygnęła, on skłonił się nisko,', '2021-04-16, 00:05:13', 52, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3858, 'Chciał coś do niej przemówić, już usta otworzył:', '2021-04-16, 00:09:31', 36, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3859, 'Ale spojrzawszy w oczy Zosi, tak się strwożył,', '2021-04-16, 00:12:39', 44, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3860, 'Że stojąc niemy przed nią, to płonął, to bladnął;', '2021-04-16, 00:16:41', 42, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3861, 'Co było w jego sercu, on sam nie odgadnął.', '2021-04-16, 00:19:44', 36, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3862, 'Uczuł się nieszczęśliwym bardzo — poznał Zosię!', '2021-04-16, 06:23:44', 47, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3863, 'Po wzroście i po włosach światłych, i po głosie;', '2021-04-16, 06:24:02', 46, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3864, 'Tę kibić i tę główkę widział na parkanie,', '2021-04-16, 06:27:05', 40, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3865, 'Ten wdzięczny głos zbudził go dziś na polowanie.', '2021-04-16, 06:31:05', 81, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3866, 'Aż Wojski Tadeusza wyrwał z zamięszania;', '2021-04-16, 06:31:17', 92, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3867, 'Widząc, że bladnie i że na nogach się słania,', '2021-04-16, 07:35:34', 11, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3868, 'Radził mu odejść do swej izby dla spoczynku.', '2021-04-16, 07:35:48', 35, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3869, 'Tadeusz stanął w kącie, wsparł się na kominku,', '2021-04-16, 07:36:12', 22, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3870, 'Nic nie mówiąc — szerokie, obłędne źrenice', '2021-04-16, 07:36:31', 46, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3871, 'Obracał to na ciotkę, to na siostrzenicę.', '2021-04-16, 07:37:51', 7, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3872, 'Dostrzegła Telimena, iż pierwsze spojrzenie', '2021-04-16, 07:41:17', 41, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3873, 'Zosi tak wielkie na nim zrobiło wrażenie;', '2021-04-16, 07:41:44', 74, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3874, 'Nie odgadła wszystkiego, przecież pomięszana', '2021-04-16, 07:45:44', 45, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3875, 'Bawi gości, a z oczu nie spuszcza młodziana.', '2021-04-16, 07:46:01', 17, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3876, 'Wreszcie czas upatrzywszy ku niemu podbiega:', '2021-04-16, 07:46:19', 93, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3877, 'Czy zdrów? dlaczego smutny? pyta się, nalega,', '2021-04-16, 07:50:33', 84, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3878, 'Napomyka o Zosi, zaczyna z nim żarty;', '2021-04-16, 07:52:50', 84, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3879, 'Tadeusz nieruchomy, na łokciu oparty,', '2021-04-16, 07:53:13', 44, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3880, 'Nic nie gadając marszczył brwi i usta krzywił:', '2021-04-16, 07:53:23', 23, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3881, 'Tym bardziej Telimenę pomięszał i zdziwił.', '2021-04-16, 08:53:42', 27, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3882, 'Zmieniła więc natychmiast twarz i ton rozmowy,', '2021-04-16, 09:55:44', 31, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3883, 'Powstała zagniewana, i ostrymi słowy', '2021-04-16, 09:57:45', 84, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3884, 'Poczęła nań przymówki sypać i wyrzuty.', '2021-04-16, 10:01:51', 49, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3885, 'Porwał się i Tadeusz jak żądłem ukłuty,', '2021-04-16, 10:03:13', 30, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3886, 'Spojrzał krzywo, nie mówiąc ani słowa, splunął,', '2021-04-16, 11:03:21', 43, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3887, 'Krzesło nogą odepchnął i z pokoju runął,', '2021-04-16, 11:03:41', 57, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3888, 'Trzasnąwszy drzwi za sobą. Szczęściem, że tej sceny', '2021-04-16, 11:06:51', 60, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3889, 'Nikt z gości nie uważał oprócz Telimeny.', '2021-04-16, 11:07:14', 69, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3890, 'Wyleciawszy przez bramę, biegł prosto na pole.', '2021-04-16, 11:11:41', 87, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3891, 'Jak szczupak, gdy mu oścień skróś piersi przekole,', '2021-04-16, 11:16:05', 7, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3892, 'Pluska się i nurtuje, myśląc że uciecze,', '2021-04-16, 11:19:09', 42, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3893, 'Ale wszędzie żelazo i sznur z sobą wlecze:', '2021-04-16, 11:21:16', 68, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3894, 'Tak i Tadeusz ciągnął za sobą zgryzoty,', '2021-04-16, 11:21:36', 78, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3895, 'Suwając się przez rowy i skacząc przez płoty,', '2021-04-16, 11:23:41', 48, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3896, 'Bez celu i bez drogi; aż niemało czasu', '2021-04-16, 11:24:00', 91, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3897, 'Nabłąkawszy się, w końcu wszedł w głębinę lasu', '2021-04-16, 11:24:13', 92, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3898, 'I trafił, czy umyślnie, czyli też przypadkiem,', '2021-04-16, 11:24:15', 17, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3899, 'Na wzgórek, co był wczora szczęścia jego świadkiem,', '2021-04-16, 16:24:37', 11, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3900, 'Gdzie dostał ów bilecik, zadatek kochania,', '2021-04-16, 16:25:02', 7, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3901, 'Miejsce, jak wiemy, zwane *Świątynią dumania*.', '2021-04-16, 16:26:27', 75, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3902, 'Gdy okiem wkoło rzuca, postrzega: to ona!', '2021-04-16, 16:26:55', 14, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3903, 'Telimena, samotna, w myślach pogrążona,', '2021-04-16, 16:27:10', 39, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3904, 'Od wczorajszej postacią i strojem odmienna,', '2021-04-16, 16:27:37', 33, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3905, 'W bieliźnie, na kamieniu, sama jak kamienna;', '2021-04-16, 18:27:37', 56, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3906, 'Twarz schyloną w otwarte utuliła dłonie,', '2021-04-16, 18:28:02', 31, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3907, 'Choć nie słyszysz szlochania, znać, że we łzach tonie.', '2021-04-16, 18:30:23', 34, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3908, 'Daremnie broniło się serce Tadeusza;', '2021-04-16, 18:30:23', 4, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3909, 'Ulitował się, uczuł że go żal porusza.', '2021-04-16, 18:30:30', 3, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3910, 'Długo poglądał niemy, ukryty za drzewem,', '2021-04-16, 18:33:56', 49, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3911, 'Na koniec westchnął i rzekł sam do siebie z gniewem:', '2021-04-16, 18:35:56', 81, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3912, '«Głupi! cóż ona winna, że się ja pomylił?»', '2021-04-16, 18:37:03', 21, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3913, 'Więc z wolna głowę ku niej zza drzewa wychylił —', '2021-04-16, 18:37:29', 18, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3914, 'Gdy nagle Telimena zrywa się z siedzenia,', '2021-04-16, 18:37:51', 21, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3915, 'Rzuca się w prawo, w lewo, skacze skróś strumienia,', '2021-04-16, 18:38:20', 8, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3916, 'Rozkrzyżowana, z włosem rozpuszczonym, blada,', '2021-04-16, 18:40:25', 67, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3917, 'Pędzi w las, podskakuje, przyklęka, upada,', '2021-04-16, 18:40:33', 41, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3918, 'I nie mogąc już powstać, kręci się po darni;', '2021-04-16, 20:44:49', 98, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3919, 'Widać z jej ruchów, w jakiej strasznej jest męczarni:', '2021-04-16, 20:48:00', 5, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3920, 'Chwyta się za pierś, szyję, za stopy, kolana.', '2021-04-16, 20:48:08', 91, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3921, 'Skoczył Tadeusz myśląc, że jest pomieszana', '2021-04-16, 20:48:12', 89, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3922, 'Lub ma wielką chorobę. Lecz z innej przyczyny', '2021-04-16, 20:48:17', 97, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3923, 'Pochodziły te ruchy.', '2021-04-16, 20:48:34', 26, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3924, 'U bliskiej brzeziny', '2021-04-16, 20:50:48', 96, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3925, 'Było wielkie mrowisko. Owad gospodarny', '2021-04-16, 20:51:50', 4, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3926, 'Snuł się wkoło po trawie, ruchawy i czarny.', '2021-04-16, 20:53:08', 97, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3927, 'Nie wiedzieć, czy z potrzeby czy z upodobania,', '2021-04-16, 20:53:15', 13, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3928, 'Lubił szczególnie zwiedzać *Świątynię dumania*;', '2021-04-17, 02:53:27', 58, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3929, 'Od stołecznego wzgórka aż po źródła brzegi', '2021-04-17, 02:53:55', 69, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3930, 'Wydeptał drogę, którą wiódł swoje szeregi.', '2021-04-17, 11:53:57', 32, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3931, 'Nieszczęściem, Telimena siedziała śród drożki:', '2021-04-17, 11:54:02', 89, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3932, 'Mrówki, znęcone blaskiem bieluchnej pończoszki,', '2021-04-17, 17:54:07', 10, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3933, 'Wbiegły, gęsto zaczęły łaskotać i kąsać,', '2021-04-17, 17:54:28', 42, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3934, 'Telimena musiała uciekać, otrząsać,', '2021-04-17, 17:58:53', 54, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3935, 'Na koniec na murawie siąść i owad łowić.', '2021-04-17, 17:59:06', 5, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3936, 'Nie mógł jej swej pomocy Tadeusz odmówić:', '2021-04-17, 17:59:34', 33, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3937, 'Oczyszczając sukienkę, aż do nóg się zniżył,', '2021-04-17, 17:59:35', 3, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3938, 'Usta trafem ku skroniom Telimeny zbliżył —', '2021-04-17, 17:59:43', 12, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3939, 'W tak przyjaznej postawie, choć nic nie mówili', '2021-04-17, 17:59:53', 10, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3940, 'O rannych kłótniach swoich, przecież się zgodzili;', '2021-04-17, 18:00:19', 47, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (3941, 'I nie wiedzieć, jak długo trwałaby rozmowa,', '2021-04-17, 18:04:21', 8, 13, false);
