INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4043, 'Zmarszczki; tysiąc zmarszczków pod brodą się chroni!', '2021-04-21, 02:49:07', 88, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4044, 'Niestety! Czuł Tadeusz, jak jest niepotrzebnie', '2021-04-21, 02:50:07', 85, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4045, 'Rzecz piękną nazbyt ściśle zważać; jak haniebnie,', '2021-04-21, 02:50:36', 14, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4046, 'Być szpiegiem swej kochanki; nawet jak szkaradnie,', '2021-04-21, 02:53:44', 94, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4047, 'Odmieniać smak i serce — lecz któż sercem władnie?', '2021-04-21, 02:57:52', 38, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4048, 'Darmo chce brak miłości zastąpić sumnieniem,', '2021-04-21, 02:57:59', 82, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4049, 'Chłód duszy ogrzać znowu jej wzroku promieniem:', '2021-04-21, 02:59:19', 40, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4050, 'Już ten wzrok, jako księżyc światły a bez ciepła,', '2021-04-21, 02:59:27', 11, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4051, 'Błyskał po wierzchu duszy, która do dna krzepła.', '2021-04-21, 11:59:32', 29, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4052, 'Takie robiąc sam w sobie wyrzuty i skargi,', '2021-04-21, 15:03:54', 42, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4053, 'Pochylił w talerz głowę, milczał i gryzł wargi.', '2021-04-21, 15:03:56', 78, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4054, 'Tymczasem zły duch nową pokusą go wabi,', '2021-04-21, 15:07:02', 65, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4055, 'Podsłuchiwać, co Zosia mówiła do Hrabi.', '2021-04-21, 15:11:23', 24, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4056, 'Dziewczyna, uprzejmością Hrabiego ujęta,', '2021-04-21, 15:15:37', 42, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4057, 'Zrazu rumieniła się, spuściwszy oczęta,', '2021-04-21, 15:18:57', 11, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4058, 'Potem śmiać się zaczęli, w końcu rozmawiali', '2021-04-21, 15:20:15', 40, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4059, 'O jakimś niespodzianym w ogrodzie spotkaniu,', '2021-04-22, 00:24:44', 24, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4060, 'O jakimś po łopuchach i grzędach stąpaniu,', '2021-04-22, 00:25:04', 64, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4061, 'Tadeusz, wyciągnąwszy co najdłużej uszy,', '2021-04-22, 00:29:21', 65, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4062, 'Połykał gorzkie słowa i przetrawiał w duszy.', '2021-04-22, 00:33:24', 58, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4063, 'Okropną miał biesiadę. Jak w ogrodzie żmija', '2021-04-22, 07:33:38', 30, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4064, 'Dwoistym żądłem zioło zatrute wypija,', '2021-04-22, 07:33:58', 47, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4065, 'Potem skręci się w kłębek i na drodze legnie,', '2021-04-22, 07:35:15', 35, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4066, 'Grożąc stopie, co na nią nieostrożnie biegnie:', '2021-04-22, 07:36:43', 36, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4067, 'Tak Tadeusz, opiły trucizną zazdrości,', '2021-04-22, 07:37:02', 5, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4068, 'Zdawał się obojętny, a pękał ze złości.', '2021-04-22, 07:37:03', 41, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4069, 'W najweselszym zebraniu, niech się kilku gniewa,', '2021-04-22, 07:37:14', 78, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4070, 'Zaraz się ich ponurość na resztę rozlewa:', '2021-04-22, 11:39:36', 45, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4071, 'Strzelcy dawniej milczeli; druga stołu strona', '2021-04-22, 11:39:45', 38, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4072, 'Umilkła, Tadeusza żółcią zarażona.', '2021-04-22, 11:40:59', 40, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4073, 'Nawet pan Podkomorzy nadzwyczaj ponury,', '2021-04-22, 11:43:22', 79, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4074, 'Nie miał ochoty gadać, widząc swoje córy,', '2021-04-22, 11:46:49', 4, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4075, 'Posażne i nadobne panny, w wieku kwiecie,', '2021-04-22, 11:47:09', 13, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4076, 'Zdaniem wszystkich najpierwsze partyje w powiecie,', '2021-04-22, 11:47:37', 75, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4077, 'Milczące, zaniedbane od milczącej młodzi.', '2021-04-22, 11:48:05', 83, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4078, 'Gościnnego Sędziego również to obchodzi;', '2021-04-22, 11:48:12', 91, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4079, 'Wojski zaś, uważając że tak wszyscy milczą,', '2021-04-22, 11:48:24', 45, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4080, 'Nazywał tę wieczerzę nie polską, lecz wilczą.', '2021-04-22, 11:48:40', 23, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4081, 'Hreczecha na milczenie miał słuch bardzo czuły.', '2021-04-22, 11:51:07', 28, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4082, 'Sam gawęda, i lubił niezmiernie gaduły.', '2021-04-22, 11:53:27', 55, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4083, 'Nie dziw! Ze szlachtą strawił życie na biesiadach,', '2021-04-22, 18:54:32', 35, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4084, 'Na polowaniach, zjazdach, sejmikowych radach:', '2021-04-22, 18:55:39', 62, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4085, 'Przywykł, żeby mu zawsze coś bębniło w uchu,', '2021-04-22, 18:55:59', 32, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4086, 'Nawet wtenczas, gdy milczał lub z placką za muchą', '2021-04-23, 00:00:24', 65, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4087, 'Skradał się, lub zamknąwszy oczy siadał marzyć;', '2021-04-23, 00:02:25', 1, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4088, 'W dzień szukał rozmów, w nocy musiano mu gwarzyć', '2021-04-23, 00:03:30', 3, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4089, 'Pacierze różańcowe albo gadać bajki.', '2021-04-23, 00:03:39', 16, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4090, 'Stąd też nieprzyjacielem zabitym był fajki,', '2021-04-23, 00:05:02', 67, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4091, 'Wymyślonej od Niemców, by nas zcudzoziemczyć;', '2021-04-23, 00:07:31', 83, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4092, 'Mawiał: Polskę oniemić, jest to Polskę zniemczyć.', '2021-04-23, 00:07:56', 80, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4093, 'Starzec, wiek przegwarzywszy, chciał spoczywać w gwarze;', '2021-04-23, 00:08:23', 85, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4094, 'Milczenie go budziło ze snu: tak młynarze,', '2021-04-23, 00:08:50', 74, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4095, 'Uśpieni kół turkotem, ledwie staną osie,', '2021-04-23, 00:09:17', 92, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4096, 'Budzą się krzycząc z trwogą: «A słowo stało się…»', '2021-04-23, 01:09:23', 2, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4097, 'Wojski ukłonem dawał znak Podkomorzemu,', '2021-04-23, 01:09:51', 58, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4098, 'A ręką od ust lekko skinął ku Sędziemu,', '2021-04-23, 01:10:08', 64, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4099, 'Prosząc o głos. Panowie na ten ukłon niemy', '2021-04-23, 01:13:23', 20, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4100, 'Odkłonili się oba, co znaczy: prosiemy.', '2021-04-23, 01:13:29', 68, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4101, 'Wojski zagaił.', '2021-04-23, 01:13:31', 14, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4102, '«Śmiałbym upraszać młodzieży,', '2021-04-23, 01:13:40', 90, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4103, 'Ażeby po staremu bawić u wieczerzy,', '2021-04-23, 01:15:09', 68, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4104, 'Nie milczeć i żuć: czy my ojce kapucyni?', '2021-04-23, 01:15:36', 89, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4105, 'Kto milczy między szlachtą, to właśnie tak czyni,', '2021-04-23, 01:15:40', 22, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4106, 'Jako myśliwiec, który nabój rdzawi w strzelbie.', '2021-04-23, 03:20:07', 75, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4107, 'Dlatego ja rozmowność naszych przodków wielbię:', '2021-04-23, 03:20:25', 79, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4108, 'Po łowach szli do stołu, nie tylko by jadać,', '2021-04-23, 03:20:37', 73, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4109, 'Ale aby nawzajem mogli się wygadać,', '2021-04-23, 03:22:56', 46, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4110, 'Co każdy miał na sercu; nagany, pochwały', '2021-04-23, 03:27:13', 64, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4111, 'Strzelców i obławników, ogary, wystrzały', '2021-04-23, 03:31:14', 1, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4112, 'Wywoływano na plac; powstawała wrzawa,', '2021-04-23, 03:31:27', 86, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4113, 'Miła uchu myśliwców jak druga obława.', '2021-04-23, 03:35:41', 16, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4114, 'Wiem, wiem, o co wam idzie. Ta czarnych trosk chmura', '2021-04-23, 03:36:03', 36, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4115, 'Pono z Robakowego wzniosła się kaptura!', '2021-04-23, 03:36:23', 23, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4116, 'Wstydzicie się swych pudeł! Niech was wstyd nie pali:', '2021-04-23, 03:36:34', 41, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4117, 'Znałem myśliwych lepszych od was, a chybiali;', '2021-04-23, 07:36:45', 27, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4118, 'Trafiać, chybiać, poprawiać, to kolej strzelecka.', '2021-04-23, 07:39:03', 76, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4119, 'Ja sam, chociaż ze strzelbą włóczę się od dziecka,', '2021-04-23, 07:43:30', 17, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4120, 'Chybiałem; chybiał sławny ów strzelec Tułoszczyk,', '2021-04-23, 07:43:48', 20, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4121, 'Nawet nie zawsze trafiał pan Rejtan nieboszczyk.', '2021-04-23, 07:44:11', 29, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4122, 'O Rejtanie opowiem później. Co się tycze', '2021-04-23, 07:45:36', 77, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4123, 'Wypuszczenia z obławy, że oba panicze', '2021-04-23, 07:45:37', 5, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4124, 'Zwierzowi jak należy kroku nie dostali,', '2021-04-23, 07:45:45', 73, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4125, 'Choć mieli oszczep w ręku: tego nikt nie chwali', '2021-04-23, 07:45:45', 91, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4126, 'Ani gani. Bo zmykać, mając nabój w rurze,', '2021-04-23, 07:45:55', 42, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4127, 'Znaczyło po staremu być tchórzem nad tchórze;', '2021-04-23, 07:50:03', 92, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4128, 'Toż wystrzelić na oślep (jak to robi wielu),', '2021-04-23, 07:50:18', 9, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4129, 'Nie przypuściwszy źwierza, nie wziąwszy do celu,', '2021-04-23, 07:50:24', 15, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4130, 'Jest rzecz haniebna; ale kto dobrze wymierzy,', '2021-04-23, 07:50:52', 73, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4131, 'Kto przypuści do siebie źwierza jak należy,', '2021-04-23, 08:50:58', 41, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4132, 'Jeśli chybił, cofnąć się może bez sromoty,', '2021-04-23, 08:54:59', 16, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4133, 'Albo walczyć oszczepem — lecz z własnej ochoty,', '2021-04-23, 08:55:59', 11, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4134, 'A nie z musu: gdyż oszczep strzelcom poruczony', '2021-04-23, 09:00:15', 36, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4135, 'Nie dla natarcia, ale tylko dla obrony.', '2021-04-23, 09:00:40', 90, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4136, 'Tak było po staremu. A więc mnie zawierzcie,', '2021-04-23, 09:04:47', 76, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4137, 'I waszej rejterady do serca nie bierzcie,', '2021-04-23, 09:06:13', 15, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4138, 'Kochany Tadeuszku i wielmożny grafie;', '2021-04-23, 15:10:28', 7, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4139, 'Ilekroć zaś wspomnicie o dzisiejszym trafie,', '2021-04-23, 15:13:50', 86, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4140, 'Wspomnijcie też starego Wojskiego przestrogę:', '2021-04-23, 15:14:00', 56, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4141, 'Nigdy jeden drugiemu nie zachodzić w drogę,', '2021-04-23, 15:18:05', 88, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4142, 'Nigdy we dwóch nie strzelać do jednej źwierzyny».', '2021-04-23, 15:18:08', 20, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4143, 'Właśnie Wojski wymawiał to słowo: *źwierzyny*,', '2021-04-23, 15:22:08', 19, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4144, 'Gdy Asesor półgębkiem podszepnął: *dziewczyny*;', '2021-04-23, 15:22:27', 54, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4145, '«Brawo!» krzyknęła młodzież, powstał szmer i śmiechy;', '2021-04-23, 15:22:33', 91, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4146, 'Powtarzano z kolei przestrogę Hreczechy,', '2021-04-23, 15:23:38', 96, 10, false);
