INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4651, 'Stał poważnie, a rad by z radości podskoczył.', '2021-05-09, 02:50:59', 20, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4652, 'Na samą myśl procesu czuł, że się odmłodził:', '2021-05-09, 02:55:04', 35, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4653, 'Wspomniał na dawne lata, gdy z pozwami chodził', '2021-05-09, 02:56:08', 89, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4654, 'Po guzy, ale razem po zapłaty hojne.', '2021-05-09, 11:00:14', 1, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4655, 'Tak żołnierz, który strawił życie tocząc wojnę,', '2021-05-09, 11:02:15', 45, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4656, 'A na starość w szpitalach spoczywa kaleki:', '2021-05-09, 11:02:42', 22, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4657, 'Skoro usłyszy trąbę lub bęben daleki,', '2021-05-09, 11:02:48', 3, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4658, 'Chwyta się z łoża, krzyczy przez sen: «Bij Moskala!»', '2021-05-09, 11:05:05', 19, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4659, 'I na drewnianej nodze skacze ze szpitala,', '2021-05-09, 11:06:32', 35, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4660, 'Tak prędko, że go ledwie może złowić młodzież.', '2021-05-09, 11:06:44', 50, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4661, 'Protazy śpieszył włożyć swą woźnieńską odzież.', '2021-05-09, 11:10:11', 41, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4662, 'Przecież żupana ani kontusza nie kładzie:', '2021-05-09, 11:11:16', 37, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4663, 'One służą ku wielkiej sądowej paradzie;', '2021-05-09, 11:14:36', 93, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4664, 'Na podróż ma strój inny: szerokie rajtuzy', '2021-05-09, 11:16:00', 25, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4665, 'I kurtkę, której poły podpięte na guzy', '2021-05-09, 11:17:21', 37, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4666, 'Można zakasać albo spuścić na kolana;', '2021-05-09, 11:18:33', 9, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4667, 'Czapka z uszami, sznurkiem u wierzchu związana,', '2021-05-09, 16:18:54', 79, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4668, 'Wznosi się na pogodę, spuszcza się przed słotą.', '2021-05-09, 16:20:14', 91, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4669, 'Tak ubrany wziął pałkę i ruszył piechotą;', '2021-05-09, 16:24:36', 22, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4670, 'Bo woźni przed procesem, jak szpiegi przed bojem,', '2021-05-09, 20:27:42', 67, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4671, 'Muszą kryć się pod różną postacią i strojem.', '2021-05-09, 20:31:58', 11, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4672, 'Dobrze zrobił Protazy, że w drogę pośpieszył,', '2021-05-09, 20:32:17', 72, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4673, 'Bo niedługo by swoim pozwem się nacieszył:', '2021-05-09, 20:35:22', 27, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4674, 'W Soplicowie zmieniano kampanii plany.', '2021-05-09, 20:36:34', 20, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4675, 'Do Sędziego wpadł nagle Robak zadumany,', '2021-05-09, 20:38:49', 29, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4676, 'I rzekł: «Sędzio, to bieda nam z tą panią ciotką,', '2021-05-09, 20:41:51', 91, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4677, 'Z tą panią Telimeną, kokietką i trzpiotką!', '2021-05-09, 20:43:13', 89, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4678, 'Kiedy Zosia została dzieckiem w biednym stanie,', '2021-05-09, 20:43:22', 92, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4679, 'Jacek ją Telimenie dał na wychowanie,', '2021-05-10, 00:45:24', 20, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4680, 'Słysząc, że jest osoba dobra, świat znająca:', '2021-05-10, 00:45:28', 56, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4681, 'A postrzegam, że ona coś tu nam zamąca,', '2021-05-10, 00:45:38', 6, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4682, 'Intryguje i pono Tadeuszka wabi:', '2021-05-10, 00:45:59', 75, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4683, 'Śledzę ją; albo może bierze się do Hrabi;', '2021-05-10, 00:47:00', 19, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4684, 'Może do obu razem. Obmyślmy więc środki,', '2021-05-10, 00:47:28', 75, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4685, 'Jak się jej pozbyć: bo stąd mogą urość plotki,', '2021-05-10, 00:48:41', 15, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4686, 'Zły przykład i pomiędzy młokosami zwady,', '2021-05-10, 00:50:44', 31, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4687, 'Które mogą pomieszać twe prawne układy».', '2021-05-10, 00:51:02', 79, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4688, '«Układy? — krzyknął Sędzia z niezwykłym zapałem —', '2021-05-10, 00:51:27', 80, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4689, 'Z układów kwita, już je skończyłem, zerwałem».', '2021-05-10, 00:51:51', 10, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4690, '«A to co? — przerwał Robak — gdzie rozum, gdzie głowa?', '2021-05-10, 00:54:02', 92, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4691, 'Co tu mi wasze bajesz, jaka burda nowa?»', '2021-05-10, 08:58:13', 11, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4692, '«Nie z mej winy — rzekł Sędzia — proces to wyjaśni:', '2021-05-10, 09:00:26', 10, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4693, 'Hrabia pyszałek, głupiec, był przyczyną waśni,', '2021-05-10, 09:04:33', 98, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4694, 'I Gerwazy łotr. Lecz to do sądu należy.', '2021-05-10, 09:04:52', 29, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4695, 'Szkoda, żeś nie był, księże, w zamku na wieczerzy,', '2021-05-10, 09:05:07', 69, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4696, 'Poświadczyłbyś, jak Hrabia srodze mnie obraził».', '2021-05-10, 09:07:32', 14, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4697, '«Po coś waść — krzyknął Robak — do tych ruin łaził?', '2021-05-10, 09:08:37', 73, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4698, 'Wiesz, jak zamku nie cierpię; odtąd moja noga', '2021-05-10, 09:13:02', 41, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4699, 'Tam nie postanie. Znowu kłótnia! kara Boga!', '2021-05-10, 09:13:02', 10, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4700, 'Jakże tam było? powiedz; trzeba tę rzecz zatrzeć.', '2021-05-10, 09:14:05', 2, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4701, 'Już mię znudziło wreszcie na tyle głupstw patrzeć:', '2021-05-10, 11:14:25', 39, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4702, 'Ważniejsze ja mam sprawy niż godzić pieniaczy;', '2021-05-10, 11:14:51', 29, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4703, 'Ale jeszcze raz zgodzę». «Zgodzić? Cóż to znaczy!', '2021-05-10, 11:14:54', 12, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4704, 'A idźże mi waść wreszcie z tą zgodą do licha! —', '2021-05-10, 11:16:11', 28, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4705, 'Przerwał Sędzia, tupnąwszy nogą — patrzcie mnicha!', '2021-05-10, 11:16:35', 62, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4706, 'Że go przyjmuję grzecznie, chce mnie za nos wodzić!', '2021-05-10, 11:17:44', 22, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4707, 'Wiedz wasze, że Soplice nie zwykli się godzić:', '2021-05-10, 11:20:00', 28, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4708, 'Gdy pozwą, muszą wygrać; nieraz w ich imieniu', '2021-05-10, 11:20:22', 54, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4709, 'Trwał proces, aż wygrali w szóstym pokoleniu.', '2021-05-10, 11:20:49', 99, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4710, 'Dosyć zrobiłem głupstwa z porady waszeci,', '2021-05-10, 18:21:04', 11, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4711, 'Zwołując podkomorskie sądy po raz trzeci.', '2021-05-10, 18:24:26', 90, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4712, 'Od dzisiaj nie ma zgody, nie ma, nie ma, nie ma! —', '2021-05-10, 18:24:29', 29, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4713, 'I krzycząc chodził, tupał nogami obiema —', '2021-05-10, 18:28:48', 22, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4714, 'Prócz tego za wczorajszy niegrzeczny uczynek', '2021-05-10, 18:33:15', 84, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4715, 'Musi mnie deprekować, albo pojedynek!»', '2021-05-10, 18:33:29', 7, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4716, '«Ale Sędzio, cóż będzie, jak się Jacek dowie?', '2021-05-10, 18:33:55', 32, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4717, 'Wszak on umrze z rozpaczy! Czyliż Soplicowie', '2021-05-10, 18:34:10', 8, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4718, 'Nie narobili jeszcze w tym zamku dość złego?', '2021-05-10, 18:36:31', 94, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4719, 'Bracie! wspominać nie chcę wypadku strasznego…', '2021-05-11, 03:36:36', 7, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4720, 'Wiesz także, że część gruntów od zamku dziedzica', '2021-05-11, 03:36:59', 15, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4721, 'Zabrała i Soplicom dała Targowica…', '2021-05-11, 03:40:21', 32, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4722, 'Jacek, za grzech żałując, musiał był ślubować', '2021-05-11, 03:40:35', 78, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4723, 'Pod absolucją, dobra te restytuować:', '2021-05-11, 06:40:36', 21, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4724, 'Wziął więc Zosię, Horeszków dziedziczkę ubogą,', '2021-05-11, 06:40:50', 62, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4725, 'Hodować, wychowanie jej opłacał drogo;', '2021-05-11, 06:41:10', 94, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4726, 'Chciał ją Tadeuszkowi swojemu wyswatać', '2021-05-11, 06:44:16', 24, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4727, 'I tak dwa poróżnione domy znowu zbratać,', '2021-05-11, 06:44:41', 97, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4728, 'I dziedziczce bez wstydu ustąpić grabieży…»', '2021-05-11, 06:45:41', 8, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4729, '«Lecz cóż to? — krzyknął Sędzia — co do mnie należy?', '2021-05-11, 06:47:57', 7, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4730, 'Ja się nie znałem, nawet nie widziałem z Jackiem;', '2021-05-11, 06:52:23', 80, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4731, 'Ledwiem słyszał o jego życiu hajdamackiem,', '2021-05-11, 06:53:24', 60, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4732, 'Siedząc wtenczas retorem w jezuickiej szkole,', '2021-05-11, 06:57:33', 48, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4733, 'Potem u Wojewody służąc za pacholę.', '2021-05-11, 11:57:40', 87, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4734, 'Dano mi dobra, wziąłem; kazał przyjąć Zosię,', '2021-05-11, 12:01:08', 8, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4735, 'Przyjąłem, hodowałem, myślę o jej losie:', '2021-05-11, 12:05:14', 72, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4736, 'Dość mnie nudzi ta cała historyja babia!', '2021-05-11, 12:05:16', 89, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4737, 'A potem, czegóż jeszcze wlazł mi tu ten Hrabia?', '2021-05-11, 12:05:23', 17, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4738, 'Z jakim prawem do zamku? Wszak wiesz przyjacielu,', '2021-05-11, 12:09:42', 3, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4739, 'On Horeszkom dziesiąta woda na kisielu!', '2021-05-11, 12:10:45', 17, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4740, 'I ma mnie lżyć? a ja go zapraszać do zgody!»', '2021-05-11, 12:11:04', 8, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4741, '«Bracie! — rzekł ksiądz — ważne są do tego powody.', '2021-05-11, 14:14:32', 13, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4742, 'Pamiętasz, że Jacek chciał do wojska słać syna,', '2021-05-11, 14:14:59', 57, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4743, 'Potem w Litwie zostawił: cóż w tym za przyczyna?', '2021-05-11, 14:18:12', 38, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4744, 'Oto w domu ojczyźnie potrzebniejszy będzie.', '2021-05-11, 14:18:16', 7, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4745, 'Słyszałeś pewnie, o czym już gadają wszędzie,', '2021-05-11, 23:19:23', 25, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4746, 'O czym ja wiadomostki przynosiłem nieraz:', '2021-05-11, 23:19:33', 12, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4747, 'Teraz czas już powiedzieć wszystko, czas już teraz!', '2021-05-11, 23:19:33', 4, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4748, 'Ważne rzeczy, mój bracie! Wojna tuż nad nami!', '2021-05-11, 23:23:50', 2, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4749, 'Wojna o Polskę! bracie! Będziem Polakami!', '2021-05-11, 23:28:00', 5, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4750, 'Wojna niechybna! Kiedy z poselstwem tajemnem', '2021-05-11, 23:30:15', 40, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4751, 'Tu biegłem, wojsk forpoczty już stały nad Niemnem;', '2021-05-11, 23:30:29', 55, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4752, 'Napoleon już zbiera armiję ogromną,', '2021-05-11, 23:30:37', 52, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4753, 'Jakiej człowiek nie widział i dzieje nie pomną;', '2021-05-11, 23:30:38', 78, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4754, 'Obok Francuzów ciągnie polskie wojsko całe,', '2021-05-11, 23:30:55', 30, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4755, 'Nasz Józef, nasz Dąbrowski, nasze orły białe!', '2021-05-11, 23:34:22', 1, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4756, 'Już są w drodze; na pierwszy znak Napoleona', '2021-05-11, 23:37:44', 71, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4757, 'Przejdą Niemen i — bracie! Ojczyzna wskrzeszona!»', '2021-05-11, 23:38:45', 1, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4758, 'Sędzia, słuchając, z wolna okulary składał', '2021-05-11, 23:39:11', 66, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4759, 'I, wpatrując się mocno w księdza, nic nie gadał,', '2021-05-12, 04:41:36', 32, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4760, 'Westchnął głęboko, w oczach łzy się zakręciły…', '2021-05-12, 04:41:48', 73, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4761, 'Wreszcie porwał za szyję księdza z całej siły,', '2021-05-12, 04:42:49', 73, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4762, '«Mój Robaku! — wołając — czy to tylko prawda?', '2021-05-12, 04:43:07', 8, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4763, 'Mój Robaku! — powtarzał — czy to tylko prawda?', '2021-05-12, 04:43:33', 94, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4764, 'Ileż razy zwodzono! Pamiętasz? gadali:', '2021-05-12, 12:43:47', 44, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4765, 'Napoleon już idzie! i my już czekali!', '2021-05-12, 12:43:48', 79, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4766, 'Gadano: już w Koronie, już Prusaka pobił,', '2021-05-12, 12:43:52', 65, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4767, 'Wkracza do nas! A on! co? pokój w Tylży zrobił!', '2021-05-12, 12:44:58', 43, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4768, 'Czy tylko prawda? Czy ty nie zwodzisz sam siebie?»', '2021-05-12, 12:45:59', 99, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4769, '«Prawda — zawołał Robak — jak Pan Bóg na niebie!»', '2021-05-12, 12:49:27', 66, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4770, '«Błogosławioneż niechaj będą usta, które', '2021-05-12, 12:53:34', 37, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4771, 'To zwiastują! — rzekł Sędzia — wznosząc ręce w górę.', '2021-05-12, 12:53:45', 15, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4772, 'Nie pożałujesz twego poselstwa Robaku,', '2021-05-12, 12:53:58', 62, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4773, 'Nie pożałuje klasztor: dwieście owiec z braku', '2021-05-12, 12:58:17', 17, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4774, 'Daję na klasztor. Księże, tyś się wczoraj palił', '2021-05-12, 21:59:34', 78, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4775, 'Do mojego kasztanka i gniadosza chwalił:', '2021-05-12, 22:00:01', 15, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4776, 'Dziś, zaraz w tym kwestarskim wozie pójdą oba;', '2021-05-12, 22:00:25', 7, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4777, 'Dziś proś mnie, o co zechcesz, co ci się podoba,', '2021-05-12, 22:01:37', 58, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4778, 'Nie odmówię!… Lecz o tym interesie całym', '2021-05-12, 22:03:51', 55, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4779, 'Z Hrabią, daj pokój: skrzywdził mnie, już zapozwałem;', '2021-05-12, 22:04:17', 56, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4780, 'Czyż wypada?»', '2021-05-12, 22:04:43', 49, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4781, 'Załamał ręce ksiądz zdziwiony.', '2021-05-12, 22:05:03', 85, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4782, 'Wlepiwszy oczy w Sędzię, ruszywszy ramiony,', '2021-05-12, 22:05:10', 93, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4783, 'Rzekł : «To gdy Napoleon wolność Litwie niesie,', '2021-05-13, 02:06:21', 30, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4784, 'Gdy świat drży cały, to ty myślisz o procesie?', '2021-05-13, 02:06:30', 7, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4785, 'I jeszczeż po tym wszystkim, com tobie powiedział,', '2021-05-13, 04:06:51', 81, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4786, 'Będziesz spokojnie, ręce założywszy, siedział,', '2021-05-13, 04:09:58', 32, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4787, 'Gdy działać trzeba!» «Działać? Cóż?» Sędzia zapytał.', '2021-05-13, 04:10:25', 97, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4788, '«Jeszcześ — rzekł Robak — z oczu moich nie wyczytał?', '2021-05-13, 04:12:44', 84, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4789, 'Jeszcze serce nic tobie nie gada? Ach bracie!', '2021-05-13, 04:12:51', 52, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4790, 'Jeśli Soplicowskiej krwi kroplę w żyłach macie,', '2021-05-13, 04:14:13', 88, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4791, 'Uważ tylko: Francuzi uderzają z przodu…', '2021-05-13, 04:14:20', 27, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4792, 'A gdyby z tyłu zrobić powstanie narodu?', '2021-05-13, 04:14:36', 18, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4793, 'Co myślisz? Niech no Pogoń zarży, niech na Żmudzi', '2021-05-13, 04:14:56', 65, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4794, 'Niedźwiedź ryknie! Ach, gdyby jakie tysiąc ludzi,', '2021-05-13, 04:15:15', 41, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4795, 'Gdyby choć pięćset z tyłu na Moskwę natarło,', '2021-05-13, 12:15:34', 26, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4796, 'Powstanie jako pożar wkoło rozpostarło,', '2021-05-13, 12:16:38', 16, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4797, 'Gdybyśmy my, nabrawszy Moskwie harmat, znaków,', '2021-05-13, 12:20:04', 35, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4798, 'Zwycięzcy szli powitać wybawców rodaków?…', '2021-05-13, 12:24:23', 14, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4799, 'Ciągniemy! Napoleon, widząc nasze lance,', '2021-05-13, 12:24:27', 47, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4800, 'Pyta, co to za wojsko; my krzyczym: »Powstańce,', '2021-05-13, 18:24:40', 41, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4801, 'Najjaśniejszy Cesarzu! Litwa ochotnicy!«', '2021-05-13, 18:24:57', 40, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4802, 'Pyta: pod czyją wodzą? — »Sędziego Soplicy!«', '2021-05-13, 18:25:07', 1, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4803, 'Ach, któż by potem pisnąć śmiał o Targowicy?…', '2021-05-13, 18:26:13', 55, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4804, 'Bracie, póki Ponarom stać, Niemnowi płynąć,', '2021-05-13, 18:26:14', 47, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4805, 'Póty w Litwie Sopliców imieniowi słynąć;', '2021-05-14, 00:26:18', 23, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4806, 'Wnuków, prawnuków będzie Jagiełłów stolica', '2021-05-14, 00:26:36', 34, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4807, 'Wskazywać palcem, mówiąc: oto jest Soplica,', '2021-05-14, 00:26:52', 78, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4808, 'Z tych Sopliców, co pierwsi zrobili powstanie!»', '2021-05-14, 00:30:56', 94, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4809, 'A na to Sędzia: «Mniejsza o ludzkie gadanie;', '2021-05-14, 00:30:56', 76, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4810, 'Nigdy nie dbałem bardzo o pochwały świata:', '2021-05-14, 00:31:12', 72, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4811, 'Bóg świadkiem, żem niewinien grzechów mego brata;', '2021-05-14, 00:31:17', 8, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4812, 'W politykę jam nigdy bardzo się nie wdawał,', '2021-05-14, 00:34:28', 63, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4813, 'Urzędując i orząc mojej ziemi kawał.', '2021-05-14, 00:34:57', 2, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4814, 'Lecz jestem szlachcic, rad bym plamę domu zmazać;', '2021-05-14, 00:35:25', 17, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4815, 'Jestem Polak, dla kraju rad bym coś dokazać,', '2021-05-14, 00:35:33', 45, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4816, 'Choć duszę oddać. W szablę nie byłem zbyt tęgi;', '2021-05-14, 00:35:53', 28, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4817, 'Wszakże, bierali ludzie i ode mnie cięgi,', '2021-05-14, 01:37:11', 3, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4818, 'Wie świat, że w czasie polskich ostatnich sejmików', '2021-05-14, 01:37:17', 66, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4819, 'Wyzwałem i zraniłem dwóch braci Buzwików,', '2021-05-14, 01:40:17', 35, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4820, 'Którzy… Ale to mniejsza. Jakże wasze myśli?', '2021-05-14, 01:44:35', 24, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4821, 'Czy potrzeba, żebyśmy zaraz w pole wyszli?', '2021-05-14, 01:46:47', 13, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4822, 'Strzelców zebrać, rzecz łatwa; prochu mam dostatek;', '2021-05-14, 01:49:51', 88, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4823, 'W plebanii u księdza jest kilka armatek;', '2021-05-14, 01:51:54', 4, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4824, 'Przypominam, iż Jankiel mówił, iż u siebie', '2021-05-14, 01:53:03', 92, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4825, 'Ma groty do lanc, że je mogę wziąć w potrzebie;', '2021-05-14, 01:53:09', 98, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4826, 'Te groty przywiózł w pakach gotowych z Królewca', '2021-05-14, 01:53:26', 38, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4827, 'Pod sekretem; weźmiem je, zaraz zrobim drzewca;', '2021-05-14, 01:53:31', 10, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4828, 'Szabel nam nie zabraknie; szlachta na koń wsiędzie,', '2021-05-14, 01:53:42', 16, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4829, 'Ja z synowcem na czele, i — jakoś to będzie!»', '2021-05-14, 01:55:00', 33, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4830, '«O polska krwi! — zawołał Bernardyn wzruszony,', '2021-05-14, 01:55:24', 45, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4831, 'Z otwartymi skoczywszy na Sędzię ramiony —', '2021-05-14, 01:55:27', 50, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4832, 'Prawe dziecię Sopliców! Tobie Bóg przeznacza', '2021-05-14, 05:55:29', 77, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4833, 'Oczyścić grzechy brata twojego tułacza!', '2021-05-14, 05:55:55', 99, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4834, 'Zawszem ciebie szanował; ale od tej chwili', '2021-05-14, 06:00:10', 29, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4835, 'Kocham cię, jak gdybyśmy bracią sobie byli!…', '2021-05-14, 06:04:31', 46, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4836, 'Przygotujemy wszystko; lecz wyjść nie czas jeszcze:', '2021-05-14, 06:04:48', 5, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4837, 'Ja sam wyznaczę miejsce i czas wam obwieszczę.', '2021-05-14, 06:04:59', 66, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4838, 'Wiem, że car wysiał gońców do Napoleona', '2021-05-14, 06:05:07', 56, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4839, 'Prosić o pokój; wojna nie jest ogłoszona:', '2021-05-14, 06:06:32', 98, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4840, 'Lecz książę Józef słyszał od pana Biniona,', '2021-05-14, 06:09:37', 64, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4841, 'Francuza, co należy do cesarskiej rady,', '2021-05-14, 06:12:05', 85, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4842, 'Że się na niczym skończą wszystkie te układy,', '2021-05-14, 06:12:32', 87, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4843, 'Że będzie wojna. Książę wysłał mnie na zwiady,', '2021-05-14, 06:12:42', 33, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4844, 'Z rozkazem, żeby byli Litwini gotowi', '2021-05-14, 06:12:59', 8, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4845, 'Dowieść przychodzącemu Napoleonowi,', '2021-05-14, 06:13:03', 28, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4846, 'Że chcą złączyć się znowu z siostrą swą, Koroną,', '2021-05-14, 13:13:20', 96, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4847, 'I żądają, ażeby Polskę przywrócono.', '2021-05-14, 13:13:32', 33, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4848, 'Tymczasem, bracie, z Hrabią trzeba przyjść do zgody.', '2021-05-14, 13:14:57', 83, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4849, 'Jest to dziwak, fantastyk trochę, ale młody,', '2021-05-14, 14:17:21', 80, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4850, 'Poczciwy, dobry Polak: potrzebny nam taki.', '2021-05-14, 14:20:29', 82, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4851, 'W rewolucyjach bardzo potrzebne dziwaki:', '2021-05-14, 14:20:35', 23, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4852, 'Wiem z doświadczenia; nawet głupi się przydadzą,', '2021-05-14, 14:25:03', 69, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4853, 'Byle tylko poczciwi i pod mądrych władzą.', '2021-05-14, 14:27:17', 79, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4854, 'Hrabia pan, ma u szlachty wielkie zachowanie,', '2021-05-14, 22:28:31', 36, 6, false);
