INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4858, 'Biegę do niego zaraz…» «Niech się pierwszy zgłosi —', '2021-05-14, 22:30:44', 80, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4859, 'Rzekł Sędzia — niech przyjedzie tu, niech mnie przeprosi;', '2021-05-14, 22:31:03', 97, 13, false);
