INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4869, 'Woźny już dawniej wyszedł ku domowi Hrabi.', '2021-05-15, 06:36:54', 43, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4870, 'Jak lis bywalec, gdy go woń słoniny wabi,', '2021-05-15, 11:37:22', 30, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4871, 'Bieży ku niej, a strzelców zna fortele skryte,', '2021-05-15, 11:37:25', 50, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4872, 'Bieży, staje, przysiada coraz, wznosi kitę', '2021-05-15, 11:37:34', 21, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4873, 'I wiatr nią jak wachlarzem ku swym nozdrzom tuli,', '2021-05-15, 11:41:50', 34, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4874, 'Pyta wiatru, czy strzelcy jadła nie zatruli:', '2021-05-15, 11:42:09', 88, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4875, 'Protazy zeszedł z drogi i wzdłuż sianożęci', '2021-05-15, 11:44:23', 8, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4876, 'Krąży około domu; pałkę w ręku kręci,', '2021-05-15, 11:45:28', 51, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4877, 'Udaje, że obaczył kędyś bydło w szkodzie.', '2021-05-15, 11:48:44', 60, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4878, 'Tak zręcznie lawirując, stanął przy ogrodzie;', '2021-05-15, 11:48:48', 52, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4879, 'Schylił się, bieży, rzekłbyś iż derkacza tropi:', '2021-05-15, 11:49:09', 20, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4880, 'Aż nagle skoczył przez płot i wpadł do konopi.', '2021-05-15, 11:53:25', 9, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4881, 'W tej zielonej, pachnącej i gęstej krzewinie', '2021-05-15, 11:53:48', 38, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4882, 'Koło domu jest pewny przytułek źwierzynie', '2021-05-15, 11:53:52', 41, 4, false);
