INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4931, 'A wtem usłyszał turkot, uczuł serca drżenie,', '2021-05-17, 03:09:52', 13, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (4932, 'Chciał uciec… gdy ode drzwi zaszła mu osoba:', '2021-05-17, 03:10:13', 18, 9, false);
