INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5180, '«Na wieki wieków, amen» starzec odpowiedział,', '2021-05-23, 04:33:55', 61, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5181, 'A gdy się o ważności poselstwa dowiedział,', '2021-05-23, 12:37:09', 25, 19, false);
