INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5193, 'Rada', '2021-05-23, 12:54:59', 99, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5194, 'Zbawienne rady Bartka zwanego Prusak — Głos żołnierski Maćka Chrzciciela — Głos polityczny pana Buchmana — Jankiel radzi ku zgodzie, którą Scyzoryk rozcina — Rzecz Gerwazego, z której okazują się wielkie skutki wymowy sejmowej — Protestacja starego Maćka — Nagłe przybycie posiłków wojennych zrywa naradę — Hejże na Soplicę!', '2021-05-23, 12:55:22', 26, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5195, 'Z kolei Bartek poseł rzecz swą wyprowadzał.', '2021-05-23, 14:56:31', 89, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5196, 'Ten, że często na strugach do Królewca chadzał,', '2021-05-23, 14:58:40', 12, 12, false);
