INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5198, 'Przez żart, bo nienawidził okropnie Prusaków,', '2021-05-23, 21:04:03', 7, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5199, 'Choć lubił o nich gadać. Człek podeszły w lata,', '2021-05-23, 21:04:16', 52, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5200, 'W podróżach swych dalekich wiele zwiedził świata;', '2021-05-23, 21:08:31', 91, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5201, 'Gazet pilny czytelnik, polityki świadom,', '2021-05-23, 21:11:47', 93, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5202, 'W niebytność Maćka zwykle przewodził obradom.', '2021-05-23, 22:13:13', 93, 3, false);
