INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5238, 'Pełzną, ciągną pojazdy, które lud tam zowie', '2021-05-24, 21:59:05', 91, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5239, 'Wageny i fornalki; mężczyźni, kobiety,', '2021-05-24, 21:59:12', 75, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5240, 'Z fajkami, z imbryczkami, wleką pudła, bety;', '2021-05-24, 21:59:17', 24, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5241, 'Drapią jak mogą. A my milczkiem wchodzim w radę:', '2021-05-24, 21:59:26', 47, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5242, 'Hejże na koń, pomieszać Niemcom rejteradę!', '2021-05-24, 21:59:27', 64, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5243, 'Nuż landratom tłuc w karki, z hofratów drzeć schaby,', '2021-05-24, 22:02:48', 15, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5244, 'A herów oficerów łowić za harcaby!', '2021-05-24, 22:02:50', 16, 17, false);
