INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5247, 'W tydzień jeden tak lud nasz Prusaków wychłostał', '2021-05-25, 00:03:39', 71, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5248, 'I wygnał, na lekarstwo Niemca byś nie dostał!', '2021-05-25, 00:03:42', 54, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5249, 'Gdyby się tak obrócić i gracko, i raźnie,', '2021-05-25, 00:05:53', 28, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5250, 'I u nas w Litwie sprawić Moskwie taką łaźnię?', '2021-05-25, 00:05:54', 48, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5251, 'He, co myślisz Macieju? Jeśli z Bonapartem', '2021-05-25, 00:07:17', 93, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5252, 'Moskwa drze koty, to on wojuje nie żartem:', '2021-05-25, 00:08:32', 82, 3, false);
