INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5257, 'Tylko ręką kilkakroć uderzył po boku,', '2021-05-25, 00:11:54', 5, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5258, 'Jak gdyby szabli szukał (od zaboru kraju', '2021-05-25, 00:16:21', 61, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5259, 'Szabli nie nosił; przecież z dawnego zwyczaju,', '2021-05-25, 08:16:29', 8, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5260, 'Na wspomnienie Moskala, zawsze rękę zwracał', '2021-05-25, 08:17:32', 26, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5261, 'Na lewy bok: zapewne Rózeczki swej macał;', '2021-05-25, 08:17:57', 24, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5262, 'I stąd był nazywany powszechnie *Zabokiem*).', '2021-05-25, 08:18:10', 61, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5263, 'Już wzniósł głowę; słuchają w milczeniu głębokiem.', '2021-05-25, 08:18:13', 34, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5264, 'Maciej oczekiwanie powszechne omylił,', '2021-05-25, 08:19:39', 60, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5265, 'Nachmurzył brwi i znowu głowę na pierś schylił.', '2021-05-25, 08:19:44', 92, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5266, 'Na koniec odezwał się, z wolna każde słowo', '2021-05-25, 09:19:54', 35, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5267, 'Wymawiając z przyciskiem, a w takt kiwał głową.', '2021-05-25, 09:24:11', 72, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5268, '«Cicho! skądże ta cała nowina pochodzi?', '2021-05-25, 09:27:38', 14, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5269, 'Jak daleko Francuzi? kto nimi dowodzi?', '2021-05-25, 09:29:56', 64, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5270, 'Czy już wojnę zaczęli z Moskwą? gdzie i o co?', '2021-05-25, 09:34:23', 75, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5271, 'Którędy mają ciągnąć? z jaką idą mocą?', '2021-05-25, 09:34:45', 85, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5272, 'Wiele piechoty, jazdy? Kto wie, niechaj gada!»', '2021-05-25, 09:34:58', 85, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5273, 'Milczała patrząc na się kolejno gromada.', '2021-05-25, 09:38:21', 73, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5274, '«Radziłbym — rzecze Prusak — czekać bernardyna', '2021-05-25, 09:38:29', 86, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5275, 'Robaka, bo od niego pochodzi nowina;', '2021-05-25, 09:41:48', 37, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5276, 'Tymczasem posłać pewnych szpiegów nad granicę,', '2021-05-25, 09:43:01', 37, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5277, 'I po cichu uzbrajać całą okolicę,', '2021-05-25, 09:46:05', 16, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5278, 'A tymczasem ostrożnie całą rzecz prowadzić,', '2021-05-25, 09:46:08', 77, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5279, 'Aby Moskalom naszych zamiarów nie zdradzić».', '2021-05-25, 09:49:19', 80, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5280, '«He! czekać? szczekać? zwlekać?» przerwał Maciej drugi', '2021-05-25, 13:49:39', 59, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5281, 'Ochrzczony Kropicielem, od wielkiej maczugi,', '2021-05-25, 13:51:46', 86, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5282, 'Którą zwał Kropidełkiem. Miał ją dziś przy sobie;', '2021-05-25, 13:52:05', 13, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5283, 'Stanął za nią, na gałce zwiesił ręce obie,', '2021-05-25, 13:52:05', 63, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5284, 'Na ręku oparł brodę, krzycząc: «Czekać! zwlekać!', '2021-05-25, 13:55:32', 36, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5285, 'Sejmikować! Hem, trem, brem, a potem uciekać!', '2021-05-25, 13:59:56', 15, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5286, 'Ja w Prusach nie bywałem; rozum królewiecki', '2021-05-25, 14:00:15', 97, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5287, 'Dobry dla Prus, a u mnie jest rozum szlachecki.', '2021-05-25, 14:00:33', 48, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5288, 'To wiem: że kto chce bić się, niech Kropidło chwyta;', '2021-05-25, 14:04:39', 7, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5289, 'Kto umierać, ten księdza niech woła, i kwita!', '2021-05-25, 14:07:02', 39, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5290, 'Ja chcę żyć, bić! Bernardyn po co? czy my żaki?', '2021-05-25, 14:07:11', 76, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5291, 'Co mi tam Robak: otóż, my będziem robaki,', '2021-05-25, 14:07:19', 46, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5292, 'I dalej Moskwę toczyć! Trem, brem, szpiegi, wzwiady;', '2021-05-26, 00:07:25', 82, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5293, 'Wiecie wy, co to znaczy? Oto, że wy dziady,', '2021-05-26, 00:07:25', 89, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5294, 'Niedołęgi! He, bracia, to wyżła rzecz tropić,', '2021-05-26, 00:08:35', 6, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5295, 'Bernardyńska kwestować, a moja rzecz: kropić;', '2021-05-26, 00:11:52', 58, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5296, 'Kropić, kropić i kwita!» Tu maczugę głasnął,', '2021-05-26, 00:14:58', 3, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5297, 'Za nim cały tłum szlachty «Kropić, kropić!» wrzasnął.', '2021-05-26, 00:15:02', 1, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5298, 'Poparł stronę Chrzciciela, Bartek zwan Brzytewka', '2021-05-26, 00:18:12', 26, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5299, 'Od szabli cienkiej, tudzież Maciej, zwan Konewka', '2021-05-26, 08:18:40', 99, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5300, 'Od sztućca który naszał, z gardłem tak szerokiem,', '2021-05-26, 08:18:47', 93, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5301, 'Że zeń jak z konwi tuzin kulek lał potokiem.', '2021-05-26, 08:23:04', 23, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5302, 'Oba krzyczeli: «Wiwat Chrzciciel z kropidełkiem!»', '2021-05-26, 08:26:13', 21, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5303, 'Prusak chciał mówić, ale zgłuszono go zgiełkiem', '2021-05-26, 08:26:23', 86, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5304, 'I śmiechem; «Precz — wołano — precz Prusaki tchórze!', '2021-05-26, 08:28:34', 51, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5305, 'Kto tchórz, niech w bernardyńskim chowa się kapturze!»', '2021-05-26, 09:28:54', 54, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5306, 'Wtem znowu głowę z wolna podniósł Maciej stary,', '2021-05-26, 09:30:57', 69, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5307, 'I zaczęły cokolwiek uciszać się gwary:', '2021-05-26, 09:35:21', 50, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5308, '«Nie drwijcie — rzekł — z Robaka; znam go, to ćwik klecha,', '2021-05-26, 16:35:45', 86, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5309, 'Ten robaczek większego od was zgryzł orzecha.', '2021-05-26, 16:37:00', 65, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5310, 'Raz go tylko widziałem: ledwiem okiem rzucił,', '2021-05-26, 16:38:00', 33, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5311, 'Poznałem co za ptaszek; ksiądz oczy odwrócił,', '2021-05-26, 16:38:09', 96, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5312, 'Lękając się, żebym go nie zaczął spowiadać;', '2021-05-26, 16:38:35', 5, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5313, 'Ale to rzecz nie moja, wiele o tym gadać!', '2021-05-26, 16:38:36', 36, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5314, 'On tu nie przyjdzie; próżno wzywać bernardyna.', '2021-05-26, 16:38:54', 84, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5315, 'Jeśli od niego wyszła ta cała nowina,', '2021-05-26, 16:43:06', 14, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5316, 'To kto wie, w jakim celu: bo to bies księżyna!', '2021-05-26, 16:43:22', 9, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5317, 'Jeśli prócz tej nowiny nic więcej nie wiecie:', '2021-05-26, 16:43:39', 31, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5318, 'Więc po coście tu przyszli? i czego wy chcecie?»', '2021-05-26, 16:44:06', 55, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5319, '«Wojny!» krzyknęli. — «Jakiej?» spytał. — Zawołali:', '2021-05-26, 16:44:14', 24, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5320, '«Wojny z Moskalem! Bić się! Hejże na Moskali!»', '2021-05-26, 18:47:19', 1, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5321, 'Prusak wciąż wołał, a głos coraz wyżej wznosił;', '2021-05-26, 18:50:22', 68, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5322, 'Aż posłuchanie częścią ukłonem wyprosił,', '2021-05-26, 18:50:38', 37, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5323, 'Częścią zdobył swą mową krzykliwą i cienką.', '2021-05-26, 18:50:54', 30, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5324, '«I ja chcę bić się — wołał tłukąc się w pierś ręką —', '2021-05-26, 18:54:01', 14, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5325, 'Choć kropidła nie noszę, drągiem od wiciny', '2021-05-26, 18:54:29', 24, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5326, 'Sprawiłem raz Prusakom czterem dobre chrzciny,', '2021-05-26, 18:58:48', 34, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5327, 'Którzy mię po pjanemu chcieli w Preglu topić».', '2021-05-26, 18:59:04', 52, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5328, '«Toś zuch Bartku — rzekł Chrzciciel — dobrze! kropić, kropić!»', '2021-05-26, 19:02:17', 38, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5329, '«Ależ, najsłodszy Jezu! trzeba pierwej wiedzieć', '2021-05-26, 19:03:46', 98, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5330, 'Z kim wojna? o co? trzeba to światu powiedzieć —', '2021-05-26, 19:04:57', 11, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5331, 'Wołał Prusak — bo jakże lud ruszy za nami?', '2021-05-26, 19:04:57', 71, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5332, 'Gdzie pójdzie, kiedy gdzie iść, my nie wiemy sami?', '2021-05-26, 19:05:17', 39, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5333, 'Bracia szlachta! Panowie! potrzeba rozsądku!', '2021-05-26, 19:05:37', 59, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5334, 'Dobrodzieje! potrzeba ładu i porządku!', '2021-05-26, 19:09:59', 68, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5335, 'Chcecie wojny, więc zróbmy konfederacyją;', '2021-05-26, 19:14:15', 98, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5336, 'Obmyślmy, gdzie zawiązać i pod laską czyją?', '2021-05-26, 19:15:32', 9, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5337, 'Tak było w Wielkopolszcze: widzim rejteradę', '2021-05-26, 19:15:36', 15, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5338, 'Niemiecką: cóż my robim? wchodzim tajnie w radę,', '2021-05-26, 19:15:42', 33, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5339, 'Uzbrajamy i szlachtę, i włościan gromadę;', '2021-05-27, 03:15:44', 32, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5340, 'Gotowi, Dąbrowskiego czekamy rozkazu;', '2021-05-27, 03:16:10', 66, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5341, 'Na koniec, hejże na koń! powstajem od razu!»', '2021-05-27, 03:16:20', 81, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5342, '«Proszę o głos!» zawołał pan komisarz z Klecka,', '2021-05-27, 03:16:24', 37, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5343, 'Człowiek młody, przystojny, ubrany z niemiecka.', '2021-05-27, 03:16:48', 80, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5344, 'Zwał się Buchman, lecz Polak był, w Polsce się rodził;', '2021-05-27, 03:16:57', 49, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5345, 'Nie wiedzieć pewnie, czyli ze szlachty pochodził,', '2021-05-27, 03:17:10', 98, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5346, 'Lecz o to nie pytano; i wszyscy Buchmana', '2021-05-27, 03:17:29', 36, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5347, 'Szacowali, iż służył u wielkiego pana,', '2021-05-27, 03:19:31', 70, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5348, 'Był dobry patryjota i pełen nauki,', '2021-05-27, 03:19:35', 58, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5349, 'Z ksiąg obcych wyuczył się gospodarstwa sztuki,', '2021-05-27, 03:19:47', 37, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5350, 'I dóbr administracją prowadził porządnie;', '2021-05-27, 03:23:49', 58, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5351, 'O polityce także wnioskował rozsądnie,', '2021-05-27, 03:27:54', 69, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5352, 'Pięknie pisać i gładko umiał się wysławiać.', '2021-05-27, 03:32:13', 13, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5353, 'Zatem umilkli wszyscy, kiedy jął rozprawiać:', '2021-05-27, 03:34:37', 41, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5354, '«Proszę o głos!» powtórzył, po dwakroć odchrząknął,', '2021-05-27, 03:34:38', 72, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5355, 'Ukłonił się i usty dźwięcznymi tak brząknął:', '2021-05-27, 05:35:05', 45, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5356, '«Preopinanci moi w swych głosach wymownych', '2021-05-27, 05:39:15', 41, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5357, 'Dotknęli wszystkich punktów stanowczych i głownych,', '2021-05-27, 05:39:34', 73, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5358, 'Dyskusyją na wyższe wznieśli stanowisko;', '2021-05-27, 05:43:54', 2, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5359, 'Mnie tylko pozostaje, w jedno zjąć ognisko', '2021-05-27, 05:46:18', 45, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5360, 'Rzucone trafne myśli i rozumowania:', '2021-05-27, 05:46:30', 91, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5361, 'Mam nadzieję w ten sposób sprzeczne zgodzić zdania.', '2021-05-27, 10:50:52', 9, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5362, 'Dwie części w dyskusyji całej uważałem;', '2021-05-27, 10:53:57', 59, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5363, 'Podział już jest zrobiony, idę tym podziałem.', '2021-05-27, 10:53:57', 37, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5364, 'Naprzód: dlaczego mamy przedsiębrać powstanie?', '2021-05-27, 10:55:13', 45, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5365, 'W jakim duchu? to pierwsze żywotne pytanie;', '2021-05-27, 10:55:26', 30, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5366, 'Drugie, rewolucyjnej władzy się dotycze:', '2021-05-27, 10:55:31', 29, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5367, 'Podział jest trafny, tylko przewrócić go życzę.', '2021-05-27, 10:56:34', 93, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5368, 'Naprzód zacząć od władzy: skoro pojmiem władzę,', '2021-05-27, 10:57:02', 41, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5369, 'Z niej powstania istotę, duch, cel, wyprowadzę.', '2021-05-27, 10:57:12', 43, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5370, 'Co do władzy więc — kiedy oczyma przebiegam', '2021-05-27, 10:57:15', 27, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5371, 'Dzieje całej ludzkości, i cóż w nich spostrzegam?', '2021-05-27, 19:57:42', 55, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5372, 'Oto, ród ludzki dziki, w lasach rozpierzchniony,', '2021-05-27, 19:58:58', 28, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5373, 'Skupia się, zbiera, łączy dla wspólnej obrony,', '2021-05-27, 19:59:25', 1, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5374, 'Obmyśla ją; i to jest najpierwsza obrada.', '2021-05-27, 20:03:45', 93, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5375, 'Potem każdy wolności własnej cząstkę składa', '2021-05-27, 20:05:55', 82, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5376, 'Dla dobra powszechnego: to pierwsza ustawa,', '2021-05-28, 02:10:02', 15, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5377, 'Z której jako ze źródła płyną wszystkie prawa.', '2021-05-28, 02:11:21', 89, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5378, 'Widzimy tedy, że rząd umową się tworzy,', '2021-05-28, 02:14:27', 44, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5379, 'Nie pochodząc, jak mylnie sądzę, z woli Bożej.', '2021-05-28, 02:14:49', 85, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5380, 'Owoż, rząd na kontrakcie oparłszy społecznym,', '2021-05-28, 02:19:06', 36, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5381, 'Podział władzy już tylko jest skutkiem koniecznym».', '2021-05-28, 02:20:25', 39, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5382, '«Otóż są i kontrakty! Kijowskie czy mińskie? —', '2021-05-28, 02:22:43', 12, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5383, 'Rzekł stary Maciej — owoż i rządy babińskie!', '2021-05-28, 02:23:10', 96, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5384, 'Panie Buchman, czy Bóg nam chciał cara narzucić,', '2021-05-28, 02:26:27', 87, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5385, 'Czy diabeł, ja z waszmością nie będę się kłócić:', '2021-05-28, 09:30:30', 7, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5386, 'Panie Buchman, gadaj Waść, jakby cara zrzucić».', '2021-05-28, 09:31:51', 91, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5387, '«Tu sęk — krzyknął Kropiciel — gdybym mógł podskoczyć', '2021-05-28, 09:32:06', 11, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5388, 'Do tronu i Kropidłem, plusk, raz cara zmoczyć:', '2021-05-28, 09:32:23', 31, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5389, 'To już by on nie wrócił, ni kijowskim traktem,', '2021-05-28, 09:35:49', 63, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5390, 'Ni mińskim, ni za żadnym Buchmana kontraktem;', '2021-05-28, 09:35:51', 48, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5391, 'Aniby go wskrzesili z mocy bożej popi,', '2021-05-28, 09:38:12', 79, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5392, 'Ni z mocy Belzebuba — ten mi zuch, kto kropi.', '2021-05-28, 09:40:25', 82, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5393, 'Panie Buchman, waścina rzecz bardzo wymowna,', '2021-05-28, 09:43:34', 45, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5394, 'Ale wymowa szum, drum: kropić! to rzecz główna».', '2021-05-28, 09:43:37', 67, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5395, '«To, to, to!» pisnął, ręce trąc, Bartek Brzytewka,', '2021-05-28, 09:47:02', 96, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5396, 'Od Chrzciciela do Maćka biegając jak cewka', '2021-05-28, 09:51:20', 37, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5397, 'Od jednej strony krosien przerzucana w drugą:', '2021-05-28, 09:51:20', 43, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5398, '«Tylko ty, Maćku z Rózgą, ty, Maćku z maczugą;', '2021-05-28, 09:51:35', 41, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5399, 'Tylko zgódźcie się: dalbóg, pobijem na druzgi', '2021-05-28, 09:51:50', 10, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5400, 'Moskala; Brzytew idzie pod komendę Rózgi».', '2021-05-28, 09:52:16', 38, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5401, '«Komenda — przerwał Chrzciciel — dobra ku paradzie;', '2021-05-28, 09:52:26', 89, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5402, 'U nas była komenda w kowieńskiej brygadzie', '2021-05-28, 09:54:45', 14, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5403, 'Krótka a węzłowata: strasz, sam się nie strachaj;', '2021-05-28, 09:55:05', 65, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5404, 'Bij, nie daj się; postępuj często, gęsto machaj:', '2021-05-28, 09:55:31', 86, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5405, 'Szach, mach!» «To — pisnął Brzytwa — to mi regulament!', '2021-05-28, 14:57:33', 79, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5406, 'Po co tu pisać akta, po co psuć atrament?', '2021-05-28, 14:57:58', 95, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5407, 'Konfederacji trzeba? o to cała sprzeczka?', '2021-05-28, 14:58:10', 14, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5408, 'Jest Marszałek nasz Maciej, a laska Rózeczka».', '2021-05-28, 15:00:19', 59, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5409, '«Niech żyje — krzyknął Chrzciciel — Kurek na Kościele!»', '2021-05-28, 16:00:34', 48, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5410, 'Szlachta odpowiedziała. «Wiwant Kropiciele!»', '2021-05-28, 16:04:55', 93, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5411, 'Ale w kątach szmer powstał, choć w środku tłumiony;', '2021-05-28, 16:05:23', 88, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5412, 'Widać, że się rozdziela rada na dwie strony.', '2021-05-28, 16:09:25', 60, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5413, 'Buchman krzyknął: «Ja zgody nigdy nie pochwalam!', '2021-05-28, 16:13:42', 95, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5414, 'To mój system!» Ktoś drugi wrzasnął: «Nie pozwalam!»', '2021-05-28, 16:13:47', 44, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5415, 'Inni z kątów wtórują. Nareszcie głos gruby', '2021-05-28, 16:17:58', 52, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5416, 'Ozwał się przybyłego szlachcica Skołuby:', '2021-05-28, 16:19:01', 35, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5417, '«Cóż to, Państwo Dobrzyńscy! A to co się święci?', '2021-05-28, 22:21:09', 57, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5418, 'A my, czy to będziemy z pod prawa wyjęci?', '2021-05-28, 22:21:21', 33, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5419, 'Kiedy nas zapraszano z naszego zaścianku,', '2021-05-28, 22:25:45', 88, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5420, 'A zapraszał nas klucznik Rębajło Mopanku,', '2021-05-28, 22:27:48', 34, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5421, 'Mówiono nam, że wielkie rzeczy dziać się miały,', '2021-05-28, 22:28:10', 4, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5422, 'Że tu nie o Dobrzyńskich, lecz o powiat cały,', '2021-05-28, 22:28:22', 18, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5423, 'O całą szlachtę idzie; toż i Robak bąkał,', '2021-05-28, 22:28:26', 75, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5424, 'Choć nigdy nie dokończył i zawsze się jąkał,', '2021-05-28, 22:28:27', 13, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5425, 'I ciemno się tłumaczył. Wreszcie, koniec końców,', '2021-05-29, 06:30:35', 43, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5426, 'My zjechali, sąsiadów zwołali przez gońców.', '2021-05-29, 06:34:41', 10, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5427, 'Nie sami tu panowie Dobrzyńscy jesteście;', '2021-05-29, 06:39:01', 53, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5428, 'Z różnych innych zaścianków jest tu nas ze dwieście:', '2021-05-29, 06:39:10', 26, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5429, 'Wszyscy więc radźmy. Jeśli potrzeba marszałka,', '2021-05-29, 06:43:19', 10, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5430, 'Głosujmy wszyscy; równa u każdego gałka.', '2021-05-29, 06:43:36', 56, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5431, 'Niech żyje równość!»', '2021-05-29, 06:44:01', 59, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5432, 'Zatem dwaj Terajewicze', '2021-05-29, 06:45:25', 78, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5433, 'I czterej Stypułkowscy i trzej Mickiewicze,', '2021-05-29, 06:45:53', 4, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5434, 'Krzyknęli: «Wiwat równość!» stając za Skołubą.', '2021-05-29, 06:45:54', 64, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5435, 'Tymczasem Buchman wołał: «Zgoda będzie zgubą!»', '2021-05-29, 06:46:23', 12, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5436, 'Kropiciel krzyczał: «Bez was obejdziem się sami;', '2021-05-29, 06:50:50', 59, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5437, 'Niech żyje nasz marszałek, Maciek nad Maćkami!', '2021-05-29, 06:51:09', 70, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5438, 'Hej do laski!» Dobrzyńscy krzyczą: «Zapraszamy!»', '2021-05-29, 06:55:10', 4, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5439, 'A obca szlachta woła w głos: «Nie pozwalamy!»', '2021-05-29, 06:56:29', 29, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5440, 'Rozstrycha się tłum na dwie kupy rozdzielony,', '2021-05-29, 08:58:37', 89, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5441, 'I kiwając głowami w dwie przeciwne strony,', '2021-05-29, 08:58:55', 6, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5442, 'Tamci: «Nie pozwalamy!» — ci krzyczą: «Prosiemy!»', '2021-05-29, 09:00:19', 73, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5443, 'Maciek stary w pośrodku jeden siedział niemy,', '2021-05-29, 09:00:32', 9, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5444, 'I jedna głowa jego była nieruchoma.', '2021-05-29, 09:02:58', 66, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5445, 'Przeciw niemu stał Chrzciciel zwieszony rękoma', '2021-05-29, 09:04:08', 78, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5446, 'Na maczudze, a głową na końcu maczugi', '2021-05-29, 15:04:26', 36, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5447, 'Wspartą kręcił, jak tykwą wbitą, na kij długi,', '2021-05-29, 15:04:47', 18, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5448, 'I na przemiany to w tył, to się naprzód kiwał,', '2021-05-29, 15:05:15', 72, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5449, 'I ustawicznie «Kropić, kropić!» wykrzykiwał.', '2021-05-29, 15:09:21', 40, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5450, 'Wzdłuż izby zaś przebiegał Brzytewka ruchawy', '2021-05-29, 15:10:34', 38, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5451, 'Ciągle od Kropiciela do Macieja ławy.', '2021-05-29, 15:11:44', 75, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5452, 'Konewka zaś powoli wszerz izbę przechodził', '2021-05-29, 15:12:03', 32, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5453, 'Od Dobrzyńskich do szlachty: niby to ich godził;', '2021-05-29, 15:13:21', 16, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5454, 'Jeden wciąż wołał «Golić» a drugi «Zalewać!»', '2021-05-29, 15:13:43', 91, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5455, 'Maciek milczał; lecz widno, że się zaczął gniewać./', '2021-05-29, 19:16:50', 48, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5456, 'Ćwierć godziny wrzał hałas, gdy nad tłum wrzeszczący,', '2021-05-29, 19:17:55', 29, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5457, 'Ze środka głów, wyskoczył w góre słup błyszczący:', '2021-05-29, 19:19:56', 91, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5458, 'Był to rapier sążnistej długości, szeroki', '2021-05-29, 19:20:11', 92, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5459, 'Na całą piędź, a sieczny na obadwa boki,', '2021-05-29, 21:23:36', 10, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5460, 'Widocznie miecz teutoński z norymberskiej stali', '2021-05-29, 21:23:59', 95, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5461, 'Ukuty: wszyscy milcząc na broń poglądali.', '2021-05-29, 21:24:07', 9, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5462, 'Kto ją podniósł? nie widać; lecz zaraz zgadniono:', '2021-05-29, 21:26:21', 68, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5463, '«To Scyzoryk! niech żyje Scyzoryk! — krzykniono —', '2021-05-30, 02:26:39', 42, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5464, 'Wiwat Scyzoryk, klejnot Rębajłów zaścianku!', '2021-05-30, 02:27:08', 4, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5465, 'Wiwat Rębajło, Szczerbiec, Półkozic, Mopanku!»', '2021-05-30, 02:27:37', 34, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5466, 'Wnet Gerwazy (to on był) przez tłum się przecisnął', '2021-05-30, 02:31:05', 64, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5467, 'Na środek izby, wkoło Scyzorykiem błysnął;', '2021-05-30, 02:31:17', 47, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5468, 'Potem w dół chyląc ostrze na znak powitania', '2021-05-30, 02:31:20', 22, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5469, 'Przed Maćkiem, rzekł: «Rózeczce Scyzoryk się kłania.', '2021-05-30, 10:35:46', 63, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5470, 'Bracia szlachta, Dobrzyńscy! Ja nie będę radził', '2021-05-30, 10:36:05', 90, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5471, 'Nic a nic; powiem tylko, po com was zgromadził:', '2021-05-30, 10:36:17', 99, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5472, 'A co robić, jak robić, decydujcie sami.', '2021-05-30, 11:38:25', 14, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5473, 'Wiecie, słuch dawno chodzi między zaściankami,', '2021-05-30, 11:38:34', 50, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5474, 'Że się na wielkie rzeczy zanosi na świecie;', '2021-05-30, 11:40:34', 59, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5475, 'Ksiądz Robak o tym gadał: wszakże wszyscy wiecie?»', '2021-05-30, 11:40:41', 86, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5476, '«Wiemy!» krzyknęli — «Dobrze. Owoż mądrej głowie —', '2021-05-30, 11:40:49', 59, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5477, 'Ciągnął mówca, spojrzawszy bystro — dość dwie słowie.', '2021-05-30, 11:41:01', 56, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5478, 'Nieprawdaż?» «Prawda» rzekli. «Gdy cesarz francuski —', '2021-05-30, 11:44:03', 93, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5479, 'Rzekł Klucznik — stąd przyciąga, a stamtąd car ruski:', '2021-05-30, 11:47:18', 49, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5480, 'Więc wojna; car z cesarzem, królowie z królami', '2021-05-30, 11:51:36', 55, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5481, 'Pójdą za łby, jak zwykle między monarchami.', '2021-05-30, 11:54:01', 20, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5482, 'A nam czy siedzieć cicho? Gdy wielki wielkiego', '2021-05-30, 11:54:14', 25, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5483, 'Będzie dusić: my duśmy mniejszych, każdy swego.', '2021-05-30, 11:54:28', 40, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5484, 'Z góry i z dołu, wielcy wielkich, małych mali,', '2021-05-30, 11:56:36', 67, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5485, 'Jak zaczniem ciąć, tak całe szelmostwo się zwali,', '2021-05-30, 11:56:52', 50, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5486, 'I tak zakwitnie szczęście i Rzeczpospolita.', '2021-05-30, 19:59:09', 88, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5487, 'Nieprawdaż?» «Prawda — rzekli — jakby z książki czyta».', '2021-05-30, 20:02:24', 28, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5488, '«Prawda — powtórzył Chrzciciel — krop a krop i kwita».', '2021-05-30, 20:05:31', 77, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5489, '«Ja zawsze gotów golić» ozwał się Brzytewka;', '2021-05-30, 20:08:31', 49, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5490, '«Tylko zgódźcie się — prosił uprzejmie Konewka —', '2021-05-30, 20:11:57', 1, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5491, 'Chrzcicielu i Macieju, pod czyją iść wodzą?»', '2021-05-30, 20:12:15', 2, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5492, 'Ale mu przerwał Buchman: «Niech się głupi godzą,', '2021-05-30, 20:12:24', 75, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5493, 'Dyskusyje publicznej sprawie nie zaszkodzą.', '2021-05-30, 20:12:30', 25, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5494, 'Proszę milczeć, słuchamy, sprawa na tym zyska;', '2021-05-30, 20:12:40', 9, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5495, 'Pan Klucznik ją z nowego zważa stanowiska».', '2021-05-30, 20:12:48', 67, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5496, '«Owszem — zawołał Klucznik — u mnie po staremu,', '2021-05-30, 20:16:57', 14, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5497, 'O wielkich rzeczach myśleć należy wielkiemu:', '2021-05-31, 04:17:27', 78, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5498, 'Jest na to cesarz, będzie król, senat, posłowie.', '2021-05-31, 04:17:30', 31, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5499, 'Takie rzeczy, mopanku, robią się w Krakowie', '2021-05-31, 04:17:59', 63, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5500, 'Lub w Warszawie, nie u nas, w zaścianku, w Dobrzynie;', '2021-05-31, 04:18:18', 33, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5501, 'Aktów konfederackich nie piszą w kominie', '2021-05-31, 04:20:44', 31, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5502, 'Kredą, nie na wicinie, lecz na pergaminie.', '2021-05-31, 04:20:53', 94, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5503, 'Nie nam to pisać akta; ma Polska pisarzy', '2021-05-31, 04:22:06', 18, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5504, 'Koronnych i litewskich, tak robili starzy;', '2021-05-31, 12:22:08', 87, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5505, 'Moja rzecz Scyzorykiem wyrzynać». «Kropidłem', '2021-05-31, 12:22:31', 80, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5506, 'Pluskać» dodał Kropiciel. «I wykalać Szydłem»', '2021-05-31, 12:25:44', 10, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5507, 'Krzyknął Bartek Szydełko, dobywszy swej szpadki.', '2021-05-31, 12:29:44', 66, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5508, '«Wszystkich was — kończył Klucznik — biorę tu na świadki,', '2021-05-31, 12:30:00', 5, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5509, 'Czy Robak nie powiadał, że wprzód nim przyjmiecie', '2021-05-31, 12:31:29', 29, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5510, 'W dom wasz Napoleona, trzeba wymieść śmiecie?', '2021-05-31, 12:35:58', 56, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5511, 'Słyszeliście to wszyscy: a czy rozumiecie?', '2021-05-31, 12:37:02', 57, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5512, 'Któż jest śmieciem powiatu? Kto zdradziecko zabił', '2021-05-31, 12:37:02', 44, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5513, 'Najlepszego z Polaków, kto go okradł, zgrabił?', '2021-05-31, 15:37:24', 84, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5514, 'I jeszcze chce ostatki wydrzeć z rąk dziedzica?', '2021-05-31, 15:37:31', 77, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5515, 'Któż to? Mamże wam gadać?» «A już ci Soplica —', '2021-05-31, 15:37:53', 21, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5516, 'Przerwał Konewka — to łotr» «Oj, to ciemiężyciel»', '2021-05-31, 15:38:09', 26, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5517, 'Pisnął Brzytewka — «Więc go kropić!» dodał Chrzciciel;', '2021-05-31, 15:39:32', 89, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5518, '«Jeśli zdrajca — rzekł Buchman — więc na szubienicę!»', '2021-05-31, 15:43:34', 13, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5519, '«Hejże! — krzyknęli wszyscy — hejże na Soplicę!»', '2021-05-31, 15:45:50', 4, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5520, 'Lecz Prusak śmiał podjąć się Sędziego obrony,', '2021-05-31, 15:48:04', 1, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5521, 'I wołał z wzniesionymi ku szlachcie ramiony:', '2021-05-31, 15:51:05', 58, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5522, '«Panowie Bracia! aj! aj! a na boskie rany!', '2021-05-31, 15:51:32', 53, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5523, 'Co znowu? Panie Klucznik, czy waść opętany?', '2021-05-31, 22:51:38', 13, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5524, 'Czy o tym była mowa? Że ktoś miał wariata', '2021-05-31, 22:55:49', 84, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5525, 'Banitę bratem: to co, karać go za brata?', '2021-05-31, 22:55:50', 77, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5526, 'To mi po chrześcijańsku! Są tu w tym konszachty', '2021-05-31, 22:55:53', 49, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5527, 'Hrabiego; żeby Sędzia był ciężki dla szlachty,', '2021-05-31, 22:56:08', 16, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5528, 'Nieprawda! dalibógże! To wy tylko sami', '2021-05-31, 22:56:26', 71, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5529, 'Pozywacie go, a on zgody szuka z wami,', '2021-05-31, 22:57:28', 53, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5530, 'Ustępuje ze swego, jeszcze grzywny płaci.', '2021-06-01, 07:57:39', 40, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5531, 'Ma proces z Hrabią: cóż stąd? obadwa bogaci;', '2021-06-01, 14:57:43', 50, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5532, 'Niechaj pan drze się z panem: cóż to do nas, braci?', '2021-06-01, 15:01:57', 98, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5533, 'Pan Sędzia ciemiężyciel! On pierwszy zabraniał,', '2021-06-01, 15:03:25', 38, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5534, 'Ażeby się chłop przed nim do ziemi nie kłaniał,', '2021-06-01, 15:05:37', 46, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5535, 'Mówiąc, że to grzech. Nieraz u niego gromada', '2021-06-01, 15:05:47', 62, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5536, 'Chłopska, ja sam widziałem, do stołu z nim siada;', '2021-06-01, 15:06:11', 51, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5537, 'Płacił za włość podatki: a nie tak jest w Klecku,', '2021-06-01, 15:06:31', 34, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5538, 'Choć tam waść, panie Buchman, rządzisz po niemiecku.', '2021-06-01, 15:08:52', 76, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5539, 'Sędzia zdrajca! My się z nim od infimy znamy:', '2021-06-01, 15:09:08', 78, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5540, 'Poczciwe było dziecko i dziś taki samy;', '2021-06-01, 15:09:37', 16, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5541, 'Polskę kocha nad wszystko, polskie obyczaje', '2021-06-01, 15:10:04', 13, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5542, 'Chowa, modom moskiewskim przystępu nie daje.', '2021-06-01, 15:10:06', 71, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5543, 'Ilekroć z Prus powracam, chcąc zmyć się z niemczyzny,', '2021-06-01, 15:12:13', 71, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5544, 'Wpadam do Soplicowa jak w centrum polszczyzny;', '2021-06-01, 15:12:21', 57, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5545, 'Tam się człowiek napije, nadysze ojczyzny!', '2021-06-01, 22:12:22', 99, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5546, 'Dalbóg Dobrzyńscy! ja wasz brat, ale Sędziego', '2021-06-01, 22:13:41', 1, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5547, 'Nie pozwolę pokrzywdzić; nie będzie nic z tego.', '2021-06-01, 22:13:56', 32, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5548, 'Nie tak, panowie bracia, w Wielkopolszcze było:', '2021-06-01, 22:14:21', 53, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5549, 'Co za duch! co za zgoda! aż przypomnieć miło!', '2021-06-01, 22:14:21', 27, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5550, 'Nikt tam podobną fraszką nie śmiał rady mieszać».', '2021-06-01, 22:14:43', 86, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5551, '«To nie fraszka — zawołał Klucznik — łotrów wieszać!»', '2021-06-01, 22:18:55', 76, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5552, 'Szmer wzmagał się. Wtem Jankiel posłuchania prosił,', '2021-06-01, 22:23:19', 22, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5553, 'Na ławę wskoczył, stanął i nad głowy wznosił', '2021-06-02, 11:25:24', 30, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5554, 'Brodę jak wiechę, co mu aż do pasa wisi.', '2021-06-02, 11:25:48', 88, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5555, 'Prawą ręką zdjął z wolna z głowy kołpak lisi;', '2021-06-02, 11:26:59', 51, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5556, 'Lewą ręką jarmułkę zruszoną poprawił,', '2021-06-02, 11:30:09', 15, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5557, 'Potem lewicę za pas zatknął i tak prawił,', '2021-06-02, 11:30:13', 98, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5558, 'Kołpakiem lisim w kolej kłaniając się nisko:', '2021-06-02, 11:30:40', 2, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5559, '«Nu, panowie Dobrzyńscy! Ja sobie Żydzisko;', '2021-06-02, 11:34:52', 48, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5560, 'Mnie Sędzia ni brat, ni swat; szanuję Sopliców', '2021-06-02, 11:37:00', 10, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5561, 'Jak panów bardzo dobrych i moich dziedziców;', '2021-06-02, 11:41:00', 13, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5562, 'Szanuję też Dobrzyńskich, Bartków i Maciejów,', '2021-06-02, 11:41:04', 77, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5563, 'Jako dobrych sąsiadów, panów dobrodziejów;', '2021-06-02, 20:43:11', 84, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5564, 'A mówię tak: jeżeli państwo chcą gwałt zrobić', '2021-06-02, 20:43:11', 91, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5565, 'Sędziemu, to bardzo źle. Możecie się pobić,', '2021-06-02, 20:43:38', 16, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5566, 'Zabić — a asesory? a sprawnik? a turma?', '2021-06-02, 20:43:55', 69, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5567, 'Bo w wiosce u Soplicy jest żołnierzy hurma,', '2021-06-02, 20:48:10', 90, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5568, 'Wszystko jegry! Asesor w domu: tylko świśnie,', '2021-06-02, 20:49:28', 7, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5569, 'Tak wraz przymaszerują, stoją jak umyślnie.', '2021-06-02, 20:50:34', 92, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5570, 'A co będzie? A jeśli czekacie Francuza,', '2021-06-02, 20:50:36', 18, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5571, 'To Francuz jest daleko jeszcze, droga duża.', '2021-06-02, 20:53:54', 92, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5572, 'Ja Żyd, o wojnach nie wiem, a byłem w Bielicy,', '2021-06-02, 20:53:54', 30, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5573, 'I widziałem tam Żydków od samej granicy;', '2021-06-02, 20:57:59', 82, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5574, 'Słychać, że Francuz stoi nad rzeką Łososną,', '2021-06-02, 20:58:04', 3, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5575, 'A wojna jeśli będzie, to chyba aż wiosną.', '2021-06-02, 20:58:09', 45, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5576, 'Nu, mówię tak: czekajcie; wszak dwór Soplicowa', '2021-06-02, 20:59:29', 95, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5577, 'Nie budka kramna, co się rozbierze, w wóz schowa', '2021-06-02, 21:59:53', 48, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5578, 'I pojedzie: dwór jak stał, do wiosny stać będzie;', '2021-06-02, 22:00:21', 6, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5579, 'A pan Sędzia, to nie jest Żydek na arendzie:', '2021-06-02, 22:00:43', 33, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5580, 'Nie uciecze, to jego można znaleźć wiosną.', '2021-06-02, 22:00:58', 5, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5581, 'A teraz rozejdźcie się, a nie gadać głośno', '2021-06-02, 22:01:10', 80, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5582, 'O tym, co było; bo to gadać, to daremno!', '2021-06-02, 22:05:39', 97, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5583, 'A czyja łaska panów Szlachty, proszę ze mną.', '2021-06-02, 22:05:43', 7, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5584, 'Moja Siora powiła małego Jankielka:', '2021-06-03, 03:09:59', 23, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5585, 'Ja dziś traktuję wszystkich, a muzyka wielka!', '2021-06-03, 03:13:02', 55, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5586, 'Każę przynieść kozice, basetlę, dwie skrzypiec,', '2021-06-03, 03:13:09', 24, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5587, 'A pan Maciek Dobrodziej lubi stary lipiec', '2021-06-03, 03:13:32', 76, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5588, 'I nowego mazurka: mam nowe mazurki,', '2021-06-03, 03:14:01', 5, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5589, 'A wyuczyłem śpiewać fein moje bachurki».', '2021-06-03, 03:16:25', 66, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5590, 'Wymowa lubionego powszechnie Jankiela', '2021-06-03, 03:18:40', 83, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5591, 'Trafiała do serc. Powstał krzyk, oklask wesela,', '2021-06-03, 03:22:55', 51, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5592, 'Szmer przyzwolenia nawet za domem się szerzył:', '2021-06-03, 03:26:04', 3, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5593, 'Gdy Gerwazy w Jankiela Scyzorykiem zmierzył.', '2021-06-03, 03:26:04', 98, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5594, 'Żyd skoczył, wpadł w tłum; Klucznik wołał: «Precz stąd, Żydzie!', '2021-06-03, 03:30:26', 16, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5595, 'Nie tkaj palców między drzwi, nie o ciebie idzie!', '2021-06-03, 07:30:43', 98, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5596, 'Panie Prusak! że waszeć Sędziowską handlujesz', '2021-06-03, 07:30:57', 50, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5597, 'Parą wicin mizernych: to już zań gardłujesz?', '2021-06-03, 07:31:19', 73, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5598, 'Zapomniałeś mopanku, że ojciec waszecin', '2021-06-03, 07:31:47', 70, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5599, 'Spławiał do Prus dwadzieścia Horeszkowskich wicin?', '2021-06-03, 07:32:05', 46, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5600, 'Stąd się zbogacił i on, i jego rodzina,', '2021-06-03, 07:34:30', 80, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5601, 'Ba, nawet wszyscy, ilu was tu jest z Dobrzyna.', '2021-06-03, 07:34:37', 66, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5602, 'Bo pamiętacie starzy, słyszeliście młodzi,', '2021-06-03, 07:39:03', 18, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5603, 'Że Stolnik był was wszystkich ojciec i dobrodziéj:', '2021-06-03, 07:39:08', 59, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5604, 'Kogoż on komisarzem słał do swych dóbr pińskich?', '2021-06-03, 07:39:12', 76, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5605, 'Dobrzyńskiego! Rachmistrzów kogo miał? Dobrzyńskich!', '2021-06-03, 07:40:28', 59, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5606, 'Marszałkostwa, kredensu nie zwierzał nikomu,', '2021-06-03, 07:41:47', 78, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5607, 'Tylko Dobrzyńskim: pełno Dobrzyńskich miał w domu!', '2021-06-03, 07:42:47', 82, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5608, 'On forytował wasze w trybunałach sprawy,', '2021-06-03, 07:46:56', 77, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5609, 'On wyrabiał u króla dla was chleb łaskawy,', '2021-06-03, 07:47:04', 77, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5610, 'Dzieci wasze kopami pomieszczał w konwikcie', '2021-06-03, 07:48:08', 5, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5611, 'Pijarskim, na swym koszcie, odzieży i wikcie;', '2021-06-03, 07:51:21', 78, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5612, 'Dorosłych promowował także swym nakładem:', '2021-06-03, 07:51:41', 92, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5613, 'A dlaczego to robił? że wam był sąsiadem!', '2021-06-03, 07:53:42', 8, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5614, 'Dziś Soplica kopcami tyka waszych granic:', '2021-06-03, 07:54:00', 91, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5615, 'Cóż kiedy wam dobrego zrobił on?»', '2021-06-03, 07:54:19', 16, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5616, '«Nic a nic! —', '2021-06-03, 16:54:42', 88, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5617, 'Przerwał Konewka — bo to wyrosło z szlachciury,', '2021-06-03, 16:56:03', 38, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5618, 'A jak dmie się, phu, phu, phu, jak nos drze do góry!', '2021-06-03, 16:56:21', 10, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5619, 'Pamiętacie, prosiłem na córki wesele;', '2021-06-03, 16:59:40', 38, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5620, 'Poję, nie chce pić, mówi: »Nie piję tak wiele', '2021-06-03, 17:04:06', 52, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5621, 'Jak wy szlachta; wy szlachta ciągniecie jak bąki«.', '2021-06-03, 17:06:35', 9, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5622, 'Ot magnat! delikacik z marymonckiej mąki!', '2021-06-03, 17:09:41', 75, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5623, 'Nie pił; leliśmy w gardło, krzyczał: »Gwałt się dzieje!«', '2021-06-03, 17:09:48', 64, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5624, 'Czekajno, niech no ja mu z Konewki naleję».', '2021-06-03, 20:12:14', 91, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5625, '«Filut — zawołał Chrzciciel — oj, i ja go kropnę', '2021-06-03, 20:12:26', 22, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5626, 'Za swoje. Mój syn, było to dziecko roztropne,', '2021-06-03, 20:14:38', 46, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5627, 'Teraz tak zgłupiał, że go nazywają Sakiem;', '2021-06-03, 20:14:58', 33, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5628, 'A z przyczyny Sędziego został głupcem takim.', '2021-06-04, 00:15:14', 57, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5629, 'Mówiłem: po co tobie leźć do Soplicowa?', '2021-06-04, 00:15:20', 94, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5630, 'Jeżeli cię tam złowię, niech cię Bóg uchowa!', '2021-06-04, 00:16:28', 15, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5631, 'On znowu smyk do Zosi, dybie przez konopie:', '2021-06-04, 00:19:34', 16, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5632, 'Złowiłem go, a zatem za uszy i kropię;', '2021-06-04, 07:21:43', 11, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5633, 'A on beczy i beczy jak maleńkie chłopię:', '2021-06-04, 10:21:44', 43, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5634, '»Ojcze, choć zabij, muszę tam iść«, a wciąż szlocha —', '2021-06-04, 10:21:57', 78, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5635, '»Co tobie?« a on mówi, że tę Zosię kocha!', '2021-06-04, 10:22:59', 63, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5636, 'Chciałby popatrzyć na nią! Żal mi nieboraka,', '2021-06-04, 10:23:22', 75, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5637, 'Mówię Sędziemu: »Sędzio, daj Zosię dla Saka!«', '2021-06-04, 10:27:30', 94, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5638, 'On mówi: »Jeszcze mała, czekaj ze trzy lata,', '2021-06-04, 10:31:38', 92, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5639, 'Jak sama zechce«. Łotr! łże, już ją komuś swata:', '2021-06-04, 10:32:57', 86, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5640, 'Słyszałem. Już ja się tam na wesele wkręcę;', '2021-06-04, 10:33:25', 59, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5641, 'Ja im łoże małżeńskie kropidłem poświęcę».', '2021-06-04, 10:35:32', 13, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5642, '«I taki łotr — zawołał Klucznik — ma panować?', '2021-06-04, 10:39:01', 56, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5643, 'I dawnych panów, lepszych od siebie, rujnować?', '2021-06-04, 10:42:23', 66, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5644, 'A Horeszków i pamięć i imię zaginie!', '2021-06-04, 10:42:44', 36, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5645, 'Gdzież jest wdzięczność na świecie? Nie ma jej w Dobrzynie!', '2021-06-04, 10:43:13', 49, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5646, 'Bracia! chcecie bój z ruskim wieść imperatorem,', '2021-06-04, 10:43:19', 48, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5647, 'A boicie się wojny z Soplicowskim dworem?', '2021-06-04, 18:43:48', 33, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5648, 'Strach wam turmy! Czyż to ja wzywam na rozboje?', '2021-06-04, 18:43:55', 64, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5649, 'Broń Boże! Szlachta Bracia! ja przy prawie stoję.', '2021-06-04, 18:45:56', 7, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5650, 'Wszak Hrabia wygrał, zyskał dekretów niemało:', '2021-06-04, 18:46:12', 70, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5651, 'Tylko je egzekwować! Tak dawniej bywało:', '2021-06-04, 18:46:29', 85, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5652, 'Trybunał pisał dekret; szlachta wypełniała,', '2021-06-04, 18:50:34', 60, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5653, 'A szczególniej Dobrzyńscy, i stąd wasza chwała', '2021-06-04, 18:54:49', 25, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5654, 'Urosła w Litwie! Wszakże to Dobrzyńscy sami', '2021-06-04, 18:54:52', 60, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5655, 'Bili się na zajezdzie myskim z Moskalami,', '2021-06-04, 18:56:09', 76, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5656, 'Których przywiódł jenerał ruski Wojniłowicz', '2021-06-04, 18:56:31', 42, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5657, 'I łotr, przyjaciel jego, pan Wołk z Łogomowicz.', '2021-06-05, 01:57:57', 96, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5658, 'Pamiętacie, jak Wołka wzięliśmy w niewolę,', '2021-06-05, 01:58:14', 47, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5659, 'Jak chcieliśmy go wieszać na belce w stodole,', '2021-06-05, 01:58:25', 11, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5660, 'Iż był tyran dla chłopstwa a sługa Moskali;', '2021-06-05, 02:01:46', 42, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5661, 'Ale się chłopi głupi nad nim zlitowali!', '2021-06-05, 02:02:09', 50, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5662, '(Upiec go muszę kiedyś na tym Scyzoryku.)', '2021-06-05, 02:02:16', 58, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5663, 'Nie wspomnę innych wielkich zajazdów bez liku,', '2021-06-05, 02:02:24', 36, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5664, 'Z których wyszliśmy zawsze, jak szlachcie przystało,', '2021-06-05, 10:02:32', 94, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5665, 'I z zyskiem i aplauzem powszechnym i z chwałą!', '2021-06-05, 10:02:39', 96, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5666, 'Po cóż o tym wspominać? Dziś darmo pan Hrabia,', '2021-06-05, 10:04:00', 69, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5667, 'Sąsiad wasz, sprawę toczy, dekrety wyrabia:', '2021-06-05, 10:04:01', 72, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5668, 'Już nikt z was pomóc nie chce biednemu sierocie!', '2021-06-05, 10:06:21', 29, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5669, 'Dziedzic Stolnika tego, który żywił krocie,', '2021-06-05, 10:08:33', 8, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5670, 'Dziś nie ma przyjaciela, oprócz mnie, Klucznika,', '2021-06-05, 10:12:49', 32, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5671, 'I ot tego wiernego mego Scyzoryka!»', '2021-06-05, 10:13:15', 34, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5672, '«I Kropidła — rzekł Chrzciciel — Gdzie ty Gerwazeńku,', '2021-06-05, 10:16:37', 63, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5673, 'Tam i ja; póki ręka, póki plusk plask w ręku.', '2021-06-05, 10:16:57', 3, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5674, 'Co dwaj to dwaj! Dalibóg mój Gerwazy! ty miecz,', '2021-06-05, 10:20:26', 21, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5675, 'Ja mam Kropidło; dalbóg! ja kropię, a ty siecz:', '2021-06-05, 10:23:35', 65, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5676, 'I tak szach mach, plusk i plask; oni niech gawędzą!»', '2021-06-05, 10:23:52', 52, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5677, '«Toć i Bartka — rzekł Brzytwa — bracia nie odpędzą;', '2021-06-05, 14:24:55', 15, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5678, 'Już co wy namydlicie, to ja wszystko zgolę».', '2021-06-05, 19:26:09', 8, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5679, '«I ja — przydał Konewka — z wami ruszyć wolę,', '2021-06-05, 19:29:37', 21, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5680, 'Gdy ich nie można zgodzić na obiór marszałka;', '2021-06-05, 19:29:41', 78, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5681, 'Co mi tam głosy, gałki! U mnie insza gałka.', '2021-06-05, 19:29:58', 87, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5682, '— Tu wydobył z kieszeni garść kul, dzwonił nimi —', '2021-06-05, 19:30:11', 67, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5683, 'Ot gałki! — krzyknął — w Sędzię gałkami wszystkimi!»', '2021-06-05, 19:30:39', 4, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5684, '«Do was — wołał Skołuba — do was się łączymy!»', '2021-06-05, 19:30:50', 61, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5685, '«Gdzie wy — krzyknęła szlachta — gdzie wy, to tam i my!', '2021-06-05, 19:33:00', 8, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5686, 'Niech żyją Horeszkowie! wiwant Półkozice!', '2021-06-05, 19:37:24', 92, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5687, 'Wiwat Klucznik Rębajło! Hejże na Soplicę!»', '2021-06-05, 19:37:40', 82, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5688, 'I tak wszystkich pociągnął wymowny Gerwazy;', '2021-06-05, 21:41:06', 2, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5689, 'Bo wszyscy ku Sędziemu mieli swe urazy,', '2021-06-05, 21:41:34', 13, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5690, 'Jak zwyczajnie w sąsiedztwie: to o szkodę skargi,', '2021-06-05, 21:42:03', 40, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5691, 'To o wyręby, to o granice zatargi.', '2021-06-06, 01:42:08', 7, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5692, 'Jednych gniew, drugich tylko podburzała zawiść', '2021-06-06, 01:42:13', 75, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5693, 'Bogactw Sędziego — wszystkich zgodziła nienawiść.', '2021-06-06, 01:42:32', 12, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5694, 'Cisną się do Klucznika, podnoszą do góry', '2021-06-06, 01:42:38', 7, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5695, 'Szable, pałki. —', '2021-06-06, 01:42:57', 5, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5696, 'Aż Maciek, dotychczas ponury,', '2021-06-06, 01:42:59', 26, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5697, 'Nieruchomy, wstał z ławy i wolnymi kroki', '2021-06-06, 01:43:06', 2, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5698, 'Wyszedł na środek izby i podparł się w boki;', '2021-06-06, 01:43:18', 36, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5699, 'I spojrzawszy przed siebie, i kiwając głową,', '2021-06-06, 01:43:28', 34, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5700, 'Zabrał głos, wymawiając z wolna każde słowo,', '2021-06-06, 01:43:56', 72, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5701, 'Z przestankiem i przyciskiem: «A głupi! a głupi!', '2021-06-06, 06:43:56', 35, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5702, 'A głupi wy! Na kim się mleło, na was skrupi!…', '2021-06-06, 06:44:03', 47, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5703, 'To póki o wskrzeszeniu Polski była rada,', '2021-06-06, 06:48:14', 70, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5704, 'O dobru pospolitym, głupi, u was zwada?', '2021-06-06, 06:48:41', 28, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5705, 'Nie można było, głupi, ani się rozmówić,', '2021-06-06, 06:48:45', 23, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5706, 'Głupi, ani porządku, ani postanowić', '2021-06-06, 06:49:14', 99, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5707, 'Wodza nad wami, głupi! A niech no kto podda', '2021-06-06, 06:53:21', 9, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5708, 'Osobiste urazy, głupi, u was zgoda!', '2021-06-06, 06:55:22', 11, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5709, 'Precz stąd! Bo jakom Maciek, was, do milijonów', '2021-06-06, 06:55:28', 49, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5710, 'Kroćset kroci tysięcy fur, beczek, furgonów,', '2021-06-06, 06:59:45', 70, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5711, 'Diabłów!!!!…»', '2021-06-06, 07:04:11', 88, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5712, 'Ucichli wszyscy jak rażeni gromem;', '2021-06-06, 07:04:28', 53, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5713, 'Ale razem straszliwy powstał krzyk za domem:', '2021-06-06, 07:06:33', 92, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5714, '«Wiwat Hrabia!» On wjeżdżał na folwark Maciejów,', '2021-06-06, 07:06:40', 37, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5715, 'Sam zbrojny, za nim zbrojnych dziesięciu dżokejów.', '2021-06-06, 10:07:00', 79, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5716, 'Hrabia siedział na dzielnym koniu, w czarnym stroju;', '2021-06-06, 10:11:10', 87, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5717, 'Na sukni orzechowy płaszcz włoskiego kroju,', '2021-06-06, 10:12:17', 48, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5718, 'Szeroki, bez rękawów, jak wielka opona,', '2021-06-06, 10:12:37', 89, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5719, 'Spięty klamrą u szyi, spadał przez ramiona;', '2021-06-06, 10:13:05', 8, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5720, 'Kapelusz miał okrągły z piórem, w ręku szpadę.', '2021-06-06, 10:13:21', 90, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5721, 'Okręcił się i szpadą powitał gromadę.', '2021-06-06, 10:13:47', 77, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5722, '«Wiwat Hrabia! — krzyknęli — z nim żyć i umierać!»', '2021-06-06, 10:15:11', 51, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5723, 'Szlachta zaczęła z chaty przez okna wyzierać,', '2021-06-06, 10:18:18', 10, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5724, 'I za Klucznikiem coraz ku drzwiom się napierać.', '2021-06-06, 10:18:35', 30, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5725, 'Klucznik wyszedł, a za nim tłum przeze drzwi runął,', '2021-06-06, 10:18:56', 9, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5726, 'Maciek resztę wypędził, drzwi zamknął, zasunął,', '2021-06-06, 10:18:59', 2, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5727, 'I przez okno wyjrzawszy, raz jeszcze rzekł: «Głupi!»', '2021-06-06, 19:19:21', 60, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5728, 'A tymczasem się szlachta do Hrabiego kupi', '2021-06-06, 19:19:30', 37, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5729, 'Idą w karczmę. Gerwazy wspomniał dawne czasy:', '2021-06-06, 19:19:55', 83, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5730, 'Kazał sobie trzy podać od kontuszów pasy,', '2021-06-06, 19:19:57', 55, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5731, 'Na nich ze sklepu karczmy beczki wydobywa', '2021-06-06, 19:20:23', 84, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5732, 'Trzy: jedną miodu, drugą wódki, trzecią piwa.', '2021-06-06, 19:20:26', 70, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5733, 'Wyjął goździe, wnet z szumem trysnęły trzy strugi,', '2021-06-06, 22:20:34', 13, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5734, 'Jeden biały jak srebro, krwawnikowy drugi,', '2021-06-07, 03:21:39', 41, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5735, 'Trzeci żółty; troistą grają w górze tęczą,', '2021-06-07, 03:24:44', 19, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5736, 'A spadając w sto kubków, we sto szklanek brzęczą.', '2021-06-07, 03:28:50', 14, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5737, 'Wre szlachta. Tamci piją, ci Hrabiemu życzą', '2021-06-07, 03:29:17', 90, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5738, 'Lat setnych, wszyscy: «Hejże na Soplicę!» krzyczą.', '2021-06-07, 03:33:39', 76, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5739, 'Jankiel wymknął się milczkiem, oklep. Prusak, równie', '2021-06-07, 03:34:05', 85, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5740, 'Niesłuchany, choć jeszcze rozprawiał wymównie,', '2021-06-07, 03:38:18', 10, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5741, 'Chciał zmykać: szlachta w pogoń, wołając, że zdradził.', '2021-06-07, 03:40:39', 93, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5742, 'Mickiewicz stał z daleka; ni krzyczał, ni radził,', '2021-06-07, 03:41:56', 39, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5743, 'Ale z miny poznano, że coś złego knuje:', '2021-06-07, 03:42:57', 49, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5744, 'Więc do kordów, i hejże! On się rejteruje,', '2021-06-07, 03:47:05', 61, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5745, 'Odcina się, już ranny; przyparty do płotów:', '2021-06-07, 03:47:17', 44, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5746, 'Gdy mu skoczył na odsiecz Zan i trzech Czeczotów.', '2021-06-07, 03:50:27', 55, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5747, 'Za czym rozjęto szlachtę. Ale w tym rozruchu,', '2021-06-07, 03:53:34', 87, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5748, 'Dwóch było ciętych w ręce; ktoś dostał po uchu;', '2021-06-07, 03:56:50', 69, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5749, 'Reszta wsiadała na koń. —', '2021-06-07, 03:57:13', 99, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5750, 'Hrabia i Gerwazy', '2021-06-07, 03:57:33', 37, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5751, 'Porządkują, rozdają oręże, rozkazy.', '2021-06-07, 04:00:36', 84, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5752, 'W końcu, wszyscy przez długą zaścianku ulicę', '2021-06-07, 04:04:41', 6, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5753, 'Puścili się w cwał krzycząc: «Hejże na Soplicę!»', '2021-06-07, 04:04:57', 57, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5754, 'Księga ósma', '2021-06-07, 04:05:21', 33, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5755, 'Zajazd', '2021-06-07, 04:05:50', 67, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5756, 'Astronomia Wojskiego — Uwaga Podkomorzego nad kometami — Tajemnicza scena w pokoju Sędziego — Tadeusz, chcąc zręcznie wyplątać się, wpada w wielkie kłopoty — Nowa Dydo — Zajazd — Ostatnia woźnieńska protestacja — Hrabia zdobywa Soplicowo — Szturm i rzeź — Gerwazy piwniczym — Uczta zajazdowa.', '2021-06-07, 04:08:57', 45, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5757, 'Przed burzą bywa chwila cicha i ponura,', '2021-06-07, 04:09:20', 73, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5758, 'Kiedy, nad głowy ludzi przyleciawszy, chmura', '2021-06-07, 04:09:37', 41, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5759, 'Stanie i grożąc twarzą, dech wiatrów zatrzyma,', '2021-06-07, 04:13:49', 33, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5760, 'Milczy, obiega ziemię błyskawic oczyma,', '2021-06-07, 13:14:15', 88, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (5761, 'Znacząc te miejsca, gdzie wnet ciśnie grom po gromie:', '2021-06-07, 13:14:32', 83, 18, false);
