INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6068, 'W przypadku wojny, tobie cała tajemnica', '2021-06-16, 09:33:07', 97, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6069, 'Wiadoma: kończ, com zaczął, pomnij, żeś Soplica!»', '2021-06-16, 09:33:35', 21, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6070, 'Tu ksiądz łzy otarł, habit zapiął, kaptur włożył', '2021-06-16, 09:34:59', 79, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6071, 'I okienicę tylną po cichu otworzył,', '2021-06-16, 09:35:22', 38, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6072, 'Widać było, że oknem do ogrodu skakał;', '2021-06-16, 09:35:43', 79, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6073, 'Sędzia, zostawszy jeden, siadł w krześle i płakał.', '2021-06-16, 15:40:04', 34, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6074, 'Chwilę czekał Tadeusz, nim w klamkę zadzwonił;', '2021-06-16, 15:41:19', 44, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6075, 'Otworzono mu, cicho wszedł, nisko się skłonił:', '2021-06-16, 22:42:38', 63, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6076, '«Stryjaszku dobrodzieju — rzekł — ledwie dni kilka', '2021-06-16, 22:42:48', 87, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6077, 'Przebawiłem tu, dni te minęły jak chwilka;', '2021-06-16, 22:47:13', 56, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6078, 'Nie miałem czasu z twoim domem się nacieszyć', '2021-06-16, 22:50:27', 29, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6079, 'I z tobą, a odjeżdżać muszę, muszę spieszyć', '2021-06-16, 22:50:43', 45, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6080, 'Zaraz, dzisiaj, stryjaszku, a jutro najdaléj:', '2021-06-16, 22:50:56', 73, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6081, 'Wszak pamiętacie, żeśmy Hrabiego wyzwali.', '2021-06-16, 22:51:01', 30, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6082, 'Bić się z nim to rzecz moja, posłałem wyzwanie,', '2021-06-16, 22:55:03', 6, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6083, 'W Litwie jest zakazane pojedynkowanie,', '2021-06-16, 22:55:10', 41, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6084, 'Jadę więc na granicę Warszawskiego Księstwa.', '2021-06-16, 22:58:34', 73, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6085, 'Hrabia, prawda, fanfaron, lecz mu nie brak męstwa,', '2021-06-17, 00:59:42', 42, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6086, 'Na miejsce naznaczone zapewne się stawi,', '2021-06-17, 00:59:42', 45, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6087, 'Rozprawim się; a jeśli Bóg pobłogosławi,', '2021-06-17, 01:04:07', 97, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6088, 'Ukarzę go, a potem za Łososny brzegi', '2021-06-17, 01:08:20', 88, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6089, 'Przepłynę, gdzie mnie bratnie czekają szeregi.', '2021-06-17, 01:11:24', 33, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6090, 'Słyszałem, że mi ojciec testamentem kazał', '2021-06-17, 01:12:46', 6, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6091, 'Służyć w wojsku, a nie wiem, kto testament zmazał».', '2021-06-17, 10:13:02', 26, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6092, '«Mój Tadeuszku — rzekł stryj — czy waszeć kąpany', '2021-06-17, 10:17:12', 20, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6093, 'W gorącej wodzie, czy też kręcisz jak lis szczwany,', '2021-06-17, 10:19:37', 91, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6094, 'Co indziej kitą wije, a sam indziej bieży?', '2021-06-17, 10:23:01', 28, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6095, 'Wyzwaliśmy, zapewne, i bić się należy.', '2021-06-17, 10:23:10', 69, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6096, 'Ale jechać dziś, skądżeś waszeć tak się zaciął?', '2021-06-17, 10:27:23', 69, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6097, 'Przed pojedynkiem zwyczaj jest posłać przyjaciół,', '2021-06-17, 18:27:40', 43, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6098, 'Układać się. Wszak Hrabia może nas przeprosić,', '2021-06-17, 18:28:06', 46, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6099, 'Deprekować; czekaj waść, czasu jeszcze dosyć.', '2021-06-17, 18:29:19', 41, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6100, 'Chyba inny giez jaki waści stąd wygania,', '2021-06-17, 18:32:21', 55, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6101, 'To gadaj szczerze, po co takie omawiania?', '2021-06-17, 18:32:35', 90, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6102, 'Jestem twój stryj; choć stary, znam, co serce młode;', '2021-06-17, 18:32:39', 14, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6103, 'Byłem ci ojcem (mówiąc gładził go pod brodę),', '2021-06-17, 18:32:50', 89, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6104, 'Już w ucho szepnął o tym mnie mój palec mały,', '2021-06-17, 18:33:13', 62, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6105, 'Że waszeć masz tu jakieś z damami kabały.', '2021-06-17, 18:35:28', 26, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6106, 'Za katy, prędko teraz młódź do dam się bierze!', '2021-06-17, 18:35:57', 35, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6107, 'No, Tadeuszku, przyznaj mi się waść, a szczerze».', '2021-06-18, 02:36:58', 91, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6108, '«Jużci — bąknął Tadeusz — prawda: są przyczyny', '2021-06-18, 02:37:27', 49, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6109, 'Inne, kochany stryju, może z mojej winy!', '2021-06-18, 02:39:31', 57, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6110, 'Omyłka! cóż? nieszczęście! już trudno naprawić!', '2021-06-18, 02:41:50', 20, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6111, 'Nie, drogi stryju, dłużej nie mogę tu bawić!', '2021-06-18, 02:42:05', 61, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6112, 'Błąd młodości! Stryjaszku, nie pytaj o więcej,', '2021-06-18, 02:42:15', 26, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6113, 'Ja muszę z Soplicowa wyjeżdżać co prędzej».', '2021-06-18, 02:42:39', 22, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6114, '«Ho! — rzekł Stryj — pewnie jakieś miłośne zatargi!', '2021-06-18, 02:44:45', 63, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6115, 'Uważałem, że waszeć wczoraj gryzłeś wargi,', '2021-06-18, 02:44:48', 44, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6116, 'Poglądając spode łba na pewną dziewczynkę;', '2021-06-18, 02:45:05', 27, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6117, 'Widziałem, że i ona miała kwaśną minkę.', '2021-06-18, 02:45:16', 41, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6118, 'Znam ja te wszystkie głupstwa; kiedy dzieci para', '2021-06-18, 02:45:34', 20, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6119, 'Kocha się, to tam u nich nieszczęść co niemiara!', '2021-06-18, 02:48:46', 5, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6120, 'To cieszą się, to znowu trapią się i smucą,', '2021-06-18, 09:49:07', 37, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6121, 'To znowu, Bóg wie o co, do zębów się kłócą,', '2021-06-18, 09:51:11', 84, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6122, 'To stojąc w kątkach jakby mruki, nie gadają', '2021-06-18, 09:53:14', 21, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6123, 'Do siebie, czasem nawet w pole uciekają.', '2021-06-18, 15:53:26', 18, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6124, 'Jeżeli na was raptus podobny napada,', '2021-06-18, 15:56:53', 69, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6125, 'Bądźcie tylko cierpliwi, już jest na to rada;', '2021-06-18, 15:59:17', 91, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6126, 'Biorę na siebie wkrótce przywieść was do zgody.', '2021-06-18, 16:01:42', 96, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6127, 'Znam ja te wszystkie głupstwa, wszakże byłem młody.', '2021-06-18, 16:03:49', 99, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6128, 'Powiedz mi wasze wszystko; ja może nawzajem', '2021-06-18, 21:04:53', 81, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6129, 'Coś odkryję i tak się oba poprzyznajem».', '2021-06-18, 21:05:07', 32, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6130, '«Stryjaszku — rzekł Tadeusz, całując mu rękę', '2021-06-19, 03:05:30', 58, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6131, 'I rumieniąc się — powiem prawdę. Tę panienkę,', '2021-06-19, 03:08:37', 98, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6132, 'Zosię, wychowanicę stryja, podobałem', '2021-06-19, 05:12:42', 54, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6133, 'Bardzo, choć tylko parę razy ją widziałem;', '2021-06-19, 05:13:48', 21, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6134, 'A mówią, że stryj dla mnie za żonę przeznacza', '2021-06-19, 05:13:57', 77, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6135, 'Podkomorzankę, piękną i córkę bogacza.', '2021-06-19, 05:14:01', 82, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6136, 'Teraz nie mógłbym z panną Różą się ożenić,', '2021-06-19, 05:15:18', 88, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6137, 'Kiedy kocham tę Zosię; trudno serce zmienić!', '2021-06-19, 05:15:39', 23, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6138, 'Nieuczciwie, żeniąc się z jedną, kochać drugą.', '2021-06-19, 05:15:44', 87, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6139, 'Czas może mnie uleczy; wyjadę — na długo».', '2021-06-19, 05:17:48', 64, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6140, '«Tadeuszku — stryj przerwał — to mi dziwny sposób', '2021-06-19, 14:18:03', 17, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6141, 'Kochania się: uciekać od kochanych osób!', '2021-06-19, 14:18:28', 3, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6142, 'Dobrze, żeś szczery; widzisz, głupstwo byś wypłatał,', '2021-06-19, 14:18:57', 95, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6143, 'Odjeżdżając: a co waść powiesz, gdybym swatał', '2021-06-19, 14:18:57', 15, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6144, 'Sam waści Zosię? He? Cóż, nie skoczysz z radości?»', '2021-06-19, 14:18:59', 71, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6145, 'Tadeusz rzekł po chwili «Dobroć jegomości', '2021-06-19, 14:19:01', 74, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6146, 'Dziwi mnie. Lecz cóż? Łaska stryja dobrodzieja', '2021-06-19, 14:20:06', 39, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6147, 'Nie przyda się już na nic! Ach, próżna nadzieja!', '2021-06-19, 14:22:21', 8, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6148, 'Bo pani Telimena nie odda mi Zosi!»', '2021-06-19, 14:22:37', 2, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6149, '«Będziem prosić» rzekł Sędzia.', '2021-06-19, 14:22:45', 6, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6150, '«Nikt jej nie uprosi —', '2021-06-19, 14:23:01', 17, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6151, 'Przerwał prędko Tadeusz — nie, czekać nie mogę,', '2021-06-19, 17:26:14', 36, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6152, 'Stryjaszku, muszę prędko, jutro jechać w drogę.', '2021-06-19, 17:30:26', 74, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6153, 'Daj mi, stryjaszku, tylko twe błogosławieństwo,', '2021-06-19, 17:30:46', 48, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6154, 'Wszystko przygotowałem, jadę zaraz w Księstwo».', '2021-06-19, 17:32:05', 4, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6155, 'Sędzia, wąs kręcąc, z gniewem na chłopca spozierał:', '2021-06-19, 17:34:26', 88, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6156, '«To waść tak szczery? takeś mi serce otwierał?', '2021-06-19, 17:35:53', 70, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6157, 'Naprzód ów pojedynek, potem znowu miłość', '2021-06-19, 17:38:14', 89, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6158, 'I ten wyjazd; oj, jest tu w tym jakaś zawiłość.', '2021-06-19, 17:38:26', 38, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6159, 'Już mnie gadano, jużem kroki waści badał!', '2021-06-19, 17:40:36', 71, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6160, 'Asan bałamut i trzpiot, asan kłamstwa gadał!', '2021-06-19, 17:40:39', 88, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6161, 'A gdzież to asan chodził onegdaj wieczorem,', '2021-06-19, 17:41:02', 23, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6162, 'Czego asan jak wyżeł tropił pode dworem?', '2021-06-19, 17:41:06', 54, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6163, 'O Tadeuszku! jeśli może asan Zosię', '2021-06-19, 17:41:16', 12, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6164, 'Zbałamucił i teraz uciekasz, młokosie,', '2021-06-19, 18:41:40', 70, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6165, 'To się waści nie uda! Lubisz czy nie lubisz,', '2021-06-19, 18:44:52', 22, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6166, 'Zapowiadam asanu, że Zosię poślubisz;', '2021-06-19, 18:45:08', 78, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6167, 'A nie, to bizun — jutro staniesz na kobiercu!', '2021-06-19, 18:45:17', 66, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6168, 'I gada mnie o czuciach! o niezmiennym sercu!', '2021-06-19, 18:45:32', 8, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6169, 'Łgarz jesteś! pfe! Ja z waści, panie Tadeuszu,', '2021-06-19, 18:45:35', 75, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6170, 'Zrobię śledztwo, ja waści jeszcze natrę uszu!', '2021-06-19, 18:47:52', 10, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6171, 'Dziś dość miałem kłopotów, aż mnie głowa boli;', '2021-06-19, 18:47:53', 75, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6172, 'Ten mi jeszcze spokojnie zasnąć nie dozwoli!', '2021-06-19, 18:47:53', 4, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6173, 'Idź mi waść spać!» To mówiąc, drzwi na wściąż otwierał', '2021-06-19, 18:51:59', 81, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6174, 'I zawołał Woźnego, żeby go rozbierał.', '2021-06-19, 18:52:03', 76, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6175, 'Tadeusz cicho wyszedł, opuściwszy głowę,', '2021-06-19, 18:54:19', 30, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6176, 'Rozbierał w myśli przykrą ze stryjem rozmowę:', '2021-06-19, 18:54:45', 96, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6177, 'Pierwszy raz połajany tak ostro!… Ocenił', '2021-06-19, 18:57:51', 15, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6178, 'Słuszność wyrzutów, sam się przed sobą rumienił.', '2021-06-19, 18:58:55', 29, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6179, 'Co począć? jeśli Zosia o wszystkim się dowie?', '2021-06-19, 19:02:22', 18, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6180, 'Prosić o rękę? a cóż Telimena powie?', '2021-06-19, 19:02:39', 71, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6181, 'Nie, czuł, że nie mógł dłużej zostać w Soplicowie.', '2021-06-19, 19:03:08', 76, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6182, 'Tak zadumany ledwie zrobił kroków parę,', '2021-06-19, 20:05:24', 22, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6183, 'Gdy mu coś drogę zaszło; spojrzał: widzi marę,', '2021-06-19, 20:09:36', 34, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6184, 'Całą w bieliźnie, długą, wysmukłą i cienką.', '2021-06-19, 20:09:47', 48, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6185, 'Suwała się ku niemu z wyciągniętą ręką,', '2021-06-19, 20:11:15', 97, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6186, 'Od której odbijał się drżący blask miesięczny,', '2021-06-19, 20:11:44', 83, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6187, 'I przystąpiwszy, cicho jęknęła: «Niewdzięczny!', '2021-06-19, 20:16:02', 36, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6188, 'Szukałeś wzroku mego, teraz go unikasz;', '2021-06-19, 20:19:04', 23, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6189, 'Szukałeś rozmów ze mną, dziś uszy zamykasz,', '2021-06-19, 20:22:24', 4, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6190, 'Jakby w słowach, we wzroku mym była trucizna!', '2021-06-19, 20:22:31', 46, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6191, 'Dobrze mi tak, wiedziałam, kto jesteś: mężczyzna!', '2021-06-19, 20:22:48', 55, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6192, 'Nie znając kokieterii, nie chciałam cię dręczyć,', '2021-06-19, 20:25:04', 35, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6193, 'Uszczęśliwiłam; takżeś umiał mnie zawdzięczyć!', '2021-06-19, 20:26:30', 86, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6194, 'Tryumf nad miękkim sercem serce twe zatwardził;', '2021-06-19, 20:27:53', 12, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6195, 'Żeś je zdobył zbyt łacno, zbyt prędkoś nim wzgardził!', '2021-06-19, 20:30:16', 9, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6196, 'Dobrze mi tak! Lecz straszną nauczona probą,', '2021-06-19, 20:32:23', 59, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6197, 'Wierz mi, iż więcej niż ty gardzę sama sobą!»', '2021-06-19, 20:32:29', 36, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6198, '«Telimeno — Tadeusz rzekł — dalbóg nietwarde', '2021-06-19, 20:35:41', 76, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6199, 'Mam serce ani ciebie unikam przez wzgardę;', '2021-06-19, 20:38:08', 2, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6200, 'Ale uważ no sama, wszak nas widzą, śledzą,', '2021-06-19, 20:38:15', 86, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6201, 'Czyż można tak otwarcie? cóż ludzie powiedzą?', '2021-06-20, 04:40:24', 33, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6202, 'Wszak to nieprzyzwoicie, to dalbóg jest grzechem».', '2021-06-20, 04:40:29', 1, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6203, '«Grzechem! — odpowiedziała mu z gorzkim uśmiechem —', '2021-06-20, 04:44:45', 78, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6204, 'Niewiniątko! baranek! Ja, będąc kobiétą,', '2021-06-20, 04:44:48', 43, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6205, 'Jeśli z miłości nie dbam, choćby mnie odkryto,', '2021-06-20, 04:48:06', 89, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6206, 'Choćby mnie osławiono; a ty, ty mężczyzna?', '2021-06-20, 04:49:09', 50, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6207, 'Cóż szkodzi z was któremu, chociaż się i przyzna,', '2021-06-20, 04:49:14', 47, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6208, 'Że ma romans z dziesięciu razem kochankami?', '2021-06-20, 04:51:40', 38, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6209, 'Mów prawdę: chcesz mnie rzucić?» Zalała się łzami.', '2021-06-20, 04:51:55', 84, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6210, '«Telimeno, cóż by świat mówił o człowieku —', '2021-06-20, 04:52:04', 23, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6211, 'Rzekł Tadeusz — który by teraz, w moim wieku,', '2021-06-20, 04:52:14', 33, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6212, 'Zdrów, żył na wsi, kochał się: kiedy tyle młodzi,', '2021-06-20, 04:55:27', 41, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6213, 'Tylu żonatych od żon, od dzieci uchodzi', '2021-06-20, 04:55:56', 77, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6214, 'Za granicę, pod znaki narodowe bieży?', '2021-06-20, 04:57:00', 40, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6215, 'Choćbym chciał zostać, czy to ode mnie zależy?', '2021-06-20, 04:58:23', 54, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6216, 'Ojciec mnie testamentem kazał, abym służył', '2021-06-20, 08:59:39', 51, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6217, 'W wojsku polskim, teraz stryj ten rozkaz powtórzył:', '2021-06-20, 08:59:51', 67, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6218, 'Jutro jadę, zrobiłem już postanowienie,', '2021-06-20, 09:02:09', 49, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6219, 'I dalbóg, Telimeno, już go nie odmienię».', '2021-06-20, 09:04:34', 74, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6220, '«Ja — rzekła Telimena — nie chcę ci zagradzać', '2021-06-20, 09:04:48', 86, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6221, 'Drogi do sławy, szczęściu twojemu przeszkadzać!', '2021-06-20, 09:05:02', 54, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6222, 'Jesteś mężczyzną, znajdziesz kochankę godniejszą', '2021-06-20, 09:07:19', 49, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6223, 'Serca twojego, znajdziesz bogatszą, piękniejszą!', '2021-06-20, 09:07:44', 8, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6224, 'Tylko dla mej pociechy, niech wiem przed rozstaniem,', '2021-06-20, 09:07:49', 93, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6225, 'Że twoja skłonność była prawdziwym kochaniem,', '2021-06-20, 09:07:52', 5, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6226, 'Że to nie był żart tylko, nie rozpusta płocha,', '2021-06-20, 09:08:09', 8, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6227, 'Lecz miłość; niech wiem, że mnie mój Tadeusz kocha!', '2021-06-20, 09:08:24', 63, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6228, 'Niech słowo »kocham« jeszcze raz z ust twych usłyszę,', '2021-06-20, 09:08:53', 84, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6229, 'Niech je w sercu wyryję i w myśli zapiszę.', '2021-06-20, 09:12:09', 62, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6230, 'Przebaczę łacniej, chociaż przestaniesz mnie kochać,', '2021-06-20, 18:12:10', 9, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6231, 'Pomnąc jakoś mnie kochał!» I zaczęła szlochać.', '2021-06-20, 18:12:13', 40, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6232, 'Tadeusz, widząc że tak płacze i tak błaga', '2021-06-20, 18:12:38', 24, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6233, 'Czule, i tylko takiej drobnostki wymaga,', '2021-06-20, 18:13:05', 27, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6234, 'Wzruszył się, przejęły go szczery żal i litość,', '2021-06-20, 18:13:32', 80, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6235, 'I jeżeliby badał serca swego skrytość,', '2021-06-20, 18:13:48', 98, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6236, 'Może by się w tej chwili i sam nie dowiedział,', '2021-06-20, 19:16:07', 54, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6237, 'Czyli ją kochał, czy nie, więc żywo powiedział:', '2021-06-20, 19:18:35', 78, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6238, '«Telimeno, bogdaj mnie jasny piorun ubił,', '2021-06-20, 19:21:38', 96, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6239, 'Jeśli nie prawda, żem cię, dalbóg, bardzo lubił,', '2021-06-20, 19:22:58', 28, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6240, 'Czy kochał. Krótkie z sobą spędziliśmy chwile,', '2021-06-20, 19:24:12', 25, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6241, 'Ale one mnie przeszły tak słodko, tak mile,', '2021-06-20, 19:28:16', 60, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6242, 'Że będą długo, zawsze myśli mej przytomne,', '2021-06-20, 19:32:25', 43, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6243, 'I dalibóg, że nigdy ciebie nie zapomnę».', '2021-06-20, 21:34:33', 12, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6244, 'Telimena skoczywszy padła mu na szyję:', '2021-06-20, 21:36:40', 40, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6245, '«Tegom się spodziewała! Kochasz mnie, więc żyję!', '2021-06-20, 21:36:58', 60, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6246, 'Bo dzisiaj miałam dni me własną ręką skrócić;', '2021-06-20, 21:37:58', 91, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6247, 'Gdy mnie kochasz mój drogi, czyż możesz mnie rzucić?', '2021-06-20, 21:38:16', 1, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6248, 'Tobie oddałam serce, oddam ci majątek,', '2021-06-20, 21:38:18', 56, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6249, 'Pójdę za tobą wszędzie; każdy świata kątek', '2021-06-20, 21:39:33', 54, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6250, 'Będzie mnie z tobą miły! Z najdzikszej pustyni', '2021-06-20, 21:42:41', 34, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6251, 'Miłość, wierzaj mi, ogród rozkoszy uczyni».', '2021-06-20, 21:45:07', 4, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6252, 'Tadeusz, wydarłszy się z objęcia przemocą:', '2021-06-20, 21:47:33', 25, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6253, '«Jak to? — rzekł — czyś z rozumu obrana? gdzie? po co?', '2021-06-20, 21:47:46', 44, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6254, 'Jechać za mną? Ja, będąc sam prostym żołnierzem,', '2021-06-20, 21:48:14', 3, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6255, 'Włóczyć, czy markietankę?» — «To my się pobierzem»', '2021-06-21, 06:50:37', 41, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6256, 'Rzekła mu Telimena. «Nie, nigdy! — zawoła', '2021-06-21, 06:50:56', 95, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6257, 'Tadeusz.— Ja żenić się nie mam teraz zgoła', '2021-06-21, 09:51:18', 43, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6258, 'Zamiaru, ni kochać się. Fraszki! dajmy pokój!', '2021-06-21, 09:53:33', 76, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6259, 'Proszę cię, moja droga, rozmyśl się! uspokój!', '2021-06-21, 09:53:52', 80, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6260, 'Ja jestem tobie wdzięczen, ale niepodobna', '2021-06-21, 09:54:04', 5, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6261, 'Żenić się. Kochajmy się, ale tak — z osobna.', '2021-06-21, 09:54:33', 80, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6262, 'Zostać dłużej nie mogę; nie, nie, jechać muszę.', '2021-06-21, 09:57:51', 85, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6263, 'Bądź zdrowa, Telimeno moja; jutro ruszę».', '2021-06-21, 09:57:52', 9, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6264, 'Rzekł, nasuwał kapelusz, odwracał się bokiem,', '2021-06-21, 09:59:56', 28, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6265, 'Chcąc iść; lecz go wstrzymała Telimena okiem', '2021-06-21, 10:03:15', 32, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6266, 'I twarzą, jak Meduzy głową. Musiał zostać', '2021-06-21, 10:03:44', 40, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6267, 'Mimowolnie; poglądał z trwogą na jej postać:', '2021-06-21, 10:04:02', 86, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6268, 'Stała blada, bez ruchu, bez tchu i bez życia;', '2021-06-21, 10:05:18', 17, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6269, 'Aż wyciągając rękę jak miecz do przebicia,', '2021-06-21, 10:05:28', 1, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6270, 'Z palcem zmierzonym prosto w Tadeusza oczy:', '2021-06-21, 11:08:38', 35, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6271, '«Tego chciałam! — krzyknęła — ha, języku smoczy!', '2021-06-21, 11:12:57', 26, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6272, 'Serce jaszczurcze! To nic, żem tobą zajęta', '2021-06-21, 11:17:02', 81, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6273, 'Wzgardziła Asesora, Hrabię i Rejenta,', '2021-06-21, 11:17:08', 36, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6274, 'Żeś mnie uwiodł i teraz porzucił sierotę,', '2021-06-21, 11:20:10', 8, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6275, 'To nic! Jesteś mężczyzną, znam waszą niecnotę,', '2021-06-21, 11:21:13', 91, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6276, 'Wiem, że jak inni, tak ty mógłbyś wiarę złamać,', '2021-06-21, 11:25:25', 17, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6277, 'Lecz nie wiedziałam, że tak podle umiesz kłamać!', '2021-06-21, 16:25:50', 3, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6278, 'Słuchałam pode drzwiami stryja! Więc to dziecko,', '2021-06-21, 16:25:54', 42, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6279, 'Zosia, wpadła ci w oko i na nią zdradziecko', '2021-06-21, 16:26:22', 97, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6280, 'Dybiesz? Zaledwieś jedną nieszczęsną oszukał,', '2021-06-21, 23:27:25', 21, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6281, 'A jużeś pod jej okiem nowych ofiar szukał!', '2021-06-21, 23:28:32', 73, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6282, 'Uciekaj, lecz cię moje dosięgną przekleństwa —', '2021-06-21, 23:29:43', 97, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6283, 'Lub zostań, wydam światu twoje bezeceństwa;', '2021-06-21, 23:29:50', 88, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6284, 'Twe sztuki już nie zwiodą innych, jak mnie zwiodły!', '2021-06-21, 23:30:16', 57, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6285, 'Precz! gardzę tobą! jesteś kłamca, człowiek podły!»', '2021-06-21, 23:30:23', 1, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6286, 'Na obelgę śmiertelną dla uszu szlachcica,', '2021-06-21, 23:31:51', 42, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6287, 'I której żaden nigdy nie słyszał Soplica,', '2021-06-21, 23:32:52', 46, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6288, 'Zadrżał Tadeusz, twarz mu pobladła jak trupia,', '2021-06-21, 23:36:54', 8, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6289, 'Tupnąwszy nogą, usta ścisnąwszy, rzekł: «Głupia!»', '2021-06-21, 23:37:02', 7, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6290, 'Odszedł; lecz wyraz «podłość» echem się powtórzył', '2021-06-22, 07:41:13', 94, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6291, 'W sercu. Wzdrygnął się młodzian, czuł, że nań zasłużył,', '2021-06-22, 07:41:40', 97, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6292, 'Czuł, że wyrządził wielką krzywdę Telimenie,', '2021-06-22, 07:44:00', 34, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6293, 'Że go słusznie skarżyła, mówiło sumienie;', '2021-06-22, 07:44:12', 91, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6294, 'Lecz czuł, że po tych skargach tym mocniej ją zbrzydził.', '2021-06-22, 07:46:20', 75, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6295, 'O Zosi, ach! pomyślić nie ważył się, wstydził.', '2021-06-22, 07:50:32', 84, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6296, 'Przecież ta Zosia, taka piękna, taka miła!', '2021-06-22, 07:52:53', 20, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6297, 'Stryj swatał ją! może by jego żoną była,', '2021-06-22, 07:56:19', 87, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6298, 'Gdyby nie szatan, co go plącząc w grzech za grzechem,', '2021-06-22, 07:58:27', 66, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6299, 'W kłamstwo za kłamstwem, wreszcie odstąpił z uśmiechem!', '2021-06-22, 07:58:41', 71, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6300, 'Złajany, pogardzony od wszystkich, w dni parę', '2021-06-22, 18:58:42', 21, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6301, 'Zmarnował przyszłość! Uczuł słuszną zbrodni karę.', '2021-06-22, 19:02:49', 3, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6302, 'W tej burzy uczuć jakby kotwica spoczynku', '2021-06-22, 19:05:57', 56, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6303, 'Zabłysnęła mu nagle myśl o pojedynku:', '2021-06-22, 19:09:06', 53, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6304, '«Zamordować Hrabiego! łotra! krzyknął w gniewie,', '2021-06-22, 19:09:14', 98, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6305, 'Zginąć albo zemścić się!» A za co? sam nie wie;', '2021-06-22, 21:09:33', 23, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6306, 'I ten gniew wielki, jak się zajął w mgnieniu oka,', '2021-06-22, 21:11:43', 13, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6307, 'Tak wywietrzał. Znów zdjęła go żałość głęboka,', '2021-06-22, 21:12:07', 99, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6308, 'Myślił: «Jeśli prawdziwe było postrzeżenie,', '2021-06-22, 21:16:26', 31, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6309, 'Że Hrabia z Zosią jakieś ma porozumienie,', '2021-06-22, 21:16:35', 49, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6310, 'I cóż stąd? Może Hrabia kocha Zosię szczerze,', '2021-06-22, 21:17:04', 35, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6311, 'Może go ona kocha, za męża wybierze?', '2021-06-22, 21:21:23', 94, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6312, 'Jakimże prawem chciałbym zerwać to zamęście,', '2021-06-22, 21:22:25', 15, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6313, 'I, sam nieszczęśnik, wszystkich mam zaburzać szczęście?»', '2021-06-22, 21:22:44', 67, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6314, 'Wpadł w rozpacz i nie widział innego sposobu,', '2021-06-22, 21:25:07', 27, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6315, 'Chyba ucieczkę prędką; gdzie? chyba do grobu!', '2021-06-23, 03:29:15', 70, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6316, 'Więc kułak przycisnąwszy na schylonym czole,', '2021-06-23, 03:29:20', 18, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6317, 'Biegł ku łąkom, gdzie stawy błyszczały się w dole,', '2021-06-23, 03:30:48', 27, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6318, 'I stanął nad błotnistym; w zielonawe tonie', '2021-06-23, 03:33:04', 6, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6319, 'Łakomy wzrok utopił i błotniste wonie', '2021-06-23, 03:36:33', 82, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6320, 'Z rozkoszą ciągnął piersią, i otworzył usta', '2021-06-23, 03:36:56', 31, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6321, 'Ku nim. Bo samobójstwo jak każda rozpusta', '2021-06-23, 03:41:13', 3, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6322, 'Jest wymyślną; on w głowy szalonym zawrocie', '2021-06-23, 06:41:36', 38, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6323, 'Czuł niewymowny pociąg utopić się w błocie.', '2021-06-23, 06:41:45', 30, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6324, 'Lecz Telimena z dzikiej młodzieńca postawy', '2021-06-23, 06:41:52', 73, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6325, 'Zgadując rozpacz, widząc że pobiegł nad stawy,', '2021-06-23, 06:41:56', 50, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6326, 'Chociaż ku niemu takim słusznym gniewem pała,', '2021-06-23, 15:43:56', 90, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6327, 'Przelękła się; w istocie dobre serce miała.', '2021-06-23, 15:44:04', 51, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6328, 'Żal jej było, że inną śmiał Tadeusz lubić,', '2021-06-23, 15:44:08', 79, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6329, 'Chciała go skarać, ale nie myśliła zgubić.', '2021-06-23, 15:44:37', 81, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6330, 'Więc puściła się za nim, wznosząc ręce obie,', '2021-06-23, 15:46:37', 62, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6331, 'Krzycząc: «Stój! głupstwo! kochaj czy nie! żeń się sobie', '2021-06-23, 15:47:44', 62, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6332, 'Czy jedź! tylko stój!» Ale on już szybkim biegiem', '2021-06-23, 15:47:59', 4, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6333, 'Wyprzedził ją daleko; już stanął nad brzegiem.', '2021-06-23, 15:49:13', 96, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6334, 'Dziwnym zrządzeniem losów, po tym samym brzegu', '2021-06-23, 15:49:22', 91, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6335, 'Jechał Hrabia na czele dżokejów szeregu,', '2021-06-23, 15:53:35', 4, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6336, 'A zachwycony wdziękiem nocy tak pogodnej', '2021-06-23, 20:53:54', 52, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6337, 'I harmonią cudną orkiestry podwodnej,', '2021-06-23, 20:56:09', 99, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6338, 'Owych chorów, co brzmiały jak arfy eolskie,', '2021-06-23, 20:56:36', 75, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6339, '(Żadne żaby nie grają tak pięknie jak polskie),', '2021-06-24, 04:56:45', 78, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6340, 'Wstrzymał konia i o swej zapomniał wyprawie,', '2021-06-24, 04:58:03', 87, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6341, 'Zwrócił ucho do stawu i słuchał ciekawie.', '2021-06-24, 04:58:32', 19, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6342, 'Oczy wodził po polach, po niebios obszarze:', '2021-06-24, 04:58:59', 13, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6343, 'Pewnie układał w myśli nocne peizaże.', '2021-06-24, 05:03:19', 37, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6344, 'Zaiste, okolica była malownicza!', '2021-06-24, 05:05:46', 7, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6345, 'Dwa stawy pochyliły ku sobie oblicza', '2021-06-24, 05:10:11', 36, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6346, 'Jako para kochanków: prawy staw miał wody', '2021-06-24, 05:10:29', 31, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6347, 'Gładkie i czyste jako dziewicze jagody;', '2021-06-24, 05:14:32', 28, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6348, 'Lewy, ciemniejszy nieco, jako twarz młodziana', '2021-06-24, 05:14:38', 92, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6349, 'Smagława i już męskim puchem osypana.', '2021-06-24, 05:18:05', 99, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6350, 'Prawy złocistym piaskiem połyskał się wkoło,', '2021-06-24, 05:18:28', 21, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6351, 'Jak gdyby włosem jasnym; a lewego czoło', '2021-06-24, 08:19:40', 22, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6352, 'Najeżone łozami, wierzbami czubate;', '2021-06-24, 08:20:08', 50, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6353, 'Oba stawy ubrane w zieloności szatę.', '2021-06-24, 08:20:10', 81, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6354, 'Z nich dwa strugi, jak ręce związane pospołu,', '2021-06-24, 08:20:31', 1, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6355, 'Ściskają się. Strug dalej upada do dołu;', '2021-06-24, 08:20:43', 48, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6356, 'Upada, lecz nie ginie, bo w rowu ciemnotę', '2021-06-24, 15:21:13', 57, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6357, 'Unosi na swych falach księżyca pozłotę;', '2021-06-24, 15:22:32', 39, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6358, 'Woda warstami spada, a na każdej warście', '2021-06-24, 15:22:57', 91, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6359, 'Połyskają się blasku miesięcznego garście,', '2021-06-24, 15:23:09', 42, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6360, 'Światło w rowie na drobne drzazgi się roztrąca,', '2021-06-24, 15:23:34', 57, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6361, 'Chwyta je i w głąb niesie toń uciekająca,', '2021-06-24, 15:27:46', 76, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6362, 'A z góry znów garściami spada blask miesiąca.', '2021-06-24, 15:27:46', 68, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6363, 'Myślałbyś, że u stawu siedzi Świtezianka,', '2021-06-24, 15:32:05', 57, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6364, 'Jedną ręką zdrój leje z bezdennego dzbanka,', '2021-06-24, 22:36:22', 89, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6365, 'A drugą ręką w wodę dla zabawki miota', '2021-06-24, 22:36:45', 64, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6366, 'Brane z fartuszka garście zaklętego złota.', '2021-06-24, 22:36:52', 36, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6367, 'Dalej, z rowu wybiegłszy, strumień na równinie', '2021-06-24, 22:38:09', 31, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6368, 'Rozkręca się, ucisza, lecz widać że płynie,', '2021-06-24, 22:40:18', 72, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6369, 'Bo na jego ruchomej, drgającej powłoce', '2021-06-24, 22:40:28', 30, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6370, 'Wzdłuż miesięczne światełko drgające migoce.', '2021-06-25, 07:44:56', 7, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6371, 'Jako piękny wąż żmudzki, zwany giwojtosem,', '2021-06-25, 07:48:12', 76, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6372, 'Chociaż zdaje się drzemać, leżąc między wrzosem,', '2021-06-25, 07:48:12', 57, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6373, 'Pełźnie, bo na przemiany srebrzy się i złoci,', '2021-06-25, 07:52:22', 32, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6374, 'Aż nagle zniknie z oczu we mchu lub paproci:', '2021-06-25, 14:53:41', 22, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6375, 'Tak strumień kręcący się chował się w olszynach,', '2021-06-25, 14:53:59', 65, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6376, 'Które na widnokręgu czerniały kończynach,', '2021-06-25, 14:54:21', 49, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6377, 'Wznosząc swe kształty lekkie, niewyraźne oku,', '2021-06-25, 14:54:27', 38, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6378, 'Jak duchy na wpół widne, na poły w obłoku.', '2021-06-25, 14:54:35', 9, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6379, 'Między stawami w rowie młyn ukryty siedzi.', '2021-06-25, 14:55:03', 51, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6380, 'Jako stary opiekun, co kochanków śledzi,', '2021-06-25, 14:55:26', 49, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6381, 'Podsłuchał ich rozmowę, gniewa się, szamoce,', '2021-06-25, 15:55:29', 29, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6382, 'Trzęsie głową, rękami, i groźby bełkoce:', '2021-06-25, 15:58:44', 27, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6383, 'Tak ów młyn nagle zatrząsł mchem obrosłe czoło', '2021-06-25, 15:58:53', 34, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6384, 'I palczastą swą pięścią wykręcając wkoło,', '2021-06-25, 15:58:55', 33, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6385, 'Ledwo klęknął i szczęki zębowate ruszył,', '2021-06-25, 16:02:55', 26, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6386, 'Zaraz miłośną stawów rozmowę zagłuszył', '2021-06-25, 16:03:23', 99, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6387, 'I zbudził Hrabię.', '2021-06-25, 16:03:43', 87, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6388, 'Hrabia widząc, że tak blisko', '2021-06-25, 16:03:58', 41, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6389, 'Tadeusz naszedł jego zbrojne stanowisko,', '2021-06-25, 16:06:10', 67, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6390, 'Krzyczy: «Do broni! łapaj!» Skoczyli dżokeje;', '2021-06-25, 19:06:33', 82, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6391, 'Nim Tadeusz rozeznać mógł, co się z nim dzieje,', '2021-06-25, 19:09:02', 29, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6392, 'Już go chwycili. Biegą do dworu, w podwórze', '2021-06-25, 19:11:18', 48, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6393, 'Wpadają. Dwór budzi się, psy w hałas, w krzyk stróże.', '2021-06-25, 19:11:32', 42, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6394, 'Wyskoczył wpół ubrany Sędzia; widzi zgraję', '2021-06-25, 19:15:49', 92, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6395, 'Zbrojną, myśli, że zbójcy, aż Hrabię poznaje.', '2021-06-25, 19:15:53', 39, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6396, '«Co to jest?» pyta. Hrabia szpadą nad nim mignął,', '2021-06-25, 19:18:19', 5, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6397, 'Lecz widząc bezbronnego w zapale ostygnął:', '2021-06-25, 19:18:19', 68, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6398, '«Soplico — rzekł — odwieczny wrogu mej rodziny,', '2021-06-25, 19:22:27', 3, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6399, 'Dziś skarzę cię za dawne i za świeże winy,', '2021-06-25, 23:26:52', 43, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6400, 'Dziś zdasz mi sprawę z mojej fortuny zaboru,', '2021-06-25, 23:27:17', 73, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6401, 'Nim pomszczę się obelgi mojego honoru!»', '2021-06-25, 23:28:25', 40, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6402, 'Lecz Sędzia, żegnając się, krzyknął: «W Imię Ojca', '2021-06-25, 23:29:36', 48, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6403, 'I Syna! tfu! mospanie Hrabia, czy waść zbojca?', '2021-06-26, 08:33:53', 7, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6404, 'Przebóg! czy się to zgadza z pana urodzeniem,', '2021-06-26, 08:34:55', 72, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6405, 'Wychowaniem i z pana na świecie znaczeniem?', '2021-06-26, 08:35:03', 3, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6406, 'Nie pozwolę skrzywdzić się!» Wtem Sędziego słudzy', '2021-06-26, 08:38:10', 34, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6407, 'Biegli, jedni z kijami, ze strzelbami drudzy;', '2021-06-26, 08:38:18', 40, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6408, 'Wojski, stojąc z daleka, poglądał ciekawie', '2021-06-26, 08:38:36', 98, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6409, 'W oczy panu Hrabiemu, a nóż miał w rękawie.', '2021-06-26, 08:40:57', 27, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6410, 'Już mieli zacząć bitwę, lecz Sędzia przeszkodził;', '2021-06-26, 08:41:16', 94, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6411, 'Próżno było bronić się, nowy wróg nadchodził:', '2021-06-26, 08:41:30', 81, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6412, 'Postrzeżono w olszynie blask, wystrzał rusznicy!', '2021-06-26, 08:41:35', 90, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6413, 'Most na rzece zahuczał tętentem konnicy', '2021-06-26, 08:41:37', 37, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6414, 'I «Hejże na Soplicę!» tysiąc głosów wrzasło.', '2021-06-26, 08:45:04', 46, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6415, 'Wzdrygnął się Sędzia: poznał Gerwazego hasło;', '2021-06-26, 14:45:11', 64, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6416, '«Nic to — zawołał Hrabia — będzie tu nas więcéj,', '2021-06-26, 14:49:37', 83, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6417, 'Poddaj się Sędzio, to są moi sprzymierzeńcy».', '2021-06-26, 14:49:51', 11, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6418, 'Wtem Asesor nadbiegał, krzycząc: «Areszt kładę', '2021-06-26, 14:54:00', 69, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6419, 'W imię Imperatorskiej Mości; oddaj szpadę,', '2021-06-26, 22:58:04', 16, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6420, 'Panie Hrabio, bo wezwę wojskowej pomocy,', '2021-06-26, 22:58:27', 69, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6421, 'A wiesz pan, że kto zbrojnie śmie napadać w nocy,', '2021-06-26, 23:01:28', 54, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6422, 'Zastrzeżono tysiącznym dwóchsetnym ukazem,', '2021-06-26, 23:01:42', 6, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6423, 'Że jak zło…» Wtem go Hrabia w twarz uderzył płazem.', '2021-06-26, 23:05:44', 70, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6424, 'Padł zgłuszony Asesor i skrył się w pokrzywy;', '2021-06-26, 23:06:53', 27, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6425, 'Wszyscy myśleli, że był ranny lub nieżywy.', '2021-06-27, 02:07:14', 71, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6426, '«Widzę — rzekł Sędzia — że się na rozbój zanosi».', '2021-06-27, 02:10:16', 68, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6427, 'Jęknęli wszyscy; wszystkich zagłuszył wrzask Zosi,', '2021-06-27, 02:10:38', 60, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6428, 'Która krzyczała, Sędzię objąwszy rękami,', '2021-06-27, 02:11:04', 31, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6429, 'Jako dziecko od Żydów kłute igiełkami.', '2021-06-27, 02:11:32', 71, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6430, 'Tymczasem Telimena wpadła między konie,', '2021-06-27, 02:11:43', 95, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6431, 'Wyciągnęła ku Hrabi załamane dłonie:', '2021-06-27, 02:11:51', 62, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6432, '«Na twój honor! — krzyknęła przeraźliwym głosem,', '2021-06-27, 04:14:52', 22, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6433, 'Z głową w tył wychyloną, z rozpuszczonym włosem —', '2021-06-27, 04:17:54', 92, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6434, 'Przez wszystko co jest świętym, na klęczkach błagamy!', '2021-06-27, 04:19:19', 13, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6435, 'Hrabio, śmieszże odmówić? proszą ciebie damy;', '2021-06-27, 10:23:25', 62, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6436, 'Okrutniku, nas pierwej musisz zamordować!»', '2021-06-27, 10:23:31', 77, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6437, 'Padła zemdlona. Hrabia skoczył ją ratować,', '2021-06-27, 10:27:51', 36, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6438, 'Zadziwiony i nieco zmieszany tą sceną:', '2021-06-27, 16:29:53', 72, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6439, '«Panno Zofio — rzecze — pani Telimeno!', '2021-06-27, 16:30:22', 4, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6440, 'Nigdy się krwią bezbronnych ta szpada nie splami;', '2021-06-27, 16:34:40', 34, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6441, 'Soplicowie! jesteście moimi więźniami.', '2021-06-27, 16:34:43', 40, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6442, 'Tak zrobiłem we Włoszech, kiedy pod opoką,', '2021-06-27, 16:38:48', 23, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6443, 'Którą Sycylianie zwą Birbante-rokką,', '2021-06-27, 16:43:11', 94, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6444, 'Zdobyłem tabor zbójców: zbrojnych mordowałem,', '2021-06-27, 16:47:37', 42, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6445, 'Rozbrojonych zabrałem i związać kazałem;', '2021-06-27, 16:50:51', 73, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6446, 'Szli za końmi i tryumf mój zdobili świetny,', '2021-06-27, 16:50:59', 42, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6447, 'Potem ich powieszono u podnóża Etny».', '2021-06-27, 18:53:06', 65, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6448, 'Było to osobliwsze szczęście dla Sopliców,', '2021-06-27, 18:53:31', 23, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6449, 'Że Hrabia, mając lepsze konie od szlachciców', '2021-06-27, 18:57:39', 39, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6450, 'I chcąc spotkać się pierwszy, zostawił ich w tyle', '2021-06-27, 21:00:46', 39, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6451, 'I biegł przed resztą jazdy, przynajmniej o milę,', '2021-06-27, 21:01:10', 54, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6452, 'Ze swym dżokejstwem, które posłuszne i karne,', '2021-06-27, 21:01:36', 87, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6453, 'Stanowiło niejako wojsko regularne;', '2021-06-27, 21:01:42', 29, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6454, 'Gdy inna szlachta była, zwyczajem powstania,', '2021-06-27, 21:01:46', 59, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6455, 'Burzliwa i niezmiernie skora do wieszania.', '2021-06-27, 21:02:10', 51, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6456, 'Hrabia miał czas ostygnąć z zapału i gniewu,', '2021-06-28, 00:02:32', 54, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6457, 'Przemyślał, jakby skończyć bój bez krwi rozlewu;', '2021-06-28, 00:06:45', 80, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6458, 'Więc rodzinę Sopliców w domu zamknąć każe', '2021-06-28, 00:07:11', 69, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6459, 'Jako więźniów wojennych; u drzwi stawi straże.', '2021-06-28, 00:07:27', 4, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6460, 'Wtem «Hejże na Sopliców!» Wpada szlachta hurmem,', '2021-06-28, 00:11:41', 67, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6461, 'Obstępuje dwór wkoło i bierze go szturmem,', '2021-06-28, 00:12:03', 58, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6462, 'Tym łacniej, że wódz wzięty i pierzchła załoga;', '2021-06-28, 00:12:19', 73, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6463, 'Lecz zdobywcy chcą bić się, wyszukują wroga.', '2021-06-28, 00:13:28', 91, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6464, 'Do domu niewpuszczeni biegą do folwarków,', '2021-06-28, 00:13:50', 46, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6465, 'Do kuchni. Gdy do kuchni weszli, widok garków,', '2021-06-28, 00:17:56', 2, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6466, 'Ogień ledwie zagasły, potraw zapach świeży,', '2021-06-28, 00:18:16', 18, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6467, 'Chrupanie psów gryzących ostatki wieczerzy,', '2021-06-28, 00:18:44', 10, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6468, 'Chwyta wszystkich za serca, myśl wszystkich odmienia,', '2021-06-28, 03:19:06', 8, 5, false);
