INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6567, 'O niebezpieczeństwach wynikających z nieporządnego obozowania — Odsiecz niespodziana — Smutne położenie szlachty — Odwiedziny kwestarskie są wróżbą ratunku — Major Płut zbytnią zalotnością ściąga na siebie burzę — Wystrzał z krócicy, hasło boju — Czyny Kropiciela, czyny i niebezpieczeństwa Maćka — Konewka zasadzką ocala Soplicowo — Posiłki jezdne, atak na piechotę — Czyny Tadeusza — Pojedynek dowódców przerwany zdradą — Wojski stanowczym manewrem przechyla szalę boju — Czyny krwawe Gerwazego — Podkomorzy zwycięzca wspaniałomyślny.', '2021-07-01, 16:25:49', 77, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6568, 'A chrapali tak twardym snem, że ich nie budzi', '2021-07-01, 16:26:07', 81, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6569, 'Blask latarek i wniście kilkudziesiąt ludzi,', '2021-07-01, 16:26:16', 37, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6570, 'Którzy wpadli na szlachtę jak pająki ścienne,', '2021-07-01, 16:26:24', 30, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6571, 'Nazwane *kosarzami*, na muchy wpółsenne:', '2021-07-01, 16:29:49', 77, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6572, 'Zaledwie która bzyknie, już długimi nogi', '2021-07-01, 16:29:51', 81, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6573, 'Obejmuje ją wkoło i dusi mistrz srogi.', '2021-07-01, 16:30:14', 96, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6574, 'Sen szlachecki był jeszcze twardszy niż sen muszy:', '2021-07-01, 16:34:29', 4, 12, false);
