INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6578, 'Tylko jeden Konewka, któremu w powiecie', '2021-07-01, 16:35:20', 28, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6579, 'Nie znajdziesz równie mocnej głowy przy bankiecie,', '2021-07-01, 21:35:28', 78, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6580, 'Konewka, co mógł wypić lipcu dwa antały', '2021-07-01, 21:35:56', 88, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6581, 'Nim mu splątał się język i nogi zachwiały:', '2021-07-01, 21:36:05', 29, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6582, 'Ten, choć długo ucztował i usnął głęboko,', '2021-07-01, 21:36:22', 62, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6583, 'Dawał przecie znak życia. Przemknął jedno oko', '2021-07-01, 21:38:33', 45, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6584, 'I widzi… istne zmory! Dwie okropne twarze', '2021-07-01, 21:38:33', 13, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6585, 'Tuż nad sobą, a każda ma wąsów po parze,', '2021-07-01, 21:39:54', 37, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6586, 'Dyszą nad nim, ust jego tykają wąsami,', '2021-07-01, 21:40:10', 29, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6587, 'I czworgiem rąk wokoło wiją jak skrzydłami.', '2021-07-01, 21:40:28', 10, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6588, 'Zląkł się, chciał przeżegnać się: darmo rękę chwyta,', '2021-07-01, 21:42:35', 82, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6589, 'Ręka prawa jak gdyby do boku przybita;', '2021-07-01, 21:42:36', 3, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6590, 'Ruszył lewą: niestety! czuje, że go duchy', '2021-07-01, 21:42:38', 40, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6591, 'Spowiły ciasno jako niemowlę w pieluchy.', '2021-07-01, 21:42:40', 42, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6592, 'Zląkł się jeszcze okropniej, wnet oko zawiera,', '2021-07-01, 21:42:42', 6, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6593, 'Leży nie dysząc, stygnie, ledwie nie umiera!', '2021-07-02, 04:46:47', 35, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6594, 'Lecz Kropiciel zerwał się bronić się: po czasie!', '2021-07-02, 04:46:57', 76, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6595, 'Bo już był skrępowany we swym własnym pasie.', '2021-07-02, 04:47:12', 38, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6596, 'Przecież zwinął się i tak sprężyście podskoczył,', '2021-07-02, 04:47:15', 43, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6597, 'Że padł na piersi sennych, po głowach się toczył,', '2021-07-02, 04:51:28', 82, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6598, 'Miotał się jako szczupak, gdy się w piasku rzuca,', '2021-07-02, 04:51:56', 56, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6599, 'A ryczał jako niedźwiedź, bo miał silne płuca.', '2021-07-02, 04:52:08', 27, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6600, 'Ryczał: «Zdrada!» — Wnet cała zbudzona gromada', '2021-07-02, 04:53:22', 71, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6601, 'Chórem odpowiedziała: «Zdrada! gwałtu! zdrada!»', '2021-07-02, 04:54:30', 11, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6602, 'Krzyk dochodzi echami zwierciadlanej sali,', '2021-07-02, 04:54:36', 55, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6603, 'Kędy Hrabia, Gerwazy i dżokeje spali.', '2021-07-02, 04:57:57', 4, 1, false);
