INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6606, 'Patrzy: widzi przy oknie ludzi uzbrojonych,', '2021-07-02, 14:04:44', 32, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6607, 'W czarnych krótkich kaszkietach, w mundurach zielonych.', '2021-07-02, 14:08:56', 93, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6608, 'Jeden z nich, opasany szarfą, trzymał szpadę', '2021-07-02, 14:09:13', 3, 19, false);
