INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6610, 'Szepcąc: «Wiąż! wiąż!» Dokoła leżą jak barany', '2021-07-02, 14:09:45', 88, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6611, 'Dżokeje w pętach; Hrabia siedzi niezwiązany', '2021-07-02, 23:09:57', 37, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6612, 'Lecz bezbronny; przy nim dwaj z gołymi bagnety', '2021-07-02, 23:11:58', 11, 15, false);
