INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6618, 'Rwania więzów, był silny bardzo, ufał sobie.', '2021-07-02, 23:19:35', 60, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6619, 'Przemyślał ratować się milczkiem. Oczy zmrużył,', '2021-07-03, 07:23:02', 56, 14, false);
