INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6621, 'Dech wciągnął, brzuch i piersi ścisnął co najwężéj:', '2021-07-03, 07:23:32', 54, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6622, 'Aż jednym razem kurczy, wydyma się, pręży;', '2021-07-03, 07:25:41', 23, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6623, 'Jak wąż głowę i ogon gdy chowa w przeguby,', '2021-07-03, 07:25:47', 62, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6624, 'Tak Gerwazy z długiego stał się krótki, gruby;', '2021-07-03, 07:26:05', 81, 7, false);
