INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6627, 'Przewrócił się i w ziemię schowawszy twarz gniewną,', '2021-07-03, 07:31:14', 1, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6628, 'Zamknąwszy oczy, leżał nieczuły jak drewno.', '2021-07-03, 07:31:16', 33, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6629, 'Wtem ozwały się bębny; naprzód z rzadka, potem', '2021-07-03, 09:31:16', 37, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6630, 'Coraz gęstszym i coraz głośniejszym łoskotem.', '2021-07-03, 09:34:29', 33, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6631, 'Na ten apel rozkazał oficer Moskali,', '2021-07-03, 09:34:52', 47, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6632, 'Dżokejów z Hrabią zamknąć pod strażą na sali,', '2021-07-03, 09:34:54', 19, 18, false);
