INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6636, 'Podhajscy, Birbaszowie, Hreczechy, Biergele,', '2021-07-03, 10:40:47', 41, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6637, 'Wszyscy Sędziego krewni albo przyjaciele;', '2021-07-03, 10:40:59', 15, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6638, 'Na odsiecz mu przybiegli słysząc o napadzie,', '2021-07-03, 10:44:08', 50, 8, false);
