INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6641, 'Kto tak prędko sąsiedztwo z zaścianków zgromadził?', '2021-07-03, 10:44:55', 83, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6642, 'Asesor li, czy Jankiel? Różnie słychać o tem,', '2021-07-03, 10:46:14', 36, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6643, 'Lecz nikt pewnie nie wiedział ni wtenczas, ni potem.', '2021-07-03, 10:46:17', 25, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6644, 'Już też i słońce wschodzi, krwawo się czerwieni;', '2021-07-03, 18:46:19', 46, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6645, 'Brzegiem tępym, jak gdyby odartym z promieni,', '2021-07-03, 18:47:40', 28, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6646, 'Na wpół widne, na poły w czerni chmur się chowa,', '2021-07-03, 18:48:56', 88, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6647, 'Jak rozżarzona w węglach kowalskich podkowa.', '2021-07-03, 18:51:05', 46, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6648, 'Wiatr wzmagał się i pędził obłoki ze wschodu,', '2021-07-03, 18:51:31', 14, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6649, 'Gęste i poszarpane jako bryły lodu;', '2021-07-03, 18:53:54', 27, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6650, 'Każdy obłok w przelocie deszczem zimnym prószy,', '2021-07-03, 18:56:54', 86, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6651, 'Z tyłu za nim wiatr leci i deszcz znowu suszy,', '2021-07-03, 18:59:06', 32, 8, false);
