INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6655, 'Każe wlec, w każdej belce wysiekać toporem', '2021-07-03, 23:05:36', 96, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6656, 'Półokrągłe otwory, w te otwory wtyka', '2021-07-03, 23:07:50', 58, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6657, 'Nogi więźniów i drugą belką je zamyka:', '2021-07-03, 23:10:58', 59, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6658, 'Oba drewna, gwoździami przebite po rogach,', '2021-07-03, 23:10:59', 15, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6659, 'Ścisnęły się jako psie paszczęki na nogach;', '2021-07-03, 23:11:20', 17, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6660, 'Zaś powrozami mocniej sznurowano ręce', '2021-07-04, 01:11:42', 60, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6661, 'Na plecach szlachty. Major ku większej ich męce', '2021-07-04, 01:12:07', 30, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6662, 'Kazał pierwej pozdzierać z głów konfederatki,', '2021-07-04, 01:14:07', 94, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6663, 'Z pleców płaszcze, kontusze, nawet taratatki,', '2021-07-04, 01:14:12', 14, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6664, 'Nawet żupany. I tak szlachta skuta w kłodzie', '2021-07-04, 01:15:20', 65, 9, false);
