INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6666, 'I na deszczu, bo coraz wzmagała się słota.', '2021-07-04, 01:18:08', 9, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6667, 'Nadaremnie Kropiciel dąsa się i miota.', '2021-07-04, 01:18:17', 72, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6668, 'Darmo Sędzia za szlachtą instancję wnosi,', '2021-07-04, 01:21:33', 58, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6669, 'I Telimena łączy prośby do łez Zosi,', '2021-07-04, 01:24:50', 43, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6670, 'Ażeby miano większy wzgląd na niewolników.', '2021-07-04, 01:24:52', 50, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6671, 'Wprawdzie oficer rotny, pan Nikita Ryków,', '2021-07-04, 01:27:04', 26, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6672, 'Moskal, lecz dobry człowiek, dał się udobruchać:', '2021-07-04, 01:27:08', 35, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6673, 'Cóż, kiedy sam majora Płuta musiał słuchać.', '2021-07-04, 04:27:19', 6, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6674, 'Ten Major, Polak rodem z miasteczka Dzierowicz,', '2021-07-04, 04:31:43', 68, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6675, 'Nazywał się (jak słychać) po polsku Płutowicz,', '2021-07-04, 04:33:53', 93, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6676, 'Lecz przechrzcił się; łotr wielki, jak się zwykle dzieje', '2021-07-04, 04:34:08', 13, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6677, 'Z Polakiem, który w carskiej służbie zmoskwicieje.', '2021-07-04, 04:34:11', 60, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6678, 'Płut stał z fajką przed frontem, w boki się podpierał', '2021-07-04, 04:34:29', 85, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6679, 'I gdy mu kłaniano się, nos w górę zadzierał,', '2021-07-04, 08:36:43', 10, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6680, 'A za odpowiedź, na znak gniewnego humoru', '2021-07-04, 08:39:48', 30, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6681, 'Wypuścił z ust kłąb dymu i poszedł do dworu.', '2021-07-04, 08:42:03', 69, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6682, 'A tymczasem Rykowa Sędzia ułagadza,', '2021-07-04, 08:42:24', 18, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6683, 'I Asesora także na bok odprowadza;', '2021-07-04, 08:42:25', 38, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6684, 'Przemyślają, jak by rzecz zakończyć bez sądu,', '2021-07-04, 08:42:53', 74, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6685, 'A co jeszcze ważniejsza, bez mieszań się rządu.', '2021-07-04, 08:45:11', 80, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6686, 'Więc do majora Płuta rzekł kapitan Ryków:', '2021-07-04, 08:46:12', 75, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6687, '«Panie Major! co nam z tych wszystkich niewolników?', '2021-07-04, 08:46:31', 93, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6688, 'Oddamy pod sąd? będzie szlachcie wielka bieda,', '2021-07-04, 08:46:58', 49, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6689, 'A panu Majorowi nikt za to nic nie da.', '2021-07-04, 08:50:01', 34, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6690, 'Wiesz co Major? ot lepiej tę sprawę zagodzić,', '2021-07-04, 08:53:25', 50, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6691, 'Pan Sędzia Majorowi musi trud nagrodzić,', '2021-07-04, 08:57:35', 25, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6692, 'My powiemy, że my tu przyszli dla wizyty,', '2021-07-04, 08:59:58', 79, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6693, 'A tak i kozy całe i wilk będzie syty.', '2021-07-04, 09:04:09', 36, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6694, 'Przysłowie ruskie: wszystko można, lecz ostrożnie;', '2021-07-04, 09:04:24', 19, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6695, 'I to przysłowie: sobie piecz na carskim rożnie;', '2021-07-04, 09:04:42', 44, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6696, 'I to przysłowie: lepsza zgoda od niezgody,', '2021-07-04, 09:04:55', 90, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6697, 'Zaplątaj dobrze węzeł, końce wsadź do wody.', '2021-07-04, 09:05:09', 84, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6698, 'Raportu nie podamy, tak się nikt nie dowie.', '2021-07-04, 09:08:12', 38, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6699, 'Bóg dał ręce żeby brać: to ruskie przysłowie».', '2021-07-04, 09:08:26', 17, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6700, 'Słysząc to Major wstaje i od gniewu parska:', '2021-07-04, 09:10:44', 40, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6701, '«Czy ty oszalał, Ryków? To służba cesarska:', '2021-07-04, 09:11:04', 25, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6702, 'A służba nie jest drużba, stary, głupi Ryków!', '2021-07-04, 09:15:31', 88, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6703, 'Czy ty oszalał? Ja mam puszczać buntowników!', '2021-07-04, 09:15:36', 3, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6704, 'W takim wojennym czasie! Ha, pany Polaki,', '2021-07-04, 09:16:00', 21, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6705, 'Ja was nauczę buntu! Ha, szlachta łajdaki,', '2021-07-04, 09:18:22', 70, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6706, 'Dobrzyńscy, oj ja znam was, niech łajdaki mokną!', '2021-07-04, 15:18:28', 21, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6707, '(I zaśmiał się na całe gardło, patrząc w okno)', '2021-07-04, 15:18:28', 7, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6708, 'Wszakże ten sam Dobrzyński, co siedzi w surducie,', '2021-07-04, 15:18:50', 37, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6709, '— Hej zdjąć mu surdut! — w roku przeszłym na reducie', '2021-07-04, 15:19:14', 56, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6710, 'Zaczął ze mną tę kłótnię; kto zaczął? on, nie ja.', '2021-07-04, 15:23:30', 13, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6711, 'On, gdy tańczyłem, krzyknął: »Precz za drzwi złodzieja!«', '2021-07-04, 15:23:30', 16, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6712, 'Że wtenczas za pułkowej okradzenie kasy', '2021-07-04, 15:25:38', 33, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6713, 'Byłem pod śledztwem, miałem wielkie ambarasy:', '2021-07-04, 22:25:46', 9, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6714, 'A jemu co do tego? Ja tańczę mazura,', '2021-07-04, 22:28:03', 28, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6715, 'On krzyczy z tyłu: »Złodziej!« szlachta za nim: »Ura!«', '2021-07-04, 22:28:13', 89, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6716, 'Skrzywdzili mnie — a co? wpadł w me szpony szlachciura!', '2021-07-04, 22:30:36', 86, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6717, 'Mówiłem: »Ej Dobrzyński! ej, przyjdzie do woza', '2021-07-04, 22:30:41', 29, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6718, 'Koza« — a co, Dobrzyński? widzisz: będzie łoza!»', '2021-07-04, 22:30:59', 23, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6719, 'Potem Sędziemu szepnął, schyliwszy się w ucho:', '2021-07-04, 22:35:17', 37, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6720, '«Jeśli chcesz Sędzio, żeby to uszło na sucho,', '2021-07-04, 22:35:40', 17, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6721, 'Za każdą głowę tysiąc rubelków gotówką:', '2021-07-05, 04:35:47', 1, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6722, 'Tysiąc rubelków Sędzio, to ostatnie słówko».', '2021-07-05, 04:37:51', 64, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6723, 'Sędzia chciał targować się; lecz Major nie słuchał,', '2021-07-05, 04:39:05', 12, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6724, 'Znowu biegał po izbie, dymem gęsto buchał,', '2021-07-05, 04:40:24', 59, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6725, 'Podobny do szmermelu albo do rakiety.', '2021-07-05, 04:40:29', 56, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6726, 'Chodziły za nim prosząc i płacząc kobiety.', '2021-07-05, 04:44:49', 55, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6727, '«Majorze — mówił Sędzia — choć pozwiesz do prawa;', '2021-07-05, 04:46:11', 13, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6728, 'Cóż wygrasz? Tu nie zaszła żadna bitwa krwawa,', '2021-07-05, 04:50:20', 99, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6729, 'Nie było ran; że zjedli kury i półgąski,', '2021-07-05, 04:51:35', 62, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6730, 'Za to wedle statutu zapłacą nawiązki.', '2021-07-05, 04:52:00', 3, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6731, 'Ja na pana Hrabiego nie zanoszę skargi;', '2021-07-05, 04:54:22', 49, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6732, 'To tylko były zwykłe sąsiedzkie zatargi».', '2021-07-05, 04:54:41', 39, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6733, '«A czy Sędzia — rzekł Major — żółtą księgę czytał?»', '2021-07-05, 04:54:57', 2, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6734, '«Co to za żółta księga?» pan Sędzia zapytał.', '2021-07-05, 11:55:04', 33, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6735, '«Księga — rzekł Major — lepsza niż wasze statuty,', '2021-07-05, 11:55:24', 77, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6736, 'A w niej pisze co słowo: stryczek, Sybir, knuty;', '2021-07-05, 11:55:42', 13, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6737, 'Księga ustaw wojennych, teraz w Litwie całéj', '2021-07-05, 11:56:49', 92, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6738, 'Ogłoszonych: już pod stół wasze trybunały!', '2021-07-05, 11:56:53', 22, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6739, 'Podług ustaw wojennych, za takową psotę,', '2021-07-05, 11:58:18', 79, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6740, 'Pójdziecie już to najmniej w sybirną robotę».', '2021-07-05, 11:58:22', 2, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6741, '«Apeluję — rzekł Sędzia — do gubernatora».', '2021-07-05, 12:02:41', 32, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6742, '«Apeluj — rzekł Płut — choćby do Imperatora.', '2021-07-05, 12:07:05', 9, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6743, 'Wiesz, że gdy imperator zatwierdza ukazy,', '2021-07-05, 12:08:34', 31, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6744, 'Z łaski swej często karę powiększa dwa razy.', '2021-07-05, 12:12:47', 14, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6745, 'Apelujcie, ja może wynajdę w potrzebie,', '2021-07-05, 12:14:10', 98, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6746, 'Mospanie Sędzio, dobry kruczek i na ciebie.', '2021-07-05, 16:16:23', 42, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6747, 'Wszak Jankiel, szpieg, którego już rząd dawno śledzi,', '2021-07-05, 16:20:25', 33, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6748, 'Jest twoim domownikiem, w karczmie twojej siedzi.', '2021-07-05, 16:20:34', 57, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6749, 'Mogę teraz was wszystkich wziąć w areszt od razu».', '2021-07-05, 16:21:02', 17, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6750, '«Mnie — rzekł Sędzia — brać w areszt? jak śmiesz bez rozkazu?»', '2021-07-05, 16:21:13', 53, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6751, 'I przychodziło coraz do żywszego sporu:', '2021-07-05, 16:23:38', 48, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6752, 'Gdy nowy gość zajechał na dziedziniec dworu.', '2021-07-05, 16:23:40', 95, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6753, 'Wjazd tłumny, dziwny. Przodem, niby laufer, bieży', '2021-07-05, 16:23:46', 60, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6754, 'Ogromny czarny baran, a łeb mu się jeży', '2021-07-05, 16:27:49', 1, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6755, 'Czterema rogami, z których dwa jako kabłąki', '2021-07-05, 16:27:59', 43, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6756, 'Kręcą się koło uszu, ubrane we dzwonki,', '2021-07-05, 16:31:12', 7, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6757, 'A dwa od czoła na bok wysuwając końce,', '2021-07-05, 16:31:28', 98, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6758, 'Wstrząsają kulki krągłe, mosiężne, brzęczące.', '2021-07-05, 16:35:42', 69, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6759, 'Za baranem szły woły, trzoda owiec, kozy,', '2021-07-05, 20:38:52', 89, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6760, 'Za bydłem cztery ciężko pakowane wozy.', '2021-07-05, 20:42:56', 79, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6761, 'Wszyscy odgadli, że to wjazd księdza kwestarza.', '2021-07-05, 20:46:18', 61, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6762, 'Więc pan Sędzia, powinność znając gospodarza,', '2021-07-05, 20:49:46', 48, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6763, 'Stał w progu witać gościa. Ksiądz na pierwszej bryce', '2021-07-05, 20:50:04', 81, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6764, 'Jechał, kapturem na wpół zasłoniwszy lice,', '2021-07-05, 20:50:29', 61, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6765, 'Ale go wnet poznano: bo gdy więźniów minął,', '2021-07-05, 20:50:30', 69, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6766, 'Zwrócił się ku nim twarzą, palcem na znak skinął.', '2021-07-05, 20:51:31', 2, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6767, 'I drugiej bryki furman równie był poznany:', '2021-07-05, 20:51:44', 57, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6768, 'Stary Maciek-Rózeczka, za chłopa przebrany.', '2021-07-05, 20:51:57', 25, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6769, 'Szlachta zaczęła krzyczeć, skoro się pokazał,', '2021-07-05, 20:54:16', 99, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6770, 'On rzekł: «Głupi!» … i ręką milczenie nakazał.', '2021-07-05, 20:54:22', 71, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6771, 'Na trzecim wozie Prusak w kubraku wytartym,', '2021-07-05, 20:56:39', 44, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6772, 'A pan Zan z Mickiewiczem jechali na czwartym.', '2021-07-05, 22:56:40', 19, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6773, 'A tymczasem, Podhajscy i Isajewicze,', '2021-07-05, 22:58:45', 24, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6774, 'Birbasze, Wilbikowie, Biergiele, Kotwicze,', '2021-07-05, 23:00:59', 82, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6775, 'Widząc szlachtę Dobrzyńskich w tej ciężkiej niewoli,', '2021-07-05, 23:01:59', 73, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6776, 'Zaczęli z dawnych gniewów ostygać powoli:', '2021-07-05, 23:02:17', 21, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6777, 'Bo szlachta polska, chociaż niezmiernie kłótliwa', '2021-07-05, 23:06:30', 87, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6778, 'I porywcza do bitew, przecież nie jest mściwa.', '2021-07-05, 23:06:54', 61, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6779, 'Biega więc do Macieja starego po radę.', '2021-07-05, 23:07:10', 35, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6780, 'On koło wozów całą ustawia gromadę,', '2021-07-05, 23:08:31', 93, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6781, 'Każe czekać.', '2021-07-05, 23:08:33', 61, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6782, 'Bernardyn wstąpił do pokoju.', '2021-07-05, 23:08:51', 76, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6783, 'Zaledwie go poznano, choć nie zmienił stroju:', '2021-07-05, 23:13:09', 40, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6784, 'Tak przybrał inną postać. Zwyczajnie ponury,', '2021-07-05, 23:13:35', 83, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6785, 'Zamyślony: a teraz głowę wzniósł do góry,', '2021-07-06, 00:17:39', 91, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6786, 'I z miną rozjaśnioną, jak kwestarz rubacha,', '2021-07-06, 00:21:52', 65, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6787, 'Nim zaczął gadać, długo śmiał się:', '2021-07-06, 00:21:55', 93, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6788, '«Cha, cha, cha, cha,', '2021-07-06, 00:22:22', 52, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6789, 'Kłaniam, kłaniam! Cha, cha, cha, wyśmienicie, przednie!', '2021-07-06, 00:22:48', 94, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6790, 'Panowie oficery, kto poluje we dnie,', '2021-07-06, 03:22:48', 61, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6791, 'Wy w nocy! Dobry połów: widziałem zwierzynę;', '2021-07-06, 03:23:12', 15, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6792, 'Oj skubać, skubać szlachtę, oj drzeć z nich łupinę!', '2021-07-06, 03:25:34', 65, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6793, 'Oj weźcież ich na munsztuk, bo też szlachta bryka!', '2021-07-06, 03:29:43', 17, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6794, 'Winszuję ci Majorze, żeś złowił Hrabika:', '2021-07-06, 03:29:57', 27, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6795, 'To tłuścioszek, to bogacz, panicz z antenatów;', '2021-07-06, 03:34:09', 38, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6796, 'Nie wypuszczaj go z klatki bez trzysta dukatów.', '2021-07-06, 03:37:14', 63, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6797, 'A jak weźmiesz, na klasztor daj jakie trzy grosze,', '2021-07-06, 03:37:18', 18, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6798, 'I dla mnie! bo ja zawżdy za twą duszę proszę.', '2021-07-06, 07:37:19', 7, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6799, 'Jakem bernardyn, bardzo myślę o twej duszy!', '2021-07-06, 07:39:22', 85, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6800, 'Śmierć i sztabsoficerów porywa za uszy!', '2021-07-06, 07:39:39', 75, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6801, 'Dobrze napisał Baka, że śmierć dżga za katy', '2021-07-06, 07:40:05', 99, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6802, 'W szkarłaty, i po suknie nieraz dobrze stuknie,', '2021-07-06, 07:40:10', 27, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6803, 'I po płótnie tak utnie jak i po kapturze,', '2021-07-06, 07:42:18', 54, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6804, 'I po fryzurze równie jak i po mundurze.', '2021-07-06, 07:42:31', 62, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6805, 'Śmierć matula, powiada Baka, jak cebula,', '2021-07-06, 07:42:48', 13, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6806, 'Łzy wyciska, gdy ściska, a równie przytula', '2021-07-06, 07:42:48', 30, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6807, 'I dziecko co się lula, i zucha co hula!', '2021-07-06, 07:45:00', 31, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6808, 'Ach! ach! Majorze, dzisiaj żyjem, jutro gnijem,', '2021-07-06, 07:48:24', 61, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6809, 'To tylko nasze, co dziś zjemy i wypijem!', '2021-07-06, 14:48:28', 65, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6810, 'Panie Sędzio, wszakże to czas podobno śniadać?', '2021-07-06, 14:48:55', 11, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6811, 'Siadam za stół, i proszę wszystkich za mną siadać', '2021-07-06, 14:48:57', 12, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6812, 'Majorze, gdyby zrazów? panie poruczniku,', '2021-07-06, 14:50:20', 7, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6813, 'Co myślisz? gdyby wazę dobrego ponczyku?»', '2021-07-06, 14:52:38', 90, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6814, '«To prawda ojcze — rzekli dwaj oficerowie —', '2021-07-06, 14:52:41', 31, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6815, 'Czas by już zjeść i wypić pana Sędzi zdrowie!»', '2021-07-06, 14:53:07', 10, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6816, 'Zdziwili się domowi, patrząc na Robaka,', '2021-07-06, 14:56:28', 31, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6817, 'Skąd mu się wzięła mina i wesołość taka.', '2021-07-06, 14:58:57', 16, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6818, 'Sędzia wnet kucharzowi powtórzył rozkazy:', '2021-07-06, 14:59:18', 79, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6819, 'Wniesiono wazę, cukier, butelki i zrazy.', '2021-07-06, 21:59:39', 90, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6820, 'Płut i Ryków tak czynnie zaczęli się zwijać,', '2021-07-07, 03:03:54', 95, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6821, 'Tak łakomie połykać i gęsto zapijać,', '2021-07-07, 03:04:20', 19, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6822, 'Że w pół godziny zjedli dwadzieścia trzy zrazy', '2021-07-07, 03:04:30', 36, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6823, 'I wychylili ponczu ogromne pół wazy.', '2021-07-07, 03:04:34', 47, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6824, 'Więc Major syt i wesół w krześle się rozwalił,', '2021-07-07, 03:05:00', 33, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6825, 'Dobył fajkę, biletem bankowym zapalił,', '2021-07-07, 03:05:11', 96, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6826, 'I otarłszy śniadanie z ust końcem serwety,', '2021-07-07, 03:09:22', 23, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6827, 'Obrócił śmiejące się oczy na kobiety,', '2021-07-07, 03:11:31', 63, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6828, 'I rzekł: «Ja, piękne panie, lubię was jak wety!', '2021-07-07, 03:11:39', 14, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6829, 'Na me szlify majorskie: gdy człek zjadł śniadanie,', '2021-07-07, 03:12:05', 16, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6830, 'Najlepszą jest po zrazach zakąską gadanie', '2021-07-07, 03:12:30', 68, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6831, 'Z paniami tak pięknymi jak wy, piękne panie!', '2021-07-07, 03:12:37', 7, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6832, 'Wiecie co? grajmy w karty? w welba-cwelba? w wista?', '2021-07-07, 03:12:43', 47, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6833, 'Albo pójdźmy mazurka? he! do diabłów trzysta!', '2021-07-07, 03:13:05', 8, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6834, 'Wszak ja w jegerskim pułku pierwszy mazurzysta!»', '2021-07-07, 04:13:09', 66, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6835, 'Za czym ku damom bliżej chylił się wygięty,', '2021-07-07, 11:13:15', 66, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6836, 'I puszczał na przemiany dym i komplementy.', '2021-07-07, 15:13:38', 36, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6837, '«Tańczyć! — zawołał Robak — gdy wychylę flaszę,', '2021-07-07, 15:13:52', 74, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6838, 'To i ja, choć ksiądz, habit czasami podkaszę', '2021-07-07, 15:17:52', 68, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6839, 'I potańczę mazurka! Ale wiesz, Majorze,', '2021-07-07, 15:20:53', 51, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6840, 'My tu pijem, a jegry tam zmarzną na dworze?', '2021-07-07, 15:20:57', 51, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6841, 'Hulać to hulać! Sędzio, daj beczkę siwuchy:', '2021-07-07, 15:21:07', 2, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6842, 'Major pozwoli, niechaj piją jegry zuchy!»', '2021-07-07, 15:21:19', 2, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6843, '«Prosiłbym — rzecze Major — lecz w tym nie ma musu».', '2021-07-07, 16:24:41', 40, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6844, '«Daj Sędzio — szepnął Robak — beczkę spirytusu».', '2021-07-07, 16:26:10', 62, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6845, 'I tak, kiedy we dworze sztab wesoły łyka,', '2021-07-07, 16:26:34', 24, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6846, 'Za domem zaczęła się w wojsku pijatyka.', '2021-07-08, 01:26:52', 25, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6847, 'Ryków kapitan milczkiem kielichy wychylał,', '2021-07-08, 01:27:08', 52, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6848, 'Lecz Major pił i razem damom się przymilał.', '2021-07-08, 01:27:33', 23, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6849, 'A wzmagał się w nim coraz tańcowania zapał.', '2021-07-08, 01:27:33', 91, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6850, 'Rzucił fajkę i rękę Telimeny złapał:', '2021-07-08, 01:27:46', 15, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6851, 'Chciał tańczyć, lecz uciekła; więc podszedł do Zosi,', '2021-07-08, 01:28:05', 77, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6852, 'Kłaniając się, słaniając, do mazurka prosi:', '2021-07-08, 01:28:24', 21, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6853, '«Hej ty, Ryków, przestańże tam trąbić na fajce;', '2021-07-08, 01:30:41', 7, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6854, 'Precz fajka, wszak ty dobrze grasz na bałabajce.', '2021-07-08, 03:30:57', 92, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6855, 'Widzisz no tam gitarę, pódź no, weź gitarę', '2021-07-08, 03:31:16', 5, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6856, 'I mazurka! Ja, Major, idę w pierwszą parę».', '2021-07-08, 03:35:17', 77, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6857, 'Kapitan wziął gitarę i struny przykręcał,', '2021-07-08, 03:35:33', 2, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6858, 'Płut znowu Telimenę do tańca zachęcał.', '2021-07-08, 03:35:40', 99, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6859, '«Słowo majorskie, panno: nie Rosyjaninem', '2021-07-08, 03:35:53', 76, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6860, 'Jestem, jeżeli kłamię; chcę być sukinsynem,', '2021-07-08, 03:36:19', 34, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6861, 'Jeżeli kłamię: spytaj, a oficerowie', '2021-07-08, 03:40:36', 74, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6862, 'Wszyscy poświadczą, cała armija to powie:', '2021-07-08, 03:41:04', 47, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6863, 'Że w tej drugiej armiji, w korpusie dziewiątym,', '2021-07-08, 03:41:30', 15, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6864, 'W drugiej pieszej dywizji, w pułku pięćdziesiątym', '2021-07-08, 03:44:45', 81, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6865, 'Jegerskim, major Płut jest pierwszy mazurzysta.', '2021-07-08, 03:45:45', 16, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6866, 'Pódźże panienko! nie bądź taka narowista!', '2021-07-08, 03:46:03', 12, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6867, 'Bo ja po oficersku ukarzę panienkę…»', '2021-07-08, 06:47:21', 67, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6868, 'To mówiąc skoczył, chwycił Telimeny rękę,', '2021-07-08, 06:47:42', 29, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6869, 'I szerokim całusem w blade ramię klasnął;', '2021-07-08, 06:47:50', 91, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6870, 'Gdy Tadeusz, przypadłszy z boku, w twarz mu trzasnął.', '2021-07-08, 06:48:04', 24, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6871, 'I całus, i policzek ozwały się razem,', '2021-07-08, 06:48:33', 20, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6872, 'Jeden za drugim, jako wyraz za wyrazem.', '2021-07-08, 06:51:39', 6, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6873, 'Major osłupiał, oczy przetarł, z gniewu blady', '2021-07-08, 06:51:54', 79, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6874, 'Zawołał: «Bunt! buntownik!» i dobywszy szpady,', '2021-07-08, 08:53:20', 51, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6875, 'Biegł przebić. Wtem ksiądz dostał z rękawa krócicę:', '2021-07-08, 08:53:35', 53, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6876, '«Pal, Tadeuszku! — krzyknął — pal jak w jasną świécę!»', '2021-07-08, 08:53:35', 10, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6877, 'Tadeusz wnet pochwycił, wymierzył, wypalił,', '2021-07-08, 08:53:35', 39, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6878, 'Chybił, ale Majora zgłuszył i osmalił.', '2021-07-08, 08:54:50', 30, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6879, 'Porywa się z gitarą Ryków: «Bunt! bunt!» woła,', '2021-07-08, 08:55:10', 6, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6880, 'Wpada na Tadeusza; lecz Wojski zza stoła', '2021-07-08, 08:57:10', 8, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6881, 'Machnął ręką na odlew; nóż w powietrzu świsnął', '2021-07-08, 09:00:36', 89, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6882, 'Między głowy i pierwej uderzył, niż błysnął;', '2021-07-08, 09:00:53', 21, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6883, 'Uderza w dno gitary, na wylot ją wierci,', '2021-07-08, 09:02:11', 11, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6884, 'Schylił się na bok Ryków i tak uszedł śmierci,', '2021-07-08, 09:02:27', 48, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6885, 'Lecz strwożył się. Krzyknąwszy: «Jegry! bunt! Jej Bogu!»', '2021-07-08, 09:05:32', 99, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6886, 'Dobył szpady, broniąc się, zbliżał się do progu.', '2021-07-08, 09:09:40', 3, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6887, 'Wtem, z drugiej strony izby wpada szlachty wiele', '2021-07-08, 09:13:48', 82, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6888, 'Przez okna, z rapierami, Rózeczka na czele.', '2021-07-08, 13:14:16', 55, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6889, 'Płut w sieni, Ryków za nim, wołają żołnierzy.', '2021-07-08, 13:14:38', 58, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6890, 'Już trzech najbliższych domu na pomoc im bieży,', '2021-07-08, 13:14:47', 79, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6891, 'Już przeze drzwi włażą trzy błyszczące bagnety,', '2021-07-08, 13:18:11', 30, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6892, 'A za nimi trzy czarne schylone kaszkiety.', '2021-07-08, 15:22:32', 88, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6893, 'Maciek stał u drzwi z Rózgą wzniesioną do góry,', '2021-07-08, 15:22:48', 42, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6894, 'Lgnąc do ściany, czatował jako kot na szczury,', '2021-07-08, 18:22:50', 28, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6895, 'Aż ciął okropnie: może głowy by trzy zwalił;', '2021-07-08, 18:23:16', 16, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6896, 'Lecz stary czy nie dojrzał, czy zbyt się zapalił:', '2021-07-08, 18:26:17', 81, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6897, 'Bo nim szyję wytknęli, rąbnął po kaszkietach,', '2021-07-08, 18:26:27', 24, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6898, 'Zdarł je; Rózga spadając brzękła po bagnetach.', '2021-07-08, 18:28:55', 41, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6899, 'Moskale cofają się, Maciek ich wygania', '2021-07-08, 18:29:19', 63, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6900, 'Na dziedziniec.', '2021-07-08, 18:29:47', 26, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6901, 'Tam jeszcze więcej zamieszania.', '2021-07-08, 18:30:13', 18, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6902, 'Tam stronnicy Sopliców pracują w zawody', '2021-07-08, 18:30:31', 85, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6903, 'Nad rozkuciem Dobrzyńskich, rozrywają kłody.', '2021-07-08, 18:30:48', 95, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6904, 'Widząc to, jegry za broń porywają, biegą.', '2021-07-08, 18:32:59', 34, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6905, 'Sierżant wpadłszy bagnetem przebił Podhajskiego,', '2021-07-08, 18:33:22', 43, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6906, 'Dwóch drugich szlachty zranił, do trzeciego strzela:', '2021-07-08, 18:33:41', 34, 11, false);
