INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6908, 'Ten już miał ręce wolne, gotowe ku walce;', '2021-07-08, 19:34:00', 89, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6909, 'Wstał, podniósł dłoń i zwinął w kłębek długie palce,', '2021-07-08, 19:34:17', 53, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6910, 'I z góry tak uderzył w grzbiet Rosyjanina,', '2021-07-08, 19:34:20', 90, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6911, 'Że twarz jego i skroń wbił w zamek karabina;', '2021-07-08, 19:34:23', 23, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6912, 'Trzasł zamek: lecz zalany krwią proch już nie spalił;', '2021-07-09, 03:34:38', 15, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6913, 'Sierżant u nóg Chrzciciela na swą broń się zwalił.', '2021-07-09, 03:34:54', 98, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6914, 'Chrzciciel schyla się, chwyta karabin za rurę', '2021-07-09, 08:35:06', 60, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6915, 'I wijąc jak kropidłem podnosi go w górę,', '2021-07-09, 08:35:13', 48, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6916, 'Robi młynka, dwóch zaraz szeregowych zwala', '2021-07-09, 08:39:22', 53, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6917, 'Po ramionach i w głowę ugadza kaprala.', '2021-07-09, 08:42:42', 30, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6918, 'Reszta zlękła od kłody cofa się z przestrachem:', '2021-07-09, 08:42:49', 35, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6919, 'Tak Kropiciel ruchomym nakrył szlachtę dachem.', '2021-07-09, 08:45:12', 1, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6920, 'Za czym rozbito kłodę, rozcięto powrozy.', '2021-07-09, 16:45:21', 78, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6921, 'Szlachta, już wolna, wpada na kwestarskie wozy;', '2021-07-09, 16:49:47', 79, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6922, 'Z nich dobywa rapiery, pałasze, tasaki,', '2021-07-09, 16:49:55', 81, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6923, 'Kosy, strzelby; Konewka znalazł dwa szturmaki', '2021-07-09, 16:50:19', 93, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6924, 'I worek kul; wsypał je do swego szturmaka,', '2021-07-09, 16:51:25', 75, 13, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6925, 'Drugi, równie nabiwszy, ustąpił dla Saka.', '2021-07-09, 16:53:53', 78, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6926, 'Jegrów więcej przybywa. Mieszają się, tłuką;', '2021-07-09, 16:54:01', 34, 18, false);
