INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6928, 'Jegry nie mogą strzelać; już walczą wręcz z bliska,', '2021-07-09, 19:58:23', 31, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6929, 'Już stal ząb za ząb o stal porwawszy się pryska,', '2021-07-09, 20:00:24', 46, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6930, 'Bagnet o szablę, kosa o gifes się łamie,', '2021-07-09, 20:02:53', 79, 3, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6931, 'Pięść spotyka się z pięścią i z ramieniem ramię.', '2021-07-09, 20:03:18', 33, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6932, 'Lecz Ryków z częścią jegrów pobiegł, gdzie stodoła', '2021-07-09, 20:06:31', 94, 7, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6933, 'Tyka płotów; tam staje, na żołnierzy woła,', '2021-07-09, 20:07:45', 46, 9, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6934, 'Ażeby zaprzestali bitwę tak bezładną,', '2021-07-09, 20:07:56', 96, 15, false);
