INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6936, 'Gniewny, że sam nie może dać ognia, bo w tłumie', '2021-07-09, 20:14:14', 75, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6937, 'Moskalów od Polaków rozróżnić nie umie,', '2021-07-09, 20:18:38', 3, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6938, 'Woła: «Stroj się!» (co znaczy: formuj się do szyku)', '2021-07-10, 02:18:46', 73, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6939, 'Ale komendy jego nie słychać śród krzyku.', '2021-07-10, 02:21:12', 87, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6940, 'Stary Maciek, do ręcznych zapasów niezdolny,', '2021-07-10, 02:21:25', 94, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6941, 'Rejterował się, czyniąc przed sobą plac wolny', '2021-07-10, 10:24:46', 3, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6942, 'Na prawo i na lewo. Tu, końcem szablicy', '2021-07-10, 10:25:46', 81, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6943, 'Uciera bagnet z rury jako knot ze świécy;', '2021-07-10, 21:25:50', 82, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6944, 'Tam, machnąwszy na odlew, ścina albo kole:', '2021-07-10, 21:29:02', 8, 17, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6945, 'I tak ostróżny Maciek ustępuje w pole.', '2021-07-10, 21:29:31', 63, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6946, 'Lecz z największym na niego naciera uporem', '2021-07-10, 21:29:32', 99, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6947, 'Stary Gifrejter, co był pułku instruktorem,', '2021-07-10, 21:29:59', 77, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6948, 'Wielki mistrz na bagnety. Zebrał się sam w sobie,', '2021-07-10, 21:32:59', 41, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6949, 'Skurczył się, a karabin porwał w ręce obie,', '2021-07-10, 21:33:22', 8, 12, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6950, 'Prawą u zamka, lewą w pół rury porywa,', '2021-07-10, 21:37:23', 61, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6951, 'Kręci się, podskakuje, czasem przysiadywa,', '2021-07-10, 21:41:31', 35, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6952, 'Lewą rękę opuszcza, a broń z prawej ręki', '2021-07-10, 21:41:42', 67, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6953, 'Suwa naprzód jak żądło z wężowej paszczęki', '2021-07-10, 21:43:53', 7, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6954, 'I znowu ją w tył cofa, na kolanie wspiera:', '2021-07-10, 21:47:09', 92, 6, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6955, 'I tak kręcąc się, skacząc, na Maćka naciera.', '2021-07-11, 00:47:20', 33, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6956, 'Ocenił przeciwnika zręczność Maciek stary', '2021-07-11, 00:47:45', 84, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6957, 'I lewą ręką włożył na nos okulary,', '2021-07-11, 00:48:54', 42, 18, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6958, 'Prawą, rękojeść Rózgi tuż przy piersiach trzyma,', '2021-07-11, 00:48:57', 74, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6959, 'Cofa się, Gifrejtera ruch śledząc oczyma;', '2021-07-11, 00:53:14', 65, 11, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6960, 'Sam słania się na nogach, jakoby był pijany.', '2021-07-11, 04:54:18', 13, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6961, 'Gifrejter bieży prędzej i pewny wygranej;', '2021-07-11, 04:54:42', 62, 10, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6962, 'Żeby uchodzącego tym łacniej dosiągnął,', '2021-07-11, 04:56:45', 58, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6963, 'Powstał i całą prawą rękę wzdłuż wyciągnął,', '2021-07-11, 04:56:52', 57, 2, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6964, 'Popychając karabin, a tak się wysilił', '2021-07-11, 04:59:21', 75, 8, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6965, 'Pchnięciem i wagą broni, że się aż pochylił:', '2021-07-11, 05:03:29', 62, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6966, 'Maciek, tam kędy bagnet wkłada się na rurę,', '2021-07-11, 13:04:50', 66, 4, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6967, 'Podstawia swą rękojeść, podbija broń w górę', '2021-07-11, 13:08:53', 95, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6968, 'I wnet spuszczając Rózgę, tnie Moskala w rękę', '2021-07-11, 13:09:05', 68, 19, false);
