INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6970, 'Tak padł Gifrejter, fechmistrz najpierwszy z Moskalów,', '2021-07-11, 13:15:32', 8, 5, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6971, 'Kawaler trzech krzyżyków i czterech medalów.', '2021-07-11, 13:15:40', 39, 19, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6972, 'Tymczasem koło kłodek lewe szlachty skrzydło', '2021-07-11, 13:16:02', 81, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (6973, 'Już jest bliskie zwycięstwa. Tam walczył Kropidło', '2021-07-11, 13:17:16', 52, 4, false);
