INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (7081, 'Wre bitwa, wybiegł, za nim wybiegł Podkomorzy,', '2021-07-13, 12:54:32', 77, 16, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (7082, 'Któremu Tomasz wreszcie przyniósł karabelę;', '2021-07-13, 21:54:41', 97, 17, false);
