INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (7084, 'Bieży, broń wzniósłszy, szlachta rusza jego śladem:', '2021-07-13, 21:59:02', 81, 4, false);
