INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (7097, 'Kapitan pokazując szpadą na drzwi dworu,', '2021-07-14, 12:19:29', 38, 15, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (7098, 'Krzyczy: «Sędzio! poddaj się, bo dwór spalić każę!»', '2021-07-14, 12:23:41', 34, 1, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (7099, '«Pal — woła Sędzia — ja cię w tym ogniu usmażę».', '2021-07-14, 12:23:59', 9, 14, false);
INSERT INTO messages(message_id, content, time_created, author_user_id, channel_id, is_deleted) VALUES (7100, 'O dworze Soplicowski! Jeśli dotąd całe', '2021-07-14, 12:28:03', 22, 16, false);
